	sap.zen.ScriptSequence.prototype.createScript = function(oPage) {
		var lCommand = "";
		var lScriptSequenceItem;
		var loScriptSequenceItem;
		var lScript;
		var lIdForRendering;
		for (lScriptSequenceItem = 0; lScriptSequenceItem < this.tScriptSequenceItems
				.size(); lScriptSequenceItem++) {
			loScriptSequenceItem = this.tScriptSequenceItems
					.get(lScriptSequenceItem);
			if (oFF.isNull(loScriptSequenceItem)) {
				continue;
			}
			lScript = loScriptSequenceItem.getScript();
			lCommand = oFF.XStringUtils.concatenate2(lCommand, lScript);
		}
		lCommand = sap.buddha.XSSEncoder.encodeJavaScript(lCommand);
		lIdForRendering = oPage.getPageIdForScripting();
		lCommand = oFF.XStringUtils.concatenate4(
				"window.putInQueue(function(){", lIdForRendering, ".exec('",
				lCommand);
		lCommand = oFF.XStringUtils.concatenate2(lCommand, "');});");
		return lCommand;
	};
