	sap.zen.AxisWrapper.prototype.initMe = function(queryManager) {
		this.queryManager = queryManager;
	};
	sap.zen.AxisWrapper.prototype.getRows = function() {
		var characteristics = this.queryManager.getQueryModel().getRowsAxis()
				.getDimensions();
		return this.getNameList(characteristics);
	};
	sap.zen.AxisWrapper.prototype.getColumns = function() {
		var characteristics = this.queryManager.getQueryModel()
				.getColumnsAxis().getDimensions();
		return this.getNameList(characteristics);
	};
	sap.zen.AxisWrapper.prototype.getNameList = function(tDimensions) {
		var ltDimensionNames;
		var lDimensionIndex;
		var loDimension;
		if (oFF.isNull(tDimensions) || tDimensions.isEmpty()) {
			return oFF.XListOfString.create();
		}
		ltDimensionNames = oFF.XListOfString.create();
		for (lDimensionIndex = 0; lDimensionIndex < tDimensions.size(); lDimensionIndex++) {
			loDimension = tDimensions.get(lDimensionIndex);
			if (oFF.isNull(loDimension)) {
				continue;
			}
			if (loDimension.getUniversalDisplayHierarchy() === null) {
				ltDimensionNames.add(loDimension.getName());
			}
		}
		return ltDimensionNames;
	};
	sap.zen.AxisWrapper.prototype.applyAxisConfig = function(rows, columns) {
		if (this.hasAxisContentChanged(rows, this.queryManager.getQueryModel()
				.getRowsAxis())) {
			this.buildNewAxis(rows, this.queryManager.getQueryModel()
					.getRowsAxis());
		}
		if (this.hasAxisContentChanged(columns, this.queryManager
				.getQueryModel().getColumnsAxis())) {
			this.buildNewAxis(columns, this.queryManager.getQueryModel()
					.getColumnsAxis());
		}
	};
	sap.zen.AxisWrapper.prototype.buildNewAxis = function(tAxisDimensionNames,
			oAxis) {
		var loQueryModel;
		var lAxisIndex;
		var lDimensionName;
		var loDimension;
		if (oFF.isNull(oAxis)) {
			return;
		}
		oAxis.clear();
		loQueryModel = oAxis.getQueryModel();
		if (oFF.notNull(tAxisDimensionNames)) {
			for (lAxisIndex = 0; lAxisIndex < tAxisDimensionNames.size(); lAxisIndex++) {
				lDimensionName = tAxisDimensionNames.get(lAxisIndex);
				if (oFF.isNull(lDimensionName)) {
					continue;
				}
				loDimension = loQueryModel.getDimensionByName(lDimensionName);
				if (oFF.isNull(loDimension)) {
					continue;
				}
				oAxis.add(loDimension);
			}
		}
	};
	sap.zen.AxisWrapper.prototype.hasAxisContentChanged = function(
			tAxisDimensionNames, oAxis) {
		var ltAxisDimensions = oAxis.getDimensions();
		var lDimensionIndex;
		var loAxisDimension;
		var lDimensionName;
		if (ltAxisDimensions.size() !== tAxisDimensionNames.size()) {
			return true;
		}
		for (lDimensionIndex = 0; lDimensionIndex < ltAxisDimensions.size(); lDimensionIndex++) {
			loAxisDimension = ltAxisDimensions.get(lDimensionIndex);
			if (oFF.isNull(loAxisDimension)) {
				continue;
			}
			lDimensionName = loAxisDimension.getName();
			if (!oFF.XString.isEqual(lDimensionName, tAxisDimensionNames
					.get(lDimensionIndex))) {
				return true;
			}
		}
		return false;
	};
