	sap.zen.MemberWrapper.prototype.reloadMember = function(oDataSource) {
		var loDimension = this.getDimension();
		var loInternalDimension;
		var loDimensionMember;
		var loInternalDimensionMember;
		var ltKeys;
		var lKey;
		var loCharacteristicWrapper;
		var ltDimensionMembers;
		if (oFF.isNull(loDimension)) {
			return;
		}
		loInternalDimension = loDimension.getInternalObject();
		if (oFF.isNull(loInternalDimension)) {
			return;
		}
		loDimensionMember = this.getDimensionMember();
		if (oFF.isNull(loDimensionMember)) {
			return;
		}
		loInternalDimensionMember = loDimensionMember.getInternalObject();
		if (oFF.isNull(loInternalDimensionMember)) {
			return;
		}
		if (!this.variableMode) {
			ltKeys = oFF.XListOfString.create();
			lKey = this.getKey();
			if (oFF.notNull(lKey)) {
				ltKeys.add(lKey);
			}
			loCharacteristicWrapper = sap.zen.CharacteristicWrapper
					.createForReload(oDataSource, loInternalDimension);
			ltDimensionMembers = loCharacteristicWrapper.getMembersByKeys(
					ltKeys, false);
			if (!ltDimensionMembers.isEmpty()) {
				loInternalDimensionMember = ltDimensionMembers.get(0);
				this.oDimensionMember = sap.zen.DimensionMember
						.createDimensionMemberForInternalObject(loDimension,
								loInternalDimensionMember);
			}
		}
	};
	sap.zen.MemberWrapper.prototype.hasDisplayKeys = function() {
		var loDimension = this.getDimension();
		var loInternalDimension;
		var loDimensionMember;
		var loInternalDimensionMember;
		var loFieldDisplayKeyNotCompound;
		var loFieldDisplayKey;
		if (oFF.isNull(loDimension)) {
			return false;
		}
		loInternalDimension = loDimension.getInternalObject();
		if (oFF.isNull(loInternalDimension)) {
			return false;
		}
		loDimensionMember = this.getDimensionMember();
		if (oFF.isNull(loDimensionMember)) {
			return false;
		}
		loInternalDimensionMember = loDimensionMember.getInternalObject();
		if (oFF.isNull(loInternalDimensionMember)) {
			return false;
		}
		if (loDimension.isCompound()) {
			loFieldDisplayKeyNotCompound = loInternalDimension
					.getFirstFieldByType(oFF.PresentationType.DISPLAY_KEY_NOT_COMPOUND);
			if (oFF.notNull(loFieldDisplayKeyNotCompound)
					&& (loInternalDimensionMember
							.getFieldValue(loFieldDisplayKeyNotCompound) !== null || (oFF
							.notNull(this.oInternalFilterValueBag) && this.oInternalFilterValueBag
							.getSupplementValueString(loFieldDisplayKeyNotCompound
									.getName()) !== null))) {
				return true;
			}
		} else {
			loFieldDisplayKey = loInternalDimension
					.getFirstFieldByType(oFF.PresentationType.DISPLAY_KEY);
			if (oFF.notNull(loFieldDisplayKey)
					&& (loInternalDimensionMember
							.getFieldValue(loFieldDisplayKey) !== null || (oFF
							.notNull(this.oInternalFilterValueBag) && this.oInternalFilterValueBag
							.getSupplementValueString(loFieldDisplayKey
									.getName()) !== null))) {
				return true;
			}
		}
		return false;
	};
