	sap.zen.VariableContainerWrapper.prototype.checkValue = function(key) {
		return true;
	};
	sap.zen.VariableContainerWrapper.prototype.checkValues = function() {
		var lSuccess = true;
		var lDataSourceIndex;
		var loDataSource;
		var loVariableProcessor;
		var loResult;
		for (lDataSourceIndex = 0; lDataSourceIndex < this.tDataSources.size(); lDataSourceIndex++) {
			loDataSource = this.tDataSources.get(lDataSourceIndex);
			if (oFF.isNull(loDataSource)) {
				continue;
			}
			loVariableProcessor = loDataSource.getVariableProcessor();
			if (oFF.isNull(loVariableProcessor)) {
				continue;
			}
			if (!loVariableProcessor.isDirectVariableTransferEnabled()) {
				loResult = loVariableProcessor.transferVariables(
						oFF.SyncType.BLOCKING, null, null);
				this.oPage.createMessagesFromCollectionForCategory(
						sap.zen.CMessageCategory.VARIABLES, loResult);
				if (loResult.hasErrors()
						|| loResult.hasSeverity(oFF.Severity.SEMANTICAL_ERROR)) {
					lSuccess = false;
				}
			}
		}
		return lSuccess;
	};
	sap.zen.VariableContainerWrapper.prototype.submit = function() {
		if ((oFF.isNull(this.tDataSources)) || (this.tDataSources.size() === 0)) {
			return true;
		}
		return sap.zen.VariablesUtils
				.submitVariables_DataSources(this.tDataSources.getIterator());
	};
	sap.zen.VariableContainerWrapper.prototype.synchronize = function() {
		var lSuccess = sap.zen.VariablesUtils
				.synchronize_DataSources(this.tDataSources.getIterator());
		if (lSuccess) {
			this.initVariableWrappers();
		}
	};
	sap.zen.VariableContainerWrapper.prototype.createWrapper = function(
			dataSourceName, oVariable, maxMembers) {
		var variableType = oVariable.getVariableType();
		if (variableType.isEqualTo(oFF.VariableType.DIMENSION_MEMBER_VARIABLE)
				|| variableType
						.isEqualTo(oFF.VariableType.HIERARCHY_NODE_VARIABLE)) {
			return this.getCharacteristicMemberVariableWrapper(dataSourceName,
					oVariable, maxMembers);
		} else {
			if (variableType.isEqualTo(oFF.VariableType.OPTION_LIST_VARIABLE)) {
				return this.getOptionVariableWrapper(dataSourceName, oVariable);
			} else {
				if (variableType
						.isEqualTo(oFF.VariableType.SIMPLE_TYPE_VARIABLE)
						|| variableType
								.isEqualTo(oFF.VariableType.FORMULA_VARIABLE)
						|| variableType
								.isEqualTo(oFF.VariableType.TEXT_VARIABLE)) {
					return this.getTextVariableWrapper(dataSourceName,
							oVariable);
				} else {
					if (variableType
							.isEqualTo(oFF.VariableType.HIERARCHY_NAME_VARIABLE)) {
						return this.getHierarchyVariableWrapper(dataSourceName,
								oVariable, maxMembers);
					}
				}
			}
		}
		return null;
	};
	sap.zen.VariableContainerWrapper.prototype.getHierarchyVariableWrapper = function(
			dataSourceName, oVariable, maxMembers) {
		var loDataSource = this.oPage.getDataSource(dataSourceName);
		var loVariableWrapper = sap.zen.HierarchyVariableWrapper
				.createCharacteristicWrapper2(loDataSource, oVariable,
						sap.zen.CMemberDisplayMode.KEY_TEXT);
		loVariableWrapper.setMaxMembers(maxMembers);
		return loVariableWrapper;
	};
	sap.zen.VariableContainerWrapper.prototype.getOptionVariableWrapper = function(
			dataSourceName, oVariable) {
		var loVariableWrapper = new sap.zen.OptionListVariableWrapper();
		var loDataSource = this.oPage.getDataSource(dataSourceName);
		loVariableWrapper.initMe2(oVariable,
				sap.zen.CMemberDisplayMode.KEY_TEXT, dataSourceName,
				loDataSource, this.oPage);
		return loVariableWrapper;
	};
	sap.zen.VariableContainerWrapper.prototype.getTextVariableWrapper = function(
			dataSourceName, oVariable) {
		var loVariableWrapper = new sap.zen.TextVariableWrapper();
		loVariableWrapper.initMe(oVariable, dataSourceName);
		return loVariableWrapper;
	};
	sap.zen.VariableContainerWrapper.prototype.cancel = function() {
		var lHasErrors;
		var lDataSourceIndex;
		var loDataSource;
		var loVariableProcessor;
		var loResult;
		if ((oFF.isNull(this.tDataSources)) || (this.tDataSources.size() === 0)) {
			return true;
		}
		lHasErrors = false;
		for (lDataSourceIndex = 0; lDataSourceIndex < this.tDataSources.size(); lDataSourceIndex++) {
			loDataSource = this.tDataSources.get(lDataSourceIndex);
			if (oFF.isNull(loDataSource)) {
				continue;
			}
			loVariableProcessor = loDataSource.getVariableProcessor();
			if (oFF.isNull(loVariableProcessor)) {
				return true;
			}
			if (loVariableProcessor.supportsReInitVariables()
					&& !loVariableProcessor.isSubmitted()) {
				loResult = loVariableProcessor.cancelReInitVariables(
						oFF.SyncType.BLOCKING, null, null);
				this.oPage.createMessagesFromCollectionForCategory(
						sap.zen.CMessageCategory.VARIABLES, loResult);
				if (loResult.hasErrors()) {
					lHasErrors = true;
				} else {
					if (!loVariableProcessor.isSubmitted()) {
						sap.zen.VariablesUtils
								.submitVariables_VariableProcessor(loVariableProcessor);
					}
				}
			}
		}
		return !lHasErrors;
	};
