	sap.zen.CharacteristicConfig.parseJSON = function(oJsonParser, jsonString) {
		var ltCharacteristicConfig = oFF.XList.create();
		var loJsonRootElement;
		var loJsonListDimensions;
		var lAmountOfDimensions;
		var lDimensionIndex;
		var loJsonElementDimension;
		var loJsonStructureDimensions;
		var loCharacteristicConfig;
		ltCharacteristicConfig = oFF.XList.create();
		if ((oFF.isNull(jsonString)) || oFF.XString.size(jsonString) === 0) {
			return ltCharacteristicConfig;
		}
		jsonString = oFF.XString.replace(jsonString, "name:", '"name":');
		loJsonRootElement = oJsonParser.parse(jsonString);
		loJsonListDimensions = loJsonRootElement.asList();
		lAmountOfDimensions = loJsonListDimensions.size();
		for (lDimensionIndex = 0; lDimensionIndex < lAmountOfDimensions; lDimensionIndex++) {
			loJsonElementDimension = loJsonListDimensions.get(lDimensionIndex);
			if (oFF.isNull(loJsonElementDimension)) {
				continue;
			}
			loJsonStructureDimensions = loJsonElementDimension.asStructure();
			if (oFF.isNull(loJsonStructureDimensions)) {
				continue;
			}
			loCharacteristicConfig = new sap.zen.CharacteristicConfig();
			loCharacteristicConfig.name = loJsonStructureDimensions
					.getStringByKey(sap.zen.CharacteristicConfig.NAME_KEY);
			ltCharacteristicConfig.add(loCharacteristicConfig);
		}
		return ltCharacteristicConfig;
	};
