	sap.zen.ZCrosstabColWidthHandler.create = function(crosstabControl) {
		var lInstance = new sap.zen.ZCrosstabColWidthHandler();
		lInstance.initColWidthHandler(crosstabControl);
		return lInstance;
	};
	sap.zen.ZCrosstabColWidthHandler.prototype.colsWithSetWidth = null;
	sap.zen.ZCrosstabColWidthHandler.prototype.crosstabControl = null;
	sap.zen.ZCrosstabColWidthHandler.prototype.initColWidthHandler = function(
			crosstabControl) {
		this.colsWithSetWidth = oFF.XHashMapByString.create();
		this.crosstabControl = crosstabControl;
	};
	sap.zen.ZCrosstabColWidthHandler.prototype.getUserColWidths = function() {
		this.colsWithSetWidth = this
				.getUserColWidthsFromInitParams(this.colsWithSetWidth);
		return this.colsWithSetWidth;
	};
	sap.zen.ZCrosstabColWidthHandler.prototype.getUserColWidth = function(colId) {
		var lColumnWidthInfo;
		if (!this.isColIdValid(colId, true)) {
			return null;
		}
		lColumnWidthInfo = null;
		if (this.colsWithSetWidth.containsKey(colId)) {
			lColumnWidthInfo = this.colsWithSetWidth.getByKey(colId);
		} else {
			if (this.colsWithSetWidth
					.containsKey(sap.zen.ZCrosstabControl.COLID_ALL_COLUMNS)) {
				lColumnWidthInfo = this.colsWithSetWidth
						.getByKey(sap.zen.ZCrosstabControl.COLID_ALL_COLUMNS);
			}
		}
		return lColumnWidthInfo;
	};
	sap.zen.ZCrosstabColWidthHandler.prototype.resetUserColWidth = function(
			colId) {
		var lColumnWidthInfo;
		if (!this.isColIdValid(colId, false)) {
			return;
		}
		lColumnWidthInfo = null;
		if (oFF.XString.isEqual(sap.zen.ZCrosstabControl.COLID_ALL_COLUMNS,
				colId)) {
			this.colsWithSetWidth.clear();
		} else {
			if (!this.colsWithSetWidth.containsKey(colId)) {
				if (this.colsWithSetWidth
						.containsKey(sap.zen.ZCrosstabControl.COLID_ALL_COLUMNS)) {
					lColumnWidthInfo = sap.zen.ZCrosstabColWidthInfo.create("",
							true);
					this.colsWithSetWidth.put(colId, lColumnWidthInfo);
				}
			} else {
				this.colsWithSetWidth.remove(colId);
			}
		}
	};
	sap.zen.ZCrosstabColWidthHandler.prototype.setUserColWidth = function(
			colId, width) {
		var lUseDefaultWidth;
		var lColumnWidthInfo;
		if (!this.isColIdValid(colId, false) || !this.isColWidthValid(width)) {
			return;
		}
		if (oFF.XString.isEqual("-1", colId)) {
			colId = sap.zen.ZCrosstabControl.COLID_ALL_COLUMNS;
		}
		if (oFF.XString.isEqual(sap.zen.ZCrosstabControl.COLID_ALL_COLUMNS,
				colId)) {
			this.colsWithSetWidth.clear();
		}
		lUseDefaultWidth = (oFF.isNull(width))
				|| (oFF.XString.isEqual(width, "") || (oFF.XInteger
						.convertFromString(width) <= 0));
		if (lUseDefaultWidth) {
			width = "";
		}
		lColumnWidthInfo = null;
		if (this.colsWithSetWidth.containsKey(colId)) {
			lColumnWidthInfo = this.colsWithSetWidth.getByKey(colId);
			lColumnWidthInfo.initMe(width, lUseDefaultWidth);
		} else {
			lColumnWidthInfo = sap.zen.ZCrosstabColWidthInfo.create(width,
					lUseDefaultWidth);
			this.colsWithSetWidth.put(colId, lColumnWidthInfo);
		}
	};
	sap.zen.ZCrosstabColWidthHandler.prototype.setUserColWidths = function(
			columnWidths) {
		var ltKeys;
		var lColId;
		var lColumnWidthInfo;
		if (columnWidths.size() <= 0) {
			return;
		}
		ltKeys = columnWidths.getKeysAsIteratorOfString();
		while (ltKeys.hasNext()) {
			lColId = ltKeys.next();
			lColumnWidthInfo = columnWidths.getByKey(lColId);
			this.setUserColWidth(lColId, lColumnWidthInfo.getWidth());
		}
	};
	sap.zen.ZCrosstabColWidthHandler.prototype.isColIdValid = function(colId,
			strict) {
		var lIsValid = true;
		var lColIndex;
		if (!strict) {
			if (oFF.XString.isEqual(colId, "-1")) {
				colId = sap.zen.ZCrosstabControl.COLID_ALL_COLUMNS;
			}
			if (oFF.XString.isEqual(colId,
					sap.zen.ZCrosstabControl.COLID_ALL_COLUMNS)) {
				return true;
			}
		}
		lColIndex = 0;
		try {
			lColIndex = oFF.XInteger.convertFromString(colId);
		} catch (e) {
			lIsValid = false;
		}
		lIsValid = lColIndex >= 0;
		return lIsValid;
	};
	sap.zen.ZCrosstabColWidthHandler.prototype.isColWidthValid = function(
			colWidth) {
		var lIsValid = true;
		var lWidth = 0;
		try {
			lWidth = oFF.XInteger.convertFromString(colWidth);
		} catch (e) {
			lIsValid = false;
		}
		lIsValid = (lWidth >= 0) || (lWidth === -1);
		return lIsValid;
	};
	sap.zen.ZCrosstabColWidthHandler.prototype.getUserColWidthsFromInitParams = function(
			existingColWidths) {
		var ltColumnWidths;
		var lColWidthDefNode;
		var ltColWidthDefNodeValues;
		var lColWidthValue;
		var lColumnWidthInfo;
		var colWidthInfoList;
		var colIdNode;
		var lColId;
		var colWidthNode;
		var colIdIgnoreNode;
		var sIsIgnore;
		var bIsIgnore;
		if (oFF.notNull(existingColWidths)) {
			ltColumnWidths = existingColWidths.createMapByStringCopy();
		} else {
			ltColumnWidths = oFF.XHashMapByString.create();
		}
		lColWidthDefNode = this.crosstabControl.getInitParameters()
				.getFirstChildWithNameTag("CROSSTAB_USER_COL_WIDTH_LIST");
		if (oFF.isNull(lColWidthDefNode)) {
			return ltColumnWidths;
		}
		ltColWidthDefNodeValues = lColWidthDefNode.getChildren("property")
				.getIterator();
		while (ltColWidthDefNodeValues.hasNext()) {
			lColWidthValue = ltColWidthDefNodeValues.next();
			lColumnWidthInfo = new sap.zen.ZCrosstabColWidthInfo();
			colWidthInfoList = lColWidthValue.getChildren("property");
			colIdNode = colWidthInfoList.get(0);
			lColId = null;
			if (oFF.XString.isEqual(colIdNode.getAttribute("name"),
					"CROSSTAB_COLID")) {
				lColId = colIdNode.getAttribute("value");
			}
			colWidthNode = colWidthInfoList.get(1);
			if (oFF.XString.isEqual(colWidthNode.getAttribute("name"),
					"CROSSTAB_COLWIDTH")) {
				lColumnWidthInfo.setWidth(colWidthNode.getAttribute("value"));
			}
			colIdIgnoreNode = colWidthInfoList.get(1);
			if (oFF.XString.isEqual(colIdNode.getAttribute("name"),
					"CROSSTAB_COLID_IGNORE")) {
				sIsIgnore = colIdIgnoreNode.getAttribute("value");
				bIsIgnore = false;
				if (oFF.XString.isEqual("X", sIsIgnore)) {
					bIsIgnore = true;
				}
				lColumnWidthInfo.setIgnore(bIsIgnore);
			}
			if (!ltColumnWidths.containsKey(lColId)) {
				if (oFF.notNull(existingColWidths)
						&& existingColWidths.containsKey(lColId)) {
					ltColumnWidths.put(lColId, existingColWidths
							.getByKey(lColId));
				} else {
					if (oFF.notNull(existingColWidths)
							&& existingColWidths
									.containsKey(sap.zen.ZCrosstabControl.COLID_ALL_COLUMNS)) {
						ltColumnWidths
								.put(
										sap.zen.ZCrosstabControl.COLID_ALL_COLUMNS,
										existingColWidths
												.getByKey(sap.zen.ZCrosstabControl.COLID_ALL_COLUMNS));
					} else {
						ltColumnWidths.put(lColId, lColumnWidthInfo);
					}
				}
			}
		}
		return ltColumnWidths;
	};
