			loVariable = sap.zen.VariablesUtils
					.getInputEnabledVariable_DataSource(oDataSource,
							variableName);
			if (oFF.isNull(loVariable)) {
				return false;
			}
			loVariableWrapper = sap.zen.VariableWrapper.createWrapperByName(
					oDataSource, variableName);
			if (oFF.isNull(loVariableWrapper)) {
				return false;
			}
			loResult = sap.zen.DataSourceScriptApiUtils
					.convertSelectionObjectToRangeList(obj, loVariableWrapper
							.supportsMultiSelection(), loVariableWrapper
							.supportsRange(), loVariableWrapper
							.supportsInterval(), true);
			if (!loResult.getSecondObject().isEmpty()) {
				loVariableWrapper.setFullRangeQueryByField(loResult
						.getSecondObject(), useDisplayKey);
			}
			return loResult.getFirstObject().getBoolean();
