	sap.zen.Grid.prototype.initialize = function() {
		var loResultSet;
		this.initializationRequired = false;
		this.rows = -1;
		this.cols = -1;
		this.dataRows = -1;
		this.dataCols = -1;
		this.rowHeaders = -1;
		this.colHeaders = -1;
		this.noRowHeader = false;
		this.noColHeader = false;
		this.tRowHeadersWithTotals = oFF.XHashMapByString.create();
		this.tColHeadersWithTotals = oFF.XHashMapByString.create();
		this.tRowSpans = oFF.XList.create();
		this.tRowsLastProcessedTupleOfTupleElement = null;
		this.tColSpans = oFF.XList.create();
		this.tColsLastProcessedTupleOfTupleElement = null;
		this.scalingFactorDisplayAxis = null;
		this.scalingFactorDisplayAxisIndex = -1;
		loResultSet = this.getResultSet();
		if (oFF.isNull(loResultSet) || loResultSet.hasErrors()) {
			return;
		}
		this.dataRows = loResultSet.getAmountOfRows();
		this.dataCols = loResultSet.getAmountOfColumns();
		if ((this.dataRows === 0 && this.dataCols === 0)
				|| (this.dataRows === 0 && loResultSet
						.getAmountOfDimensionsOnAxis(oFF.AxisType.ROWS) > 0)
				|| (this.dataCols === 0 && loResultSet
						.getAmountOfDimensionsOnAxis(oFF.AxisType.COLUMNS) > 0)) {
			return;
		}
		this.provideAmountOfHeaders();
		this.rows = this.dataRows + this.colHeaders;
		this.cols = this.dataCols + this.rowHeaders;
	};
	sap.zen.Grid.prototype.provideAmountOfHeaders = function() {
		var loQueryModel = this.getQueryModel();
		var loResultSet;
		var ltColDimensions;
		var ltRowDimensions;
		var lMeasureDimensionAxis;
		var lMeasureDimensionAxisType;
		if (oFF.isNull(loQueryModel)) {
			return;
		}
		loResultSet = this.getResultSet();
		if (oFF.isNull(loResultSet)) {
			return;
		}
		this.rowHeaders = loResultSet
				.getAmountOfVisibleFieldsOnAxis(oFF.AxisType.ROWS);
		this.colHeaders = loResultSet
				.getAmountOfVisibleFieldsOnAxis(oFF.AxisType.COLUMNS);
		if (this.rowHeaders === 0) {
			ltColDimensions = loQueryModel.getColumnsAxis().getDimensions();
			if (!ltColDimensions.isEmpty()
					&& (ltColDimensions.size() > 1 || !ltColDimensions.get(0)
							.isStructure())) {
				this.rowHeaders = 1;
			}
			this.noRowHeader = true;
		}
		if (this.colHeaders === 0) {
			ltRowDimensions = loQueryModel.getRowsAxis().getDimensions();
			if (!ltRowDimensions.isEmpty()
					&& (ltRowDimensions.size() > 1 || !ltRowDimensions.get(0)
							.isStructure())) {
				this.colHeaders = 1;
			}
			this.noColHeader = true;
		}
		if (this.isDisplayScalingFactorsInHeader()) {
			lMeasureDimensionAxis = loQueryModel.getMeasureDimension()
					.getAxis();
			lMeasureDimensionAxisType = lMeasureDimensionAxis.getType();
			this.scalingFactorDisplayAxis = lMeasureDimensionAxisType;
			if (lMeasureDimensionAxisType === oFF.AxisType.ROWS) {
				this.rowHeaders++;
				this.scalingFactorDisplayAxisIndex = this.rowHeaders - 1;
			} else {
				if (lMeasureDimensionAxisType === oFF.AxisType.COLUMNS) {
					this.colHeaders++;
					this.scalingFactorDisplayAxisIndex = this.colHeaders - 1;
				}
			}
		}
	};
