	sap.zen.GridCell.prototype.oResultDataCell = null;
	sap.zen.GridCell.prototype.oGrid = null;
	sap.zen.GridCell.prototype.oDisplayArea = null;
	sap.zen.GridCell.prototype.axis = null;
	sap.zen.GridCell.prototype.rowIndex = 0;
	sap.zen.GridCell.prototype.colIndex = 0;
	sap.zen.GridCell.prototype.rowDataIndex = 0;
	sap.zen.GridCell.prototype.colDataIndex = 0;
	sap.zen.GridCell.prototype.rowSpan = 0;
	sap.zen.GridCell.prototype.colSpan = 0;
	sap.zen.GridCell.prototype.style = 0;
	sap.zen.GridCell.prototype.value = null;
	sap.zen.GridCell.prototype.valueType = null;
