	sap.zen.GridCell.prototype.initMe = function(oGrid, rowIndex, columnIndex,
			oDisplayArea) {
		var lRowIndex;
		var lColIndex;
		var lRowDataIndex;
		var lColDataIndex;
		this.oGrid = oGrid;
		this.oDisplayArea = oDisplayArea;
		this.rowIndex = rowIndex;
		this.colIndex = columnIndex;
		this.rowDataIndex = this.rowIndex - this.oGrid.getColumnHeaders();
		this.colDataIndex = this.colIndex - this.oGrid.getRowHeaders();
		this.axis = null;
		this.rowSpan = 0;
		this.colSpan = 0;
		this.style = 0;
		this.value = null;
		this.valueType = null;
		this.formatString = null;
		this.sortType = null;
		this.sortDirection = null;
		this.nodeState = null;
		this.nodeLevel = 0;
		this.nodeAlignment = null;
		this.tHeaderData = oFF.XList.create();
		this.oResultDataCell = null;
		lRowIndex = this.rowIndex;
		lColIndex = this.colIndex;
		if (oFF.notNull(this.oDisplayArea)) {
			lRowIndex = this.rowIndex - this.oDisplayArea.getRowOffset();
			lColIndex = this.colIndex - this.oDisplayArea.getColumnOffset();
			lRowDataIndex = lRowIndex - this.oGrid.getColumnHeaders();
			lColDataIndex = lColIndex - this.oGrid.getRowHeaders();
			if (lRowDataIndex < 0) {
				lRowDataIndex = -1;
			} else {
				lRowDataIndex = lRowDataIndex
						+ this.oDisplayArea.getRowOffset();
			}
			if (lColDataIndex < 0) {
				lColDataIndex = -1;
			} else {
				lColDataIndex = lColDataIndex
						+ this.oDisplayArea.getColumnOffset();
			}
		}
		if (lColIndex < this.oGrid.getRowHeaders()) {
			if (lRowIndex < this.oGrid.getColumnHeaders()) {
				this.provideDimensionHeaderCell(lRowIndex, lColIndex);
			} else {
				this.provideTupleElementHeaderCell(oFF.AxisType.ROWS,
						lRowIndex, lColIndex);
			}
		} else {
			if (lRowIndex < this.oGrid.getColumnHeaders()) {
				this.provideTupleElementHeaderCell(oFF.AxisType.COLUMNS,
						lRowIndex, lColIndex);
			} else {
				this.provideDataCell();
			}
		}
	};
