	sap.zen.GridCell.prototype.provideDimensionHeaderCell = function(rowIndex,
			colIndex) {
		var loResultSetInfo;
		var lIsScalingInfo;
		var ltHeaders;
		var lHeaderIndex;
		var loHeaderIterator;
		var loDimension;
		var loInternalField;
		var lDimensionHeader;
		var lFieldName;
		this.rowSpan = 1;
		this.colSpan = 1;
		this.value = "";
		this.valueType = oFF.XValueType.STRING;
		this.style = this.style + sap.zen.GridCell.STYLE_HEADER;
		loResultSetInfo = null;
		lIsScalingInfo = false;
		ltHeaders = oFF.XList.create();
		if (rowIndex === (this.oGrid.getColumnHeaders() - 1)) {
			if (this.oGrid.hasRowHeader()) {
				loResultSetInfo = sap.zen.ResultSetHelper.create(this.oGrid
						.getResultSet(), oFF.AxisType.ROWS, -1, colIndex);
				ltHeaders.add(loResultSetInfo);
			}
			if (this.oGrid.hasColumnHeader()) {
				if (colIndex === (this.oGrid.getRowHeaders() - 1)) {
					loResultSetInfo = sap.zen.ResultSetHelper
							.create(this.oGrid.getResultSet(),
									oFF.AxisType.COLUMNS, -1, rowIndex);
					ltHeaders.add(loResultSetInfo);
				}
			}
		} else {
			if (colIndex === (this.oGrid.getRowHeaders() - 1)) {
				loResultSetInfo = sap.zen.ResultSetHelper.create(this.oGrid
						.getResultSet(), oFF.AxisType.COLUMNS, -1, rowIndex);
				ltHeaders.add(loResultSetInfo);
			}
		}
		if (oFF.notNull(ltHeaders) && !ltHeaders.isEmpty()) {
			lHeaderIndex = 0;
			loHeaderIterator = ltHeaders.getIterator();
			while (loHeaderIterator.hasNext()) {
				loResultSetInfo = loHeaderIterator.next();
				if (oFF.isNull(loResultSetInfo)) {
					continue;
				}
				this.tHeaderData.add(loResultSetInfo);
				loDimension = loResultSetInfo.getDimension();
				loInternalField = loResultSetInfo.getField();
				lIsScalingInfo = this.isScalingFactorCell(loResultSetInfo,
						rowIndex, colIndex);
				lDimensionHeader = null;
				if (!lIsScalingInfo && !loDimension.isMeasureStructure()) {
					lFieldName = null;
					if (oFF.notNull(loInternalField)) {
						lFieldName = loInternalField.getName();
					}
					lDimensionHeader = loDimension.getHeaderText(lFieldName);
				}
				if (oFF.XStringUtils.isNullOrEmpty(this.value)) {
					this.value = lDimensionHeader;
				} else {
					if (oFF.XStringUtils.isNotNullAndNotEmpty(lDimensionHeader)) {
						this.value = oFF.XStringUtils.concatenate3(this.value,
								" | ", lDimensionHeader);
					}
				}
				if (lHeaderIndex > 0) {
					continue;
				}
				this.axis = loResultSetInfo.getAxis();
				this
						.provideSortInformation(loResultSetInfo, rowIndex,
								colIndex);
				lHeaderIndex++;
			}
		}
	};
	sap.zen.GridCell.prototype.provideTupleElementHeaderCell = function(axis,
			rowIndex, colIndex) {
		var lAxisIndex = 0;
		var lAxisDataIndex = 0;
		var lOtherAxisIndex = 0;
		var lHasHeader = true;
		var lHeaders = 0;
		var ltAxisHeadersWithTotals = null;
		var lAxisSpan;
		var lOtherAxisSpan;
		var loResultSetInfo;
		var lIsScalingInfo;
		var lAxisIndexAsString;
		var lOtherAxisIndexAsString;
		var lAxisKey;
		var loInternalMeasureDimension;
		var lMeasureIndexOnOtherAxis;
		var lLookaheadIndex;
		var loResultsetInfoLookAheadCol;
		var lLookAheadOtherAxisIndexAsString;
		var lLookAheadAxisKey;
		var loDimension;
		var loDimensionMember;
		var loInternalField;
		var loInternalFieldValue;
		var loTupleElement;
		var loRef;
		var lScalingFactor;
		var ltVisibleFields;
		if (axis === oFF.AxisType.ROWS) {
			lAxisIndex = rowIndex;
			lAxisDataIndex = this.rowDataIndex;
			lOtherAxisIndex = colIndex;
			lHasHeader = this.oGrid.hasRowHeader();
			lHeaders = this.oGrid.getRowHeaders();
			ltAxisHeadersWithTotals = this.oGrid.tRowHeadersWithTotals;
		} else {
			if (axis === oFF.AxisType.COLUMNS) {
				lAxisIndex = colIndex;
				lAxisDataIndex = this.colDataIndex;
				lOtherAxisIndex = rowIndex;
				lHasHeader = this.oGrid.hasColumnHeader();
				lHeaders = this.oGrid.getColumnHeaders();
				ltAxisHeadersWithTotals = this.oGrid.tColHeadersWithTotals;
			} else {
				return;
			}
		}
		lAxisSpan = 1;
		lOtherAxisSpan = 1;
		loResultSetInfo = null;
		lIsScalingInfo = false;
		lAxisIndexAsString = oFF.XInteger.convertToString(lAxisIndex);
		lOtherAxisIndexAsString = oFF.XInteger.convertToString(lOtherAxisIndex);
		lAxisKey = oFF.XStringUtils.concatenate3(lAxisIndexAsString, "/",
				lOtherAxisIndexAsString);
		if (lHasHeader) {
			loResultSetInfo = sap.zen.ResultSetHelper.create(this.oGrid
					.getResultSet(), axis, lAxisDataIndex, lOtherAxisIndex);
			loInternalMeasureDimension = this.oGrid.getQueryModel()
					.getMeasureDimension();
			lIsScalingInfo = this.isScalingFactorCell(loResultSetInfo,
					rowIndex, colIndex);
			if (lIsScalingInfo) {
				lMeasureIndexOnOtherAxis = lOtherAxisIndex;
				while (loResultSetInfo.getDimension().getInternalObject() !== loInternalMeasureDimension
						|| loResultSetInfo.getTupleElement() === null) {
					lMeasureIndexOnOtherAxis = lMeasureIndexOnOtherAxis - 1;
					loResultSetInfo = sap.zen.ResultSetHelper.create(this.oGrid
							.getResultSet(), axis, lAxisDataIndex,
							lMeasureIndexOnOtherAxis);
				}
			}
			if (lAxisDataIndex >= 0 && !lIsScalingInfo) {
				lAxisSpan = this.provideTupleElementAxisSpan(loResultSetInfo
						.getAxis(), lAxisDataIndex, loResultSetInfo
						.getTupleElement().getIndex());
			}
			if (lAxisSpan > 0) {
				if (loResultSetInfo.isTotal()) {
					if (!ltAxisHeadersWithTotals.containsKey(lAxisKey)) {
						ltAxisHeadersWithTotals.put(lAxisKey, this);
						lOtherAxisSpan = 1;
						for (lLookaheadIndex = lOtherAxisIndex + 1; lLookaheadIndex < lHeaders; lLookaheadIndex++) {
							loResultsetInfoLookAheadCol = sap.zen.ResultSetHelper
									.create(this.oGrid.getResultSet(), axis,
											lAxisDataIndex, lLookaheadIndex);
							if (oFF.isNull(loResultsetInfoLookAheadCol)) {
								continue;
							}
							if (loResultsetInfoLookAheadCol.isTotal()) {
								lLookAheadOtherAxisIndexAsString = oFF.XInteger
										.convertToString(lOtherAxisIndex
												+ lOtherAxisSpan);
								lLookAheadAxisKey = oFF.XStringUtils
										.concatenate3(lAxisIndexAsString, "/",
												lLookAheadOtherAxisIndexAsString);
								ltAxisHeadersWithTotals.put(lLookAheadAxisKey,
										this);
								lOtherAxisSpan++;
							} else {
								break;
							}
						}
					} else {
						if (this.getGrid().isMergeContent()) {
							lOtherAxisSpan = 0;
						}
					}
				}
			}
		} else {
			lAxisDataIndex = -1;
		}
		this.rowSpan = 1;
		this.colSpan = 1;
		this.value = "";
		this.valueType = oFF.XValueType.STRING;
		this.style = this.style + sap.zen.GridCell.STYLE_HEADER;
		if (!this.getGrid().isMergeContent()) {
			if (lOtherAxisSpan > 1) {
				lOtherAxisSpan = 1;
			}
		}
		if (axis === oFF.AxisType.ROWS) {
			this.rowSpan = lAxisSpan;
			this.colSpan = lOtherAxisSpan;
		} else {
			if (axis === oFF.AxisType.COLUMNS) {
				this.colSpan = lAxisSpan;
				this.rowSpan = lOtherAxisSpan;
			}
		}
		if (this.rowSpan > 0 && this.colSpan > 0) {
			if (oFF.notNull(loResultSetInfo)) {
				this.tHeaderData.add(loResultSetInfo);
				this.axis = loResultSetInfo.getAxis();
				loDimension = loResultSetInfo.getDimension();
				loDimensionMember = loResultSetInfo.getDimensionMember();
				loInternalField = loResultSetInfo.getField();
				loInternalFieldValue = loResultSetInfo.getFieldValue();
				loTupleElement = loResultSetInfo.getTupleElement();
				loRef = null;
				if (loResultSetInfo.isTotal()) {
					loRef = ltAxisHeadersWithTotals.getByKey(lAxisKey);
					if (loRef === this) {
						loRef = null;
					}
				}
				if (oFF.notNull(loRef)) {
					this.value = loRef.value;
					this.valueType = loRef.valueType;
					this.style = loRef.style;
					this.formatString = loRef.formatString;
					this.nodeState = loRef.nodeState;
					this.nodeLevel = loRef.nodeLevel;
					this.nodeAlignment = loRef.nodeAlignment;
					return;
				}
				this.value = sap.zen.DimensionMember.sGetDimensionMemberText(
						loDimensionMember, loInternalFieldValue);
				if (lIsScalingInfo) {
					if (loDimension.isMeasureStructure()) {
						lScalingFactor = loDimensionMember.getScalingFactor();
						if (lScalingFactor > 0) {
							this.style = this.style
									+ sap.zen.GridCell.STYLE_INTERNAL_VALUE;
							this.valueType = oFF.XValueType.INTEGER;
							this.value = sap.zen.ResultDataCellWrapper
									.sGetScalingFactorValueAsStringFromScalingFactor(lScalingFactor);
							this.formatString = "* #,###";
						} else {
							this.valueType = oFF.XValueType.STRING;
							this.value = "";
						}
					}
				}
				if (!lIsScalingInfo) {
					this.provideSortInformation(loResultSetInfo, rowIndex,
							colIndex);
				}
				if (loTupleElement.isTotal(true)) {
					this.style = this.style + sap.zen.GridCell.STYLE_TOTAL;
					this.valueType = oFF.XValueType.STRING;
					if (loTupleElement.getIndex() <= 0) {
						this.value = sap.zen.CLocalizationDataSourceTexts.GRAND_TOTAL
								.getText(this.getGrid().getMessageLog()
										.getLocalization(), null, null, null);
					} else {
						this.value = sap.zen.CLocalizationDataSourceTexts.TOTAL
								.getText(this.getGrid().getMessageLog()
										.getLocalization(), null, null, null);
					}
				}
				ltVisibleFields = loDimension.getResultSetFields();
				if (oFF.isNull(loInternalFieldValue)
						|| oFF.XString.isEqual(ltVisibleFields.get(0),
								loInternalField.getName())) {
					if (loDimension.getProperties().isHierarchyActive()
							|| loDimension.getProperties().isUDHActive()
							|| loDimension.isStructure()) {
						this.style = this.style
								+ sap.zen.GridCell.STYLE_HIERARCHICAL;
						this.nodeState = loTupleElement.getCompactDrillState();
						this.nodeLevel = loTupleElement.getDisplayLevel();
						this.nodeAlignment = loTupleElement.getNodeAlignment();
					}
				}
			}
		}
	};
	sap.zen.GridCell.prototype.provideDataCell = function() {
		var lAmountOfRowTuples;
		var lAmountOfColTuples;
		var loRowTuple;
		var loColTuple;
		var lIsTotal;
		var lNoData;
		this.rowSpan = 1;
		this.colSpan = 1;
		lAmountOfRowTuples = this.oGrid.getResultSet().getAmountOfTuplesOnAxis(
				oFF.AxisType.ROWS);
		lAmountOfColTuples = this.oGrid.getResultSet().getAmountOfTuplesOnAxis(
				oFF.AxisType.COLUMNS);
		loRowTuple = null;
		loColTuple = null;
		lIsTotal = false;
		if (lAmountOfRowTuples > 0 && lAmountOfColTuples > 0) {
			loRowTuple = this.oGrid.getResultSet().getTuple(oFF.AxisType.ROWS,
					this.rowDataIndex, null, null);
			loColTuple = this.oGrid.getResultSet().getTuple(
					oFF.AxisType.COLUMNS, this.colDataIndex, null, null);
			lIsTotal = loRowTuple.isTotal() || loColTuple.isTotal();
		} else {
			if (lAmountOfRowTuples > 0) {
				loRowTuple = this.oGrid.getResultSet().getTuple(
						oFF.AxisType.ROWS, this.rowDataIndex, null, null);
				lIsTotal = loRowTuple.isTotal();
			} else {
				if (lAmountOfColTuples > 0) {
					loColTuple = this.oGrid.getResultSet()
							.getTuple(oFF.AxisType.COLUMNS, this.colDataIndex,
									null, null);
					lIsTotal = loColTuple.isTotal();
				}
			}
		}
		lNoData = !this.oGrid.getResultSet().hasDataCells();
		if (!lNoData) {
			try {
				this.oResultDataCell = this.oGrid
						.getResultSet()
						.getResultDataCell(this.rowDataIndex, this.colDataIndex);
				this.valueType = this.oResultDataCell.getValue().getValueType();
				this.value = this.oResultDataCell.getValueAsString();
				if (this.oResultDataCell.isDataEntryEnabled()) {
					this.style = this.style
							+ sap.zen.GridCell.STYLE_INPUT_ENABLED;
				}
			} catch (exception) {
				lNoData = true;
			}
		}
		if (lNoData) {
			this.oResultDataCell = null;
			this.value = "";
			this.valueType = oFF.XValueType.STRING;
		}
		if (lIsTotal) {
			this.style = this.style + sap.zen.GridCell.STYLE_TOTAL;
		}
	};
	sap.zen.GridCell.prototype.isScalingFactorCell = function(oResultSetInfo,
			rowIndex, colIndex) {
		if (oFF.isNull(oResultSetInfo)) {
			return false;
		}
		if (oResultSetInfo.getAxis() === this.oGrid
				.getScalingFactorDisplayAxis()) {
			if (this.oGrid.getScalingFactorDisplayAxis() === oFF.AxisType.ROWS) {
				if (colIndex === this.oGrid.getScalingFactorDisplayAxisIndex()) {
					return true;
				}
			} else {
				if (rowIndex === this.oGrid.getScalingFactorDisplayAxisIndex()) {
					return true;
				}
			}
		}
		return false;
	};
	sap.zen.GridCell.prototype.provideSortInformation = function(
			oResultSetInfo, rowIndex, colIndex) {
		var lAxisIndex;
		var lOtherAxisIndex;
		var lHasHeader;
		var lHeaders;
		var loDimension;
		var loInternalField;
		var loTuple;
		var lSortAllowed;
		var ltSettings;
		var lHeaderIndex;
		var loResultSetInfoHeader;
		var loDimensionMember;
		if (oFF.isNull(oResultSetInfo)) {
			return;
		}
		lAxisIndex = 0;
		lOtherAxisIndex = 0;
		lHasHeader = true;
		lHeaders = 0;
		if (oResultSetInfo.getAxis() === oFF.AxisType.ROWS) {
			lAxisIndex = rowIndex;
			lOtherAxisIndex = colIndex;
			lHasHeader = !this.oGrid.hasRowHeader();
			lHeaders = this.oGrid.getRowHeaders();
		} else {
			if (oResultSetInfo.getAxis() === oFF.AxisType.COLUMNS) {
				lAxisIndex = colIndex;
				lOtherAxisIndex = rowIndex;
				lHasHeader = !this.oGrid.hasColumnHeader();
				lHeaders = this.oGrid.getColumnHeaders();
			}
		}
		loDimension = oResultSetInfo.getDimension();
		loInternalField = oResultSetInfo.getField();
		loTuple = oResultSetInfo.getTuple();
		lSortAllowed = false;
		if (oFF.isNull(loTuple)) {
			if (oResultSetInfo.getAxis() === oFF.AxisType.ROWS
					&& !loDimension.isMeasureStructure()) {
				lSortAllowed = true;
			}
		} else {
			if (oResultSetInfo.getAxis() === oFF.AxisType.COLUMNS
					&& loDimension.isMeasureStructure()) {
				lSortAllowed = true;
			}
		}
		if (loDimension.isUDH()) {
			lSortAllowed = false;
		}
		if (lSortAllowed) {
			ltSettings = null;
			if (oFF.notNull(loTuple)) {
				if ((oResultSetInfo.getTupleElement().getIndex() === this.oGrid
						.getResultSet().getAmountOfTupleElementsOnAxis(
								oResultSetInfo.getAxis()) - 1)
						|| (lOtherAxisIndex === lHeaders - 1)) {
					for (lHeaderIndex = 0; lHeaderIndex < lHeaders; lHeaderIndex++) {
						loResultSetInfoHeader = sap.zen.ResultSetHelper.create(
								this.oGrid.getResultSet(), oResultSetInfo
										.getAxis(), oResultSetInfo.getTuple()
										.getIndex(), lHeaderIndex);
						if (oFF.isNull(loResultSetInfoHeader)) {
							continue;
						}
						if (loResultSetInfoHeader.getDimension()
								.isMeasureStructure()) {
							loDimensionMember = oResultSetInfo
									.getDimensionMember();
							if (oFF.notNull(loDimensionMember)) {
								ltSettings = oResultSetInfo.getDimension()
										.getProperties().getSortOperation(
												loDimensionMember.getName());
							}
							break;
						}
					}
				}
			} else {
				if (oFF.notNull(loInternalField)) {
					ltSettings = oResultSetInfo.getDimension().getProperties()
							.getSortOperation(loInternalField.getName());
				}
			}
			this.sortType = null;
			this.sortDirection = null;
			if (oFF.notNull(ltSettings) && !ltSettings.isEmpty()) {
				this.sortType = ltSettings
						.getByKey(sap.zen.Dimension.SORT_PARAM_SORTTYPE);
				this.sortDirection = ltSettings
						.getByKey(sap.zen.Dimension.SORT_PARAM_SORTDIRECTION);
			}
		}
	};
	sap.zen.GridCell.prototype.provideTupleElementAxisSpan = function(axis,
			axisDataIndex, tupleElementIndex) {
		var lAxisDataIndex = axisDataIndex;
		var lTupleElements = this.oGrid.getResultSet()
				.getAmountOfDimensionsOnAxis(axis);
		var lTuples = this.oGrid.getResultSet().getAmountOfTuplesOnAxis(axis);
		var lTupleIndex = 0;
		var lOffset;
		var lAmount;
		var ltSpans;
		var ltLastProcessedTupleOfTupleElement;
		var lTupleElementIndex;
		var ltTuplesArray;
		var lLastProcessedTuple;
		var lCorrectTupleIndex;
		var loTuple;
		var loTupleElement;
		var lLastTupleOfTupleElement;
		var lSpan;
		if (oFF.notNull(this.oDisplayArea)) {
			lOffset = 0;
			lAmount = 0;
			if (axis === oFF.AxisType.ROWS) {
				lOffset = this.oDisplayArea.getRowOffset();
				lAmount = this.oDisplayArea.getAmountOfRows();
			} else {
				if (axis === oFF.AxisType.COLUMNS) {
					lOffset = this.oDisplayArea.getColumnOffset();
					lAmount = this.oDisplayArea.getAmountOfColumns();
				}
			}
			lAxisDataIndex = lAxisDataIndex - lOffset;
			lTuples = lTuples - lOffset;
			if (lTuples > lAmount) {
				lTuples = lAmount;
			}
		}
		ltSpans = null;
		ltLastProcessedTupleOfTupleElement = null;
		if (axis === oFF.AxisType.ROWS) {
			if (oFF.isNull(this.oGrid.tRowSpans)) {
				this.oGrid.tRowSpans = oFF.XList.create();
			}
			ltSpans = this.oGrid.tRowSpans;
			if (oFF.isNull(this.oGrid.tRowsLastProcessedTupleOfTupleElement)) {
				this.oGrid.tRowsLastProcessedTupleOfTupleElement = oFF.XArrayOfInt
						.create(lTupleElements);
			}
			ltLastProcessedTupleOfTupleElement = this.oGrid.tRowsLastProcessedTupleOfTupleElement;
		} else {
			if (axis === oFF.AxisType.COLUMNS) {
				if (oFF.isNull(this.oGrid.tColSpans)) {
					this.oGrid.tColSpans = oFF.XList.create();
				}
				ltSpans = this.oGrid.tColSpans;
				if (oFF
						.isNull(this.oGrid.tColsLastProcessedTupleOfTupleElement)) {
					this.oGrid.tColsLastProcessedTupleOfTupleElement = oFF.XArrayOfInt
							.create(lTupleElements);
				}
				ltLastProcessedTupleOfTupleElement = this.oGrid.tColsLastProcessedTupleOfTupleElement;
			} else {
				return 1;
			}
		}
		if (ltSpans.isEmpty()) {
			for (lTupleElementIndex = 0; lTupleElementIndex < lTupleElements; lTupleElementIndex++) {
				ltTuplesArray = oFF.XArrayOfInt.create(lTuples);
				ltSpans.add(ltTuplesArray);
			}
		}
		if (this.oGrid.isMergeContent()) {
			lLastProcessedTuple = ltLastProcessedTupleOfTupleElement
					.get(tupleElementIndex);
			if (lLastProcessedTuple <= lAxisDataIndex) {
				for (lTupleIndex = lLastProcessedTuple; lTupleIndex < lTuples; lTupleIndex++) {
					lCorrectTupleIndex = lTupleIndex;
					if (oFF.notNull(this.oDisplayArea)) {
						if (axis === oFF.AxisType.ROWS) {
							lCorrectTupleIndex = lTupleIndex
									+ this.oDisplayArea.getRowOffset();
						} else {
							if (axis === oFF.AxisType.COLUMNS) {
								lCorrectTupleIndex = lTupleIndex
										+ this.oDisplayArea.getColumnOffset();
							}
						}
					}
					loTuple = this.oGrid.getResultSet().getTuple(axis,
							lCorrectTupleIndex, null, null);
					loTupleElement = loTuple.getTupleElement(tupleElementIndex,
							null);
					if (loTuple.isEqualTo(loTupleElement.getFirstTuple())
							|| (lTupleIndex === 0)) {
						ltSpans.get(tupleElementIndex).set(lTupleIndex, 1);
						ltLastProcessedTupleOfTupleElement.set(
								tupleElementIndex, lTupleIndex);
						if (lTupleIndex > lAxisDataIndex) {
							break;
						}
					} else {
						lLastTupleOfTupleElement = ltLastProcessedTupleOfTupleElement
								.get(tupleElementIndex);
						lSpan = ltSpans.get(tupleElementIndex).get(
								lLastTupleOfTupleElement) + 1;
						ltSpans.get(tupleElementIndex).set(
								lLastTupleOfTupleElement, lSpan);
						ltSpans.get(tupleElementIndex).set(lTupleIndex, 0);
					}
				}
			}
		} else {
			ltSpans.get(tupleElementIndex).set(lAxisDataIndex, 1);
		}
		return ltSpans.get(tupleElementIndex).get(lAxisDataIndex);
	};
