	sap.zen.ResultSetHelper.prototype.initMe = function(oResultSet, axis,
			tupleIndex, index) {
		var loQueryModel;
		var ltDimensions;
		var lKey;
		var j;
		var loDimensionIterator;
		var loInternalDimension;
		var loTupleElement;
		var lDimensionMemberName;
		var ltVisibleFields;
		var lVisibleFieldsCnt;
		var lVisibleFieldName;
		var loInternalDimensionMember;
		this.reset();
		this.oResultSet = oResultSet;
		loQueryModel = this.oResultSet.getDataSource().getQueryManager()
				.getQueryModel();
		this.axis = loQueryModel.getAxis(axis).getType();
		if (tupleIndex >= 0) {
			this.oTuple = this.oResultSet.getTuple(this.axis, tupleIndex, null,
					null);
		}
		ltDimensions = this.oResultSet.getAxisDimensions(this.axis);
		lKey = "";
		j = 0;
		if (oFF.notNull(ltDimensions) && !ltDimensions.isEmpty()) {
			loDimensionIterator = ltDimensions.getIterator();
			while (loDimensionIterator.hasNext()) {
				this.oDimension = loDimensionIterator.next();
				if (oFF.isNull(this.oDimension)) {
					continue;
				}
				loInternalDimension = this.oDimension.getInternalObject();
				if (oFF.isNull(loInternalDimension)) {
					continue;
				}
				loTupleElement = null;
				if (oFF.notNull(this.oTuple)) {
					loTupleElement = this.oTuple.getTupleElement(-1,
							this.oDimension);
				}
				if (oFF.notNull(loTupleElement)) {
					lDimensionMemberName = sap.zen.ResultSetHelper
							.getDimensionMemberName(loTupleElement
									.getDimensionMember());
					lKey = oFF.XStringUtils.concatenate2(lKey,
							lDimensionMemberName);
					lKey = oFF.XStringUtils.concatenate2(lKey, "/");
				}
				ltVisibleFields = this.oDimension.getResultSetFields();
				lVisibleFieldsCnt = ltVisibleFields.size();
				if ((index >= 0) && (index < (j + lVisibleFieldsCnt))) {
					index = index - j;
					lVisibleFieldName = ltVisibleFields.get(index);
					this.oField = loInternalDimension
							.getFieldByName(lVisibleFieldName);
					if (oFF.notNull(loTupleElement)) {
						this.oTupleElement = loTupleElement;
						this.oDimension = loTupleElement.getDimension();
						this.oDimensionMember = loTupleElement
								.getDimensionMember();
						this.key = lKey;
						if (!this.oDimensionMember.isTotal()) {
							loInternalDimensionMember = this.oDimensionMember
									.getInternalObject();
							this.oFieldValue = loInternalDimensionMember
									.getFieldValue(this.oField);
							if (oFF.isNull(this.oFieldValue)) {
								this.oFieldValue = loInternalDimensionMember
										.getKeyFieldValue();
							}
						}
					}
					return;
				}
				j = j + lVisibleFieldsCnt;
			}
		}
	};
