	sap.zen.ProjectionUtil = {
		parseProjectionInstancesFromJson : function(json) {
			var ltProjectionInstances = oFF.XHashMapByString.create();
			var loJsonElement;
			var loJsonParser;
			if ((oFF.notNull(json)) && (oFF.XString.size(json) > 0)) {
				loJsonElement = null;
				try {
					loJsonParser = oFF.JsonParserFactory.newInstance();
					loJsonElement = loJsonParser.parse(json);
				} catch (t) {
					loJsonElement = null;
				}
				if (oFF.notNull(loJsonElement)) {
					sap.zen.ProjectionUtil
							.paseProjectionInstancesFromJsonElement(null,
									loJsonElement, ltProjectionInstances);
				}
			}
			return ltProjectionInstances;
		},
		paseProjectionInstancesFromJsonElement : function(elementName,
				oJsonElement, tProjectionInstances) {
			var loJsonElement = null;
			var lJsonString;
			var loProjectionInstance;
			var loJsonStructure;
			var ltElements;
			var lStructureElementIndex;
			var lElementName;
			var loJsonList;
			var lListIndex;
			if (oJsonElement.getType().isEqualTo(oFF.PrElementType.STRING)) {
				lJsonString = oFF.XStringValue.create(oJsonElement.asString()
						.getString());
				loProjectionInstance = sap.zen.ProjectionInstance
						.createForString(lJsonString);
				tProjectionInstances.put(elementName, loProjectionInstance);
			} else {
				if (oJsonElement.getType().isEqualTo(
						oFF.PrElementType.STRUCTURE)) {
					loJsonStructure = oJsonElement.asStructure();
					ltElements = loJsonStructure
							.getKeysAsReadOnlyListOfString();
					for (lStructureElementIndex = 0; lStructureElementIndex < ltElements
							.size(); lStructureElementIndex++) {
						lElementName = ltElements.get(lStructureElementIndex);
						loJsonElement = loJsonStructure.getByKey(lElementName);
						sap.zen.ProjectionUtil
								.paseProjectionInstancesFromJsonElement(
										lElementName, loJsonElement,
										tProjectionInstances);
					}
				} else {
					if (oJsonElement.getType()
							.isEqualTo(oFF.PrElementType.LIST)) {
						loJsonList = oJsonElement.asList();
						for (lListIndex = 0; lListIndex < loJsonList.size(); lListIndex++) {
							loJsonElement = loJsonList.get(lListIndex);
							if (oFF.isNull(loJsonElement)) {
								continue;
							}
							sap.zen.ProjectionUtil
									.paseProjectionInstancesFromJsonElement(
											elementName, loJsonElement,
											tProjectionInstances);
						}
					}
				}
			}
		},
		stringifyCartesianSelection : function(tMap) {
			var lJson = "{";
			var loMapKeyIterator = tMap.getKeysAsIteratorOfString();
			var lKey;
			var lValue;
			while (loMapKeyIterator.hasNext()) {
				lKey = loMapKeyIterator.next();
				lJson = oFF.XStringUtils.concatenate4(lJson, '"', lKey, '": ');
				lValue = tMap.getByKey(lKey);
				lJson = oFF.XStringUtils.concatenate4(lJson, '"', lValue, '"');
				if (loMapKeyIterator.hasNext()) {
					lJson = oFF.XStringUtils.concatenate2(lJson, ", ");
				}
			}
			lJson = oFF.XStringUtils.concatenate2(lJson, "}");
			return lJson;
		},
		stringifyCartesianSelection2 : function(selection) {
			return "";
		}
	};
