	sap.zen.BookmarkManager.prototype.loadBookmarkInternal = function(
			oBookmark, includeVariables) {
		var lContent = oBookmark.getBookmark();
		var loRootNode = sap.buddha.XXmlUtils.getRootNode(lContent);
		var ltDataSourceNodes = loRootNode.getChildren("data_source_alias")
				.getIterator();
		var loDataSourceNode;
		var lDataSourceName;
		var loDataSource;
		var ltComponentNodes;
		var loComponentNodeIterator;
		var lComponentName;
		var loComponent;
		var loAppPropsComponent;
		while (ltDataSourceNodes.hasNext()) {
			loDataSourceNode = ltDataSourceNodes.next();
			lDataSourceName = loDataSourceNode.getAttribute("name");
			loDataSource = this.oPage.getDataSource(lDataSourceName);
			loDataSource.applyQueryBookmarkContent(loDataSourceNode,
					includeVariables);
		}
		ltComponentNodes = loRootNode.getChildren("component").getIterator();
		while (ltComponentNodes.hasNext()) {
			loComponentNodeIterator = ltComponentNodes.next();
			lComponentName = loComponentNodeIterator.getAttribute("name");
			loComponent = this.oPage.getComponent(lComponentName);
			loComponent
					.applyGlobalVariableInitParameters(loComponentNodeIterator);
			if (oFF.XString.compare(loComponent.getType(),
					"APPLICATION_PROPERTIES") === 0) {
				loAppPropsComponent = loComponent;
				loAppPropsComponent.applyGlobalVariableValues(this.oPage
						.getWindow());
			}
		}
	};
