	sap.zen.BookmarkService.prototype.getAllData = function(appid, oPage,
			bookmarkType, groupIdentifier, mode) {
		var ltBookmarks = oFF.XList.create();
		var loBookmarkRequestHandler = oPage.getBookmarkRequestHandler();
		var loSystemDescription = loBookmarkRequestHandler.getSelf();
		var ltDatasources;
		var ltQueries;
		var lDataSourceIndex;
		var loDataSource;
		var ltAllBookmarks;
		var loAllBookmarkKeysIterator;
		var lBookmarkKey;
		var loBookmark;
		if (oFF.notNull(loSystemDescription)
				&& loSystemDescription.getSystemType().isTypeOf(
						oFF.SystemType.ABAP)) {
			ltDatasources = oPage.getDataSources().getValuesAsReadOnlyList();
			ltQueries = oFF.XList.create();
			for (lDataSourceIndex = 0; lDataSourceIndex < ltDatasources.size(); lDataSourceIndex++) {
				loDataSource = ltDatasources.get(lDataSourceIndex);
				if (oFF.isNull(loDataSource)) {
					continue;
				}
				ltQueries.add(oFF.XStringValue.create(loDataSource
						.getQueryTechnicalName()));
			}
			ltAllBookmarks = loBookmarkRequestHandler
					.callGetAllBookmarksXmlRequest(oPage.getAppName(),
							bookmarkType, groupIdentifier, ltQueries, mode);
			if (oFF.notNull(ltAllBookmarks)) {
				loAllBookmarkKeysIterator = ltAllBookmarks
						.getKeysAsIteratorOfString();
				while (loAllBookmarkKeysIterator.hasNext()) {
					lBookmarkKey = loAllBookmarkKeysIterator.next();
					loBookmark = ltAllBookmarks.getByKey(lBookmarkKey);
					ltBookmarks.add(loBookmark);
				}
			}
		}
		return ltBookmarks;
	};
