	sap.zen.Factory.prototype.createObject = function(oInitParametersNode,
			oPage, oParent) {
		var type = oInitParametersNode.getAttribute("type");
		var uid = oInitParametersNode.getAttribute("name");
		return this.createObjectInternal(type, uid, oPage, oInitParametersNode,
				oParent, false);
	};
	sap.zen.Factory.prototype.createObjectByType = function(type, uid, oPage,
			oInitParametersNode) {
		return this.createObjectInternal(type, uid, oPage, oInitParametersNode,
				null, true);
	};
	sap.zen.Factory.prototype.createObjectInternal = function(type, uid, oPage,
			oInitParametersNode, oParent, callBeforeRendering) {
		var loFactory = this.tFactories.getByKey(type);
		var loPageObject;
		if (oFF.isNull(loFactory)) {
			loFactory = new sap.zen.SDKComponentFactory();
		}
		if (loFactory.isSDK()) {
			if (loFactory.loadSdkExtension(type, oPage) === false) {
				return null;
			}
		}
		loPageObject = loFactory.createObject(oInitParametersNode);
		if (oFF.notNull(loPageObject)) {
			if (oFF.isNull(oInitParametersNode)) {
				oInitParametersNode = loPageObject.createEmptyInitParameter(
						uid, type);
			}
			this.translateComponentProperties(uid, oPage, oInitParametersNode);
			loPageObject.initBase(uid, type, oPage, oParent,
					oInitParametersNode);
			loPageObject.create();
			if (callBeforeRendering) {
				loPageObject.beforeInitialRendering();
			}
			loPageObject.setContentChanged(true);
		}
		return loPageObject;
	};
	sap.zen.Factory.prototype.translateComponentProperties = function(
			componentId, oPage, oInitParametersNode) {
		var ltKeys = oPage.getTranslatedTextsFor(componentId);
		var lKeyIndex;
		var lKey;
		var lTextID;
		var lDotPosition;
		if (ltKeys.isEmpty()) {
			return;
		}
		for (lKeyIndex = 0; lKeyIndex < ltKeys.size(); lKeyIndex++) {
			lKey = ltKeys.get(lKeyIndex);
			lTextID = null;
			lDotPosition = oFF.XString.indexOf(lKey, ".");
			if (lDotPosition >= 0) {
				lTextID = oFF.XString.substring(lKey, lDotPosition + 1, -1);
			}
			this.setValue(oInitParametersNode, lTextID, oPage
					.getTranslatedText(lKey));
		}
	};
	sap.zen.Factory.prototype.doInit = function() {
		this.tFactories = oFF.XHashMapByString.create();
	};
	sap.zen.Factory.prototype.setValue = function(oNode, textID, text) {
		var lPropertyName;
		var rest = null;
		var lDotPosition = oFF.XString.indexOf(textID, ".");
		var propertyNode;
		var list;
		var allChildren;
		var child;
		var valueNode;
		var textNode;
		if (lDotPosition >= 0) {
			lPropertyName = oFF.XString.substring(textID, 0, lDotPosition);
			rest = oFF.XString.substring(textID, lDotPosition + 1, -1);
		} else {
			lPropertyName = textID;
		}
		propertyNode = null;
		try {
			oFF.XInteger.convertFromString(lPropertyName);
			propertyNode = oNode.getFirstChildWithAttributeValue("bi:property",
					"index", lPropertyName, false);
		} catch (e) {
			propertyNode = oNode.getFirstChildWithAttributeValue("bi:property",
					"name", lPropertyName, false);
		}
		if (oFF.isNull(propertyNode)) {
			list = oNode.getFirstChildWithAttributeValue("bi:property", "type",
					"ORDEREDLIST", false);
			if (oFF.notNull(list)) {
				allChildren = list.getAllChildren().getIterator();
				while (allChildren.hasNext()) {
					child = allChildren.next();
					valueNode = child.getFirstChildWithAttributeValue(
							"bi:property", "name", "VALUE", false);
					if (oFF.notNull(valueNode)
							&& oFF.XString.isEqual(valueNode
									.getAttribute("value"), textID)) {
						textNode = child.getFirstChildWithAttributeValue(
								"bi:property", "name", "TEXT", false);
						if (oFF.notNull(textNode)) {
							textNode.setAttribute("value", text);
						}
						break;
					}
				}
			}
			return;
		}
		if (oFF.isNull(rest)) {
			propertyNode.setAttribute("value", text);
		} else {
			this.setValue(propertyNode, rest, text);
		}
	};
