	sap.zen.ODataBookmarkParser = function() {
	};
	sap.zen.ODataBookmarkParser.prototype = new oFF.XObject();
	sap.zen.ODataBookmarkParser.prototype.buildJsonPostRequest = function(bmId,
			title, bookmarkXml, bookmarkType, appName, tDataSources, groupId,
			isGlobal) {
		var root = oFF.PrStructure.create();
		var d = root.putNewStructure("d");
		var data;
		var base64;
		d.putString("Type", bookmarkType);
		d.putString("Title", title);
		if (isGlobal) {
			d.putBoolean("IsPublic", true);
		} else {
			d.putBoolean("IsPublic", false);
		}
		d.putString("Description", "");
		d.putString("MainObjectId", appName);
		d.putString("MainObjectType", "AZAP");
		d.putString("Owner", "");
		d.putString("Status", "");
		if (oFF.XStringUtils.isNotNullAndNotEmpty(groupId)) {
			d.putString("GroupIdentifier", groupId);
		}
		if (oFF.XStringUtils.isNotNullAndNotEmpty(bmId)) {
			d.putString("Id", bmId);
		}
		this.buildReferencesJsonStructure(d, "AZAP", appName, tDataSources);
		data = d.putNewStructure("Data");
		base64 = oFF.XHttpUtils.encodeByteArrayToBase64(oFF.XByteArray
				.convertFromString(bookmarkXml));
		data.putString("Data", base64);
		data.putString("DataX", "");
		return root;
	};
