		var loUri;
		var loResponse;
		if (oFF.isNull(this.url)) {
			return null;
		}
		uri = oFF.XUri.create();
		uri.setProtocolType(this.oLocalHost.getProtocolType());
		loHttpClient = oFF.HttpClientFactory.newInstanceByConnection(
				this.oApplication.getSession(), uri);
		loRequest = loHttpClient.getRequest();
		loUri = oFF.XUri.createFromUri(this.oLocalHost.getUriString());
		if (loUri.getPath() === null) {
			loUri.setPath("/");
		}
		loRequest.setFromUriWithParent(this.url, loUri, false);
		loRequest.setMethod(oFF.HttpRequestMethod.HTTP_GET);
		loRequest.setAcceptContentType(oFF.ContentType.APPLICATION_XML);
		loRequest.setTextContentEncoding("UTF-8");
		loResponse = loHttpClient.processHttpRequest(oFF.SyncType.BLOCKING,
				null, null);
		if (loResponse.isValid() && loResponse.getData() !== null) {
			return loResponse.getData().getString();
		}
		return null;
