	sap.zen.TemplateLoader.prototype.getTranslatedText = function(key) {
		var lNameSpace;
		var lTextID;
		var lDotPosition;
		var lAddTripleDotsToText;
		var lText;
		if (oFF.isNull(this.oLocalization) || !this.oLocalization.hasText(key)) {
			return null;
		}
		lNameSpace = null;
		lTextID = null;
		lDotPosition = oFF.XString.lastIndexOf(key, ".");
		if (lDotPosition >= 0) {
			lNameSpace = oFF.XString.substring(key, 0, lDotPosition);
			lTextID = oFF.XString.substring(key, lDotPosition + 1, -1);
		}
		lAddTripleDotsToText = false;
		if (oFF.notNull(lNameSpace) && oFF.notNull(lTextID)) {
			if (oFF.XString.containsString(this.url, "0ANALYSIS")) {
				if (oFF.XString.isEqual(lNameSpace, "TEXT_POOL")) {
					if (oFF.XString.isEqual(lTextID, "ShowPrompts")) {
						lAddTripleDotsToText = true;
					}
				}
				if (oFF.XString.isEqual(lNameSpace,
						"ACTIONSHEET_SETTINGS_ACTIONS")) {
					if (oFF.XString.isEqual(lTextID, "CHART_SETTINGS")
							|| oFF.XString.isEqual(lTextID, "INFO")
							|| oFF.XString.isEqual(lTextID, "TOTALS")) {
						lAddTripleDotsToText = true;
					}
				}
				if (oFF.XString.isEqual(lNameSpace,
						"ACTIONSHEET_FOOTER_ACTIONS")) {
					if (oFF.XString.isEqual(lTextID, "EMAIL")
							|| oFF.XString.isEqual(lTextID, "EXPORT")
							|| oFF.XString.isEqual(lTextID, "TILE")) {
						lAddTripleDotsToText = true;
					}
				}
			}
		}
		lText = this.oLocalization.getText(key);
		if (lAddTripleDotsToText) {
			lText = sap.zen.LocalizationText
					.sAddTrailingTripleDotsToText(lText);
		}
		return lText;
	};
	sap.zen.TemplateLoader.prototype.getTranslatedTextsFor = function(
			componentName) {
		var ltTexts = oFF.XListOfString.create();
		var ltTextMap = null;
		var loTextIDIterator;
		var lTextID;
		if (oFF.notNull(this.oLocalization)) {
			ltTextMap = this.oLocalization.getTranslationMap();
		}
		if (oFF.notNull(ltTextMap)) {
			loTextIDIterator = ltTextMap.getKeysAsIteratorOfString();
			while (loTextIDIterator.hasNext()) {
				lTextID = loTextIDIterator.next();
				if (oFF.XString.startsWith(lTextID, componentName)) {
					ltTexts.add(lTextID);
				}
			}
		}
		return ltTexts;
	};
