	sap.zen.SDKComponentFactory.prototype.createObject = function(
			oObjectProperties) {
		var loPageObject = null;
		var loSdkDataSource;
		var loSdkControl;
		if (oFF.XString.isEqual(this.handlerType, "datasource")) {
			loSdkDataSource = new sap.zen.SDKDataSource();
			loSdkDataSource.initSDKBase(this);
			loPageObject = loSdkDataSource;
		} else {
			loSdkControl = new sap.zen.SDKControl();
			loSdkControl.initSDKBase(this);
			loPageObject = loSdkControl;
		}
		return loPageObject;
	};
	sap.zen.SDKComponentFactory.prototype.loadSdkExtension = function(type,
			oPage) {
		var lastIndexOf;
		var componentType;
		var loSdkRoot;
		var loLogging;
		var ltSdkExtensionNodes;
		var loSdkExtensionNode;
		var ltComponentNodes;
		var ltComponentNodesIterator;
		var loComponentNode;
		var lAttribute;
		var initializationNodeList;
		var initMe;
		if (this.loadedIntoPage !== oPage) {
			this.loadedIntoPage = oPage;
			lastIndexOf = oFF.XString.lastIndexOf(type, "_");
			componentType = oFF.XString.substring(type, lastIndexOf + 1, -1);
			this.libraryId = oFF.XString.substring(type, 0, lastIndexOf);
			this.libraryId = oFF.XString.replace(this.libraryId, "_", ".");
			loSdkRoot = this.getSDKRoot(oPage);
			if (oFF.isNull(loSdkRoot)) {
				loLogging = oPage.getLogging();
				if (oFF.notNull(loLogging)
						&& loLogging.isLoggable(sap.buddha.XLogging.XDEBUG)) {
					loLogging.debug(oFF.XStringUtils.concatenate3(
							"SDK extension ", type, " could not be loaded"),
							"", null);
				}
				return false;
			}
			ltSdkExtensionNodes = loSdkRoot
					.getChildrenWoBiNameSpace("sdkExtension");
			loSdkExtensionNode = null;
			if (ltSdkExtensionNodes.size() === 0) {
				loSdkExtensionNode = loSdkRoot;
			} else {
				loSdkExtensionNode = ltSdkExtensionNodes.get(0);
			}
			this.componentTypeId = loSdkExtensionNode.getAttribute("id");
			ltComponentNodes = loSdkExtensionNode
					.getChildrenWoBiNameSpace("component");
			ltComponentNodesIterator = ltComponentNodes.getIterator();
			while (ltComponentNodesIterator.hasNext()) {
				loComponentNode = ltComponentNodesIterator.next();
				lAttribute = loComponentNode.getAttribute("id");
				if (oFF.XString.isEqual(lAttribute, componentType)) {
					this.handlerType = loComponentNode
							.getAttribute("handlerType");
					if (oFF.isNull(this.handlerType)) {
						this.handlerType = "div";
					}
					this.componentTypeId = lAttribute;
					this.jsIncludes = loComponentNode
							.getChildrenWoBiNameSpace("jsInclude");
					this.requireJs = loComponentNode
							.getChildrenWoBiNameSpace("requireJs");
					this.cssIncludes = loComponentNode
							.getChildrenWoBiNameSpace("cssInclude");
					this.properties = loComponentNode
							.getChildrenWoBiNameSpace("property");
					initializationNodeList = loComponentNode
							.getChildrenWoBiNameSpace("initialization");
					if ((oFF.notNull(initializationNodeList))
							&& (initializationNodeList.size() > 0)) {
						initMe = initializationNodeList.get(0);
						this.defaultValues = initMe
								.getChildrenWoBiNameSpace("defaultValue");
						this.dataBound = oFF.XString.isEqual("true",
								loComponentNode.getAttribute("databound"));
					}
				}
			}
			this.loadZtlJs(oPage);
		}
		return true;
	};
	sap.zen.SDKComponentFactory.prototype.loadZtlJs = function(oPage) {
		oPage.getSDKLoader().loadZtl(this.libraryId, oPage.getWindow());
	};
	sap.zen.SDKComponentFactory.prototype.getSDKRoot = function(oPage) {
		var loSdkLoader = oPage.getSDKLoader();
		return loSdkLoader.parseContributionXml(oPage.getApplication()
				.getSystemLandscape().getSystemDescription("self"),
				this.libraryId);
	};
