	sap.zen.DimensionMember.sCreate = function(oDimension, dimensionMemberName,
			oInternalDimensionMember, oInternalQMDimensionMember) {
		var lCreatedForInternalObject;
		var loInternalQMDimensionMember;
		var loDimensionMember;
		var ltMapInternalDimensionMembers;
		var ltDimensionMembers;
		if (oFF.isNull(oDimension)) {
			return null;
		}
		lCreatedForInternalObject = false;
		if (oFF.notNull(oInternalDimensionMember)) {
			lCreatedForInternalObject = true;
		}
		loInternalQMDimensionMember = oInternalQMDimensionMember;
		if (oFF.isNull(oInternalDimensionMember)) {
			loInternalQMDimensionMember = sap.zen.DimensionMember
					.sGetDimensionMemberObject(oDimension.getDataSource(),
							oDimension.getName(), dimensionMemberName);
			oInternalDimensionMember = loInternalQMDimensionMember;
		}
		if (oFF.isNull(oInternalDimensionMember)) {
			return null;
		}
		dimensionMemberName = oInternalDimensionMember.getName();
		if (oFF.isNull(sap.zen.DimensionMember.stDimensionMembers)) {
			sap.zen.DimensionMember.stDimensionMembers = oFF.XSimpleMap
					.create();
		}
		if (oFF.isNull(sap.zen.DimensionMember.stMapInternalDimensionMembers)) {
			sap.zen.DimensionMember.stMapInternalDimensionMembers = oFF.XSimpleMap
					.create();
		}
		loDimensionMember = null;
		ltMapInternalDimensionMembers = sap.zen.DimensionMember.stMapInternalDimensionMembers
				.getByKey(oDimension);
		if (oFF.isNull(ltMapInternalDimensionMembers)) {
			ltMapInternalDimensionMembers = oFF.XSimpleMap.create();
			sap.zen.DimensionMember.stMapInternalDimensionMembers.put(
					oDimension, ltMapInternalDimensionMembers);
		}
		loDimensionMember = ltMapInternalDimensionMembers
				.getByKey(oInternalDimensionMember);
		if (oFF.isNull(loDimensionMember)) {
			loDimensionMember = new sap.zen.DimensionMember();
			loDimensionMember.initMe(oDimension, dimensionMemberName,
					oInternalDimensionMember, loInternalQMDimensionMember);
			ltMapInternalDimensionMembers.put(oInternalDimensionMember,
					loDimensionMember);
		}
		if (loDimensionMember.isQueryModelDimensionMember()) {
			ltDimensionMembers = sap.zen.DimensionMember.stDimensionMembers
					.getByKey(oDimension);
			if (oFF.isNull(ltDimensionMembers)) {
				ltDimensionMembers = oFF.XHashMapByString.create();
				sap.zen.DimensionMember.stDimensionMembers.put(oDimension,
						ltDimensionMembers);
			}
			if (!ltDimensionMembers.containsKey(dimensionMemberName)) {
				ltDimensionMembers.put(dimensionMemberName, loDimensionMember);
			}
		}
		loDimensionMember.createdForInternalObject = lCreatedForInternalObject;
		return loDimensionMember;
	};
	sap.zen.DimensionMember.sReleaseDimensionMembers = function(oDimension) {
		var loDimensionMemberIterator = null;
		var loDimensionMember = null;
		var ltDimensionMembers;
		var ltSpecialDimensions;
		if (oFF.notNull(sap.zen.DimensionMember.stDimensionMembers)) {
			ltDimensionMembers = sap.zen.DimensionMember.stDimensionMembers
					.getByKey(oDimension);
			if (oFF.notNull(ltDimensionMembers)) {
				loDimensionMemberIterator = ltDimensionMembers.getIterator();
				while (loDimensionMemberIterator.hasNext()) {
					loDimensionMember = loDimensionMemberIterator.next();
					if (oFF.isNull(loDimensionMember)
							|| loDimensionMember.createdForInternalObject) {
						continue;
					}
					oFF.XObjectExt.release(loDimensionMember);
				}
				oFF.XObjectExt.release(ltDimensionMembers);
				ltDimensionMembers = null;
			}
			sap.zen.DimensionMember.stDimensionMembers.remove(oDimension);
		}
		if (oFF.notNull(sap.zen.DimensionMember.stMapInternalDimensionMembers)) {
			ltSpecialDimensions = sap.zen.DimensionMember.stMapInternalDimensionMembers
					.getByKey(oDimension);
			if (oFF.notNull(ltSpecialDimensions)) {
				loDimensionMemberIterator = ltSpecialDimensions.getIterator();
				while (loDimensionMemberIterator.hasNext()) {
					loDimensionMember = loDimensionMemberIterator.next();
					if (oFF.isNull(loDimensionMember)
							|| loDimensionMember.createdForInternalObject) {
						continue;
					}
					oFF.XObjectExt.release(loDimensionMember);
				}
				oFF.XObjectExt.release(ltSpecialDimensions);
				ltSpecialDimensions = null;
			}
			sap.zen.DimensionMember.stMapInternalDimensionMembers
					.remove(oDimension);
		}
	};
