			ltDimensionMembers = loDimension.getDimensionMembersForFieldValues(
					loInternalDimension.getKeyField().getName(), ltValues);
			loDimensionMember = ltDimensionMembers.get(0);
			loInternalDimensionMember = loDimensionMember.getInternalObject();
			loInternalField = loInternalDimension.getFieldByName(lKeyFieldName);
			loInternalFieldValue = loInternalDimensionMember
					.getFieldValue(loInternalField);
