	sap.zen.ResultDataCellWrapper.sProvideNumberFormatString = function(
			oInternalResultDataCell, addNegativeNumberFormat,
			addCurrencyUnitInfo, oResultDataCell) {
		var lFormatString;
		var lNumberFormatString;
		var lNumberFormatStringWithCurrencyUnit;
		var lFullNumberFormatString;
		var lFullNumberFormatStringWithCurrencyUnit;
		if (oFF.notNull(oResultDataCell)) {
			if (oResultDataCell.numberFormatStringProvided) {
				if (addNegativeNumberFormat) {
					if (addCurrencyUnitInfo) {
						return oResultDataCell.fullNumberFormatStringWithCurrencyUnit;
					}
					return oResultDataCell.fullNumberFormatString;
				}
				if (addCurrencyUnitInfo) {
					return oResultDataCell.numberFormatStringWithCurrencyUnit;
				}
				return oResultDataCell.numberFormatString;
			}
		}
		lFormatString = sap.zen.ResultDataCellWrapper.sProvideFormatString(
				oInternalResultDataCell, oResultDataCell);
		lNumberFormatString = sap.zen.ResultDataCellWrapper
				.sCalcNumberFormatString(oInternalResultDataCell,
						lFormatString, false, false, false, oResultDataCell);
		lNumberFormatStringWithCurrencyUnit = sap.zen.ResultDataCellWrapper
				.sCalcNumberFormatString(oInternalResultDataCell,
						lFormatString, false, true, false, oResultDataCell);
		lFullNumberFormatString = sap.zen.ResultDataCellWrapper
				.sCalcNumberFormatString(oInternalResultDataCell,
						lFormatString, true, false, false, oResultDataCell);
		lFullNumberFormatStringWithCurrencyUnit = sap.zen.ResultDataCellWrapper
				.sCalcNumberFormatString(oInternalResultDataCell,
						lFormatString, true, true, false, oResultDataCell);
		if (oFF.notNull(oResultDataCell)) {
			oResultDataCell.setNumberFormatStringProvided(lNumberFormatString,
					lNumberFormatStringWithCurrencyUnit,
					lFullNumberFormatString,
					lFullNumberFormatStringWithCurrencyUnit);
		}
		lFormatString = null;
		if (addNegativeNumberFormat) {
			if (addCurrencyUnitInfo) {
				lFormatString = lFullNumberFormatStringWithCurrencyUnit;
			} else {
				lFormatString = lFullNumberFormatString;
			}
		} else {
			if (addCurrencyUnitInfo) {
				lFormatString = lNumberFormatStringWithCurrencyUnit;
			} else {
				lFormatString = lNumberFormatString;
			}
		}
		return lFormatString;
	};
	sap.zen.ResultDataCellWrapper.sCalcFormatString = function(
			thousandSeparator, decimalSeparator, decimals) {
		var lFormatString = sap.zen.ResultDataCellWrapper.NO_FORMAT_STRING;
		var lDecimalCount;
		lFormatString = "#";
		if (oFF.XStringUtils.isNotNullAndNotEmpty(thousandSeparator)) {
			lFormatString = oFF.XStringUtils.concatenate3("#",
					thousandSeparator, "##");
		}
		lFormatString = oFF.XStringUtils.concatenate2(lFormatString, "0");
		if (oFF.XStringUtils.isNotNullAndNotEmpty(decimalSeparator)
				&& decimals > 0) {
			lFormatString = oFF.XStringUtils.concatenate2(lFormatString,
					decimalSeparator);
			for (lDecimalCount = 0; lDecimalCount < decimals; lDecimalCount++) {
				lFormatString = oFF.XStringUtils.concatenate2(lFormatString,
						"0");
			}
		}
		return lFormatString;
	};
	sap.zen.ResultDataCellWrapper.sCalcFormatStringFromFormattedValue = function(
			oInternalResultDataCell, oResultDataCell) {
		var lFormatString;
		var lValue;
		var lFormattedValue;
		var lDecimals;
		var lValueInInternalFormat;
		var lValueInExternalFormat;
		var lExternalValueFormattedLength;
		var lDecimalSeparator;
		var lStartIndex;
		var lThousandSeparator;
		if (oFF.isNull(oInternalResultDataCell)
				|| !oInternalResultDataCell.getValueType().isNumber()) {
			return sap.zen.ResultDataCellWrapper.NO_FORMAT_STRING;
		}
		lFormatString = sap.zen.ResultDataCellWrapper.NO_FORMAT_STRING;
		if (sap.zen.ResultDataCellWrapper
				.sIsValueValid(oInternalResultDataCell)) {
			lValue = sap.zen.ResultDataCellWrapper.sProvideValue(
					oInternalResultDataCell, false, oResultDataCell);
			if (oFF.isNull(lValue)) {
				return null;
			}
			lFormattedValue = oInternalResultDataCell.getFormattedValue();
			lDecimals = sap.zen.ResultDataCellWrapper.sProvideDecimals(
					oInternalResultDataCell, oResultDataCell);
			if (lDecimals === sap.zen.ResultDataCellWrapper.NO_DECIMALS) {
				return sap.zen.ResultDataCellWrapper.NO_FORMAT_STRING;
			}
			lValueInInternalFormat = sap.zen.ResultDataCellWrapper
					.sCalcValueInInternalFormatFromValue(lValue, lDecimals);
			if (oFF.isNull(lValueInInternalFormat)) {
				return sap.zen.ResultDataCellWrapper.NO_FORMAT_STRING;
			}
			lValueInExternalFormat = sap.zen.ResultDataCellWrapper
					.sCalcValueInExternalFormatFromFormattedValue(
							lFormattedValue, lValueInInternalFormat);
			if (oFF.isNull(lValueInExternalFormat)) {
				return sap.zen.ResultDataCellWrapper.NO_FORMAT_STRING;
			}
			lExternalValueFormattedLength = oFF.XString
					.size(lValueInExternalFormat);
			lDecimalSeparator = null;
			lStartIndex = 0;
			if (lDecimals > 0) {
				lStartIndex = lExternalValueFormattedLength - lDecimals - 1;
			} else {
				lStartIndex = lExternalValueFormattedLength;
			}
			if (lStartIndex >= 0 && lStartIndex < lExternalValueFormattedLength) {
				lDecimalSeparator = oFF.XString.substring(
						lValueInExternalFormat, lStartIndex, lStartIndex + 1);
			}
			lThousandSeparator = null;
			if (lDecimals > 0) {
				lStartIndex = lExternalValueFormattedLength - lDecimals - 1 - 4;
			} else {
				lStartIndex = lExternalValueFormattedLength - 4;
			}
			if (lStartIndex >= 0 && lStartIndex < lExternalValueFormattedLength) {
				lThousandSeparator = oFF.XString.substring(
						lValueInExternalFormat, lStartIndex, lStartIndex + 1);
			}
			if (oFF.XStringUtils.isNullOrEmpty(lThousandSeparator)) {
				if (oFF.XStringUtils.isNotNullAndNotEmpty(lDecimalSeparator)) {
					if (oFF.XString.isEqual(lDecimalSeparator, ",")) {
						lThousandSeparator = ".";
					} else {
						if (oFF.XString.isEqual(lDecimalSeparator, ".")) {
							lThousandSeparator = ",";
						}
					}
				}
			}
			lFormatString = sap.zen.ResultDataCellWrapper.sCalcFormatString(
					lThousandSeparator, lDecimalSeparator, lDecimals);
		}
		return lFormatString;
	};
	sap.zen.ResultDataCellWrapper.sCalcNumberFormatString = function(
			oInternalResultDataCell, formatString, addNegativeNumberFormat,
			addCurrencyUnitInfo, wrapCurrencyUnit, oResultDataCell) {
		var lFormatString = formatString;
		var lValueType;
		var lValueException;
		var lNumberFormatString;
		var loCurrencyUnitInfo;
		if (oFF.isNull(lFormatString)) {
			lFormatString = sap.zen.ResultDataCellWrapper.NO_FORMAT_STRING;
		}
		lValueType = null;
		lValueException = null;
		if (oFF.notNull(oInternalResultDataCell)) {
			lValueType = oInternalResultDataCell.getValueType();
			lValueException = oInternalResultDataCell.getValueException();
		}
		if (oFF.isNull(oInternalResultDataCell)) {
			return sap.zen.ResultDataCellWrapper.NO_FORMAT_STRING;
		}
		if (oFF.isNull(lValueType) || !lValueType.isNumber()) {
			return sap.zen.ResultDataCellWrapper.NO_FORMAT_STRING;
		}
		if (lValueException !== oFF.ValueException.NORMAL) {
			if (lValueException === oFF.ValueException.UNDEFINED
					|| lValueException === oFF.ValueException.NULL_VALUE) {
				lFormatString = sap.zen.ResultDataCellWrapper.NO_DISPLAY_FORMAT_STRING;
			}
			if (lValueException === oFF.ValueException.NO_PRESENTATION
					|| lValueException === oFF.ValueException.NO_AUTHORITY) {
				lFormatString = sap.zen.ResultDataCellWrapper.NO_DISPLAY_FORMAT_STRING;
			}
			if (lValueException === oFF.ValueException.MIXED_CURRENCIES_OR_UNITS) {
				lFormatString = sap.zen.ResultDataCellWrapper.NO_FORMAT_STRING;
			}
		}
		if (!sap.zen.ResultDataCellWrapper
				.sIsValueValid(oInternalResultDataCell)) {
			lFormatString = sap.zen.ResultDataCellWrapper.NO_DISPLAY_FORMAT_STRING;
		}
		lNumberFormatString = lFormatString;
		if (oFF.XStringUtils.isNotNullAndNotEmpty(lFormatString)) {
			lNumberFormatString = sap.zen.ResultDataCellWrapper
					.sAddValueTypeInformation(lNumberFormatString, lValueType,
							lValueException);
		}
		if (addCurrencyUnitInfo) {
			if (oFF.XStringUtils.isNotNullAndNotEmpty(lFormatString)
					|| lValueException === oFF.ValueException.MIXED_CURRENCIES_OR_UNITS) {
				loCurrencyUnitInfo = sap.zen.ResultDataCellWrapper
						.sProvideCurrencyUnit(oInternalResultDataCell,
								oResultDataCell);
				lNumberFormatString = sap.zen.ResultDataCellWrapper
						.sAddCurrencyUnitInformation(lNumberFormatString,
								loCurrencyUnitInfo, wrapCurrencyUnit);
			}
		}
		if (addNegativeNumberFormat) {
			if (oFF.XStringUtils.isNotNullAndNotEmpty(lFormatString)) {
				lNumberFormatString = oFF.XStringUtils.concatenate4(
						lNumberFormatString, ";", "-", lNumberFormatString);
			}
		}
		return lNumberFormatString;
	};
