	sap.zen.ResultSetWrapper.prototype.synchronize = function(oListener,
			oBaggage, asynchron) {
		var loDataSource;
		var loQueryManager;
		var lRefreshPossible;
		var lRefreshRequired;
		var loPaging;
		var loActionResult;
		var loAction;
		var ltAxesPaging;
		var loAxisPagingIterator;
		var loAxisPaging;
		var loResultSetContainer;
		var lSyncState;
		var loWindow;
		var loQueryExecutionResponse;
		if (this.getState() === oFF.SyncState.PROCESSING) {
			return null;
		}
		loDataSource = this.getDataSource();
		if (oFF.isNull(loDataSource)) {
			return null;
		}
		loQueryManager = loDataSource.getQueryManager();
		lRefreshPossible = oFF.notNull(loQueryManager)
				&& loDataSource.isInitialized();
		lRefreshRequired = loDataSource.isDataSourceChanged();
		if (!lRefreshRequired) {
			loPaging = this.getServerPaging();
			if (oFF.notNull(loPaging)) {
				if (!loPaging.getState().isTypeOf(oFF.SyncState.IN_SYNC)) {
					lRefreshRequired = true;
				}
			}
		}
		loActionResult = sap.zen.ActionResponse.createActionResponse();
		if (lRefreshPossible && lRefreshRequired) {
			this.syncState = oFF.SyncState.PROCESSING;
			loAction = sap.zen.ActionSynchronizeResultSet.create(this,
					loActionResult, oBaggage);
			loAction.addListener(oListener);
			loPaging = this.getServerPaging();
			ltAxesPaging = loPaging.getAxesPaging();
			if (oFF.notNull(ltAxesPaging) && !ltAxesPaging.isEmpty()) {
				loAxisPagingIterator = ltAxesPaging.getIterator();
				while (loAxisPagingIterator.hasNext()) {
					loAxisPaging = loAxisPagingIterator.next();
					if (oFF.isNull(loAxisPaging)) {
						continue;
					}
					loAxisPaging.setPage(
							sap.zen.ResultSetAxisPaging.OFFSET_DEFAULT,
							sap.zen.ResultSetAxisPaging.SIZE_DEFAULT);
				}
			}
			loResultSetContainer = loQueryManager.getActiveResultSetContainer();
			lSyncState = loResultSetContainer.getSyncState();
			if (!lSyncState.isTypeOf(oFF.SyncState.IN_SYNC)) {
				loWindow = loDataSource.getPage().getWindow();
				loWindow.showImmediatelyLoadingIndicator();
				loWindow.setExecuteShowHideLoadingIndicator(false);
				loQueryExecutionResponse = null;
				if (asynchron) {
					loQueryExecutionResponse = loQueryManager
							.processQueryExecution(oFF.SyncType.NON_BLOCKING,
									this, loAction);
				} else {
					loQueryExecutionResponse = loQueryManager
							.processQueryExecution(oFF.SyncType.BLOCKING, this,
									loAction);
					if (!this.getState().isTypeOf(oFF.SyncState.IN_SYNC)) {
						this.onQueryExecuted(loQueryExecutionResponse,
								loQueryExecutionResponse.getData(), loAction);
					}
				}
				loActionResult.actionPerformed = true;
				loActionResult.addAllMessages(loQueryExecutionResponse);
			}
			if (!loActionResult.actionWasPerformed()) {
				this.syncState = oFF.SyncState.IN_SYNC;
			}
		}
		return loActionResult;
	};
