		var loInternalResultDimensionIterator;
		var loInternalResultDimension;
		if (oFF.isNull(loInternalResultSet)) {
			return false;
		}
		lAxisContainsDimension = false;
		ltInternalResultDimensions = loInternalResultSet.getAxis(axis)
