	sap.zen.ResultSetWrapper.prototype.getTuple = function(axis, tupleIndex,
			oDimension, memberName) {
		var loTuple = null;
		var ltTuples;
		var loTupleIterator;
		var loExistingTuple;
		var lKey;
		if (oFF.notNull(memberName)) {
			loTuple = sap.zen.TupleWrapper.create(this, axis, tupleIndex,
					oDimension, memberName);
			ltTuples = this.tTuples.getValuesAsReadOnlyList();
			if (oFF.notNull(ltTuples) && !ltTuples.isEmpty()) {
				loTupleIterator = ltTuples.getIterator();
				while (loTupleIterator.hasNext()) {
					loExistingTuple = loTupleIterator.next();
					if (oFF.isNull(loExistingTuple)) {
						continue;
					}
					if (loExistingTuple.getAxis() === loTuple.getAxis()
							&& loExistingTuple.getIndex() === loTuple
									.getIndex()) {
						return loExistingTuple;
					}
				}
			}
		} else {
			lKey = sap.zen.TupleWrapper.sGetName(this, axis, tupleIndex);
			if (this.tTuples.containsKey(lKey)) {
				loTuple = this.tTuples.getByKey(lKey);
				return loTuple;
			}
		}
		loTuple = sap.zen.TupleWrapper.create(this, axis, tupleIndex,
				oDimension, memberName);
		return loTuple;
	};
