	sap.zen.TupleElementWrapper.create = function(oTuple, tupleElementIndex,
			oDimension) {
		var loInstance = null;
		var lDimensionName = null;
		var loInternalTupleElement;
		if (oFF.notNull(oDimension)) {
			lDimensionName = oDimension.getName();
		}
		loInternalTupleElement = sap.zen.TupleElementWrapper
				.sGetTupleElementObject(oTuple, tupleElementIndex,
						lDimensionName);
		if (oFF.notNull(loInternalTupleElement)) {
			loInstance = new sap.zen.TupleElementWrapper();
			loInstance.initMe(oTuple, loInternalTupleElement, oDimension);
		}
		return loInstance;
	};
	sap.zen.TupleElementWrapper.sGetTupleElementObject = function(oTuple,
			tupleElementIndex, dimensionName) {
		var loInternalTuple = oTuple.getInternalObject();
		var loInternalTupleElement;
		var loInternalDimension;
		if (oFF.isNull(loInternalTuple)) {
			return null;
		}
		loInternalTupleElement = null;
		if (oFF.XStringUtils.isNotNullAndNotEmpty(dimensionName)) {
			loInternalDimension = loInternalTuple.getAxis().getQueryModel()
					.getDimensionByName(dimensionName);
			if (loInternalDimension.getUniversalDisplayHierarchy() !== null
					&& loInternalDimension.getIndexOnAxis() > 0) {
				loInternalTupleElement = loInternalTuple.get(0);
				return loInternalTupleElement;
			}
			loInternalTupleElement = loInternalTuple
					.getTupleElementByDimension(loInternalDimension);
		} else {
			loInternalTupleElement = loInternalTuple.get(tupleElementIndex);
		}
		return loInternalTupleElement;
	};
	sap.zen.TupleElementWrapper.sGetName = function(oTuple, tupleElementIndex) {
		var lKey;
		if (oFF.isNull(oTuple) || tupleElementIndex < 0) {
			return null;
		}
		lKey = oFF.XStringUtils.concatenate3(oTuple.getName(), ";",
				oFF.XInteger.convertToString(tupleElementIndex));
		return lKey;
	};
	sap.zen.TupleElementWrapper.prototype.oTuple = null;
	sap.zen.TupleElementWrapper.prototype.tupleElementIndex = 0;
	sap.zen.TupleElementWrapper.prototype.oInternalObject = null;
	sap.zen.TupleElementWrapper.prototype.oDimension = null;
