	sap.zen.TupleElementWrapper.prototype.getCompactDrillState = function() {
		if (this.isLeaf()) {
			return oFF.DrillState.LEAF;
		} else {
			if (this.isExpanded()) {
				return oFF.DrillState.EXPANDED;
			} else {
				if (this.isCollapsed()) {
					return oFF.DrillState.COLLAPSED;
				}
			}
		}
		return null;
	};
	sap.zen.TupleElementWrapper.prototype.isLeaf = function() {
		var lDrillState = this.getDrillState();
		if (lDrillState === oFF.DrillState.LEAF) {
			return true;
		}
		return false;
	};
	sap.zen.TupleElementWrapper.prototype.isExpanded = function() {
		var lDrillState = this.getDrillState();
		if (lDrillState === oFF.DrillState.EXPANDED
				|| lDrillState === oFF.DrillState.DRILLED
				|| lDrillState === oFF.DrillState.LEAF_UDH) {
			return true;
		}
		return false;
	};
	sap.zen.TupleElementWrapper.prototype.isCollapsed = function() {
		var lDrillState = this.getDrillState();
		if (lDrillState === oFF.DrillState.COLLAPSED
				|| lDrillState === oFF.DrillState.LEAF_DRILLDOWN_ALLOWED
				|| lDrillState === oFF.DrillState.LEAF_UDH_EXPAND_ALLOWED
				|| lDrillState === oFF.DrillState.COLLAPSED_EXPAND_AND_DRILLDOWN_ALLOWED) {
			return true;
		}
		return false;
	};
	sap.zen.TupleElementWrapper.prototype.getNodeAlignment = function() {
		var lDrillState = this.getDrillState();
		if (lDrillState === oFF.DrillState.EXPANDED) {
			return this.getDimension().getProperties().getHierarchyAlignment();
		} else {
			if (lDrillState === oFF.DrillState.DRILLED) {
				return this.getDimension().getProperties().getUDHAlignment();
			}
		}
		return null;
	};
	sap.zen.TupleElementWrapper.prototype.toggleDrillState = function(
			triggerChangedEvent) {
		var loInternalTupleElement = this.getInternalObject();
		var loProperties;
		var lDrillState;
		var loDataSourceChangeCause;
		if (oFF.isNull(loInternalTupleElement)) {
			return false;
		}
		loProperties = this.getDimension().getProperties();
		lDrillState = this.getDrillState();
		if (this.isExpanded()) {
			lDrillState = oFF.DrillState.COLLAPSED;
		} else {
			if (lDrillState === oFF.DrillState.COLLAPSED) {
				if (loProperties.isUDHActive()) {
					lDrillState = oFF.DrillState.DRILLED;
				} else {
					lDrillState = oFF.DrillState.EXPANDED;
				}
			} else {
				if (lDrillState === oFF.DrillState.LEAF_DRILLDOWN_ALLOWED) {
					lDrillState = oFF.DrillState.DRILLED;
				} else {
					if (lDrillState === oFF.DrillState.LEAF_UDH_EXPAND_ALLOWED) {
						lDrillState = oFF.DrillState.EXPANDED;
					} else {
						if (lDrillState === oFF.DrillState.COLLAPSED_EXPAND_AND_DRILLDOWN_ALLOWED) {
							lDrillState = oFF.DrillState.EXPANDED;
						}
					}
				}
			}
		}
		loInternalTupleElement.setNextDrillState(lDrillState);
		if (triggerChangedEvent) {
			loDataSourceChangeCause = new sap.zen.DataSourceChangeCause();
			loDataSourceChangeCause
					.setAction(sap.zen.CDataSourceChangeAction.ExpandCollapseHierarchyNode);
			loDataSourceChangeCause.addProperties(this
					.getActionObjectProperties());
			if (oFF.notNull(lDrillState)) {
				loDataSourceChangeCause.addProperty("NewDrillState",
						lDrillState.getName());
			}
			if (oFF.notNull(lDrillState)) {
				loDataSourceChangeCause.addProperty("rootcause_hierarchy",
						lDrillState.getName());
			}
			loDataSourceChangeCause.addProperty(
					"rootcause_hierarchy_directiondown", oFF.XBoolean
							.convertToString(true));
			this.getDataSource().raiseDataSourceChangedEvent(
					loDataSourceChangeCause, false, true);
		}
		return true;
	};
