	sap.zen.ProjectionMember.prototype.render = function() {
		var loInternalDimensionMember = this.oDimensionMember
				.getInternalObject();
		var lKey = this.oDimensionMember.getName();
		var lText = this.oDimensionMember.getText();
		var lMemberType = loInternalDimensionMember.getMemberType();
		var lMemberTypeName = oFF.XString.toUpperCase(lMemberType.toString());
		var lDisplayLevel;
		var loInternalTupleElement;
		if (oFF.MemberType.RESULT.isEqualTo(lMemberType)) {
			lMemberTypeName = "RESULT";
			lKey = "Result";
		}
		this.oJsonDataProjector.oRenderSerializer.openJsonTag();
		this.oJsonDataProjector.oRenderSerializer.addAttribute("key", lKey);
		if (oFF.notNull(lText)) {
			this.oJsonDataProjector.oRenderSerializer.addAttribute("text",
					lText);
		} else {
			this.oJsonDataProjector.oRenderSerializer.addNullAttribute("text");
		}
		if (!oFF.MemberType.MEMBER.isEqualTo(lMemberType)) {
			this.oJsonDataProjector.oRenderSerializer.addAttribute("type",
					lMemberTypeName);
		}
		this.renderMeasureSpecifics();
		if (oFF.notNull(this.oTupleElement)) {
			if (!this.oTupleElement.isLeaf()) {
				this.oJsonDataProjector.oRenderSerializer.addAttribute(
						"nodeState", oFF.XString.toUpperCase(this.oTupleElement
								.getDrillState().toString()));
			}
			lDisplayLevel = this.oTupleElement.getDisplayLevel();
			if (lDisplayLevel !== 0) {
				this.oJsonDataProjector.oRenderSerializer.addIntegerAttribute(
						"level", lDisplayLevel);
			}
			if (this.oDimensionMember.getDimension().getProperties()
					.isHierarchyAssignedAndActive()) {
				loInternalTupleElement = this.oTupleElement.getInternalObject();
				if (loInternalTupleElement.getParentNode() !== null) {
					this.oJsonDataProjector.oRenderSerializer.addAttribute(
							"parent", loInternalTupleElement.getParentNode()
									.getDimensionMember().getName());
				}
			}
		}
		this.oJsonDataProjector.oRenderSerializer.closeJsonTag();
	};
	sap.zen.ProjectionMember.prototype.renderMeasureSpecifics = function() {
		var lUniformCurrencyUnit;
		var lHasUniformCurrencyUnit;
		var lHasUniformFormat;
		var lDecimals;
		var lHasUniformScalingFactor;
		var lScalingFactor;
		var lCurrencyUnit;
		var lFormatString;
		if (oFF.notNull(this.oSampleCell)) {
			lUniformCurrencyUnit = sap.zen.ResultSetWrapper
					.sGetUniformCurrencyUnit(this.oSampleCell, null);
			lHasUniformCurrencyUnit = false;
			if (oFF.notNull(lUniformCurrencyUnit)) {
				lHasUniformCurrencyUnit = true;
			}
			lHasUniformFormat = false;
			lDecimals = sap.zen.ResultSetWrapper.sGetUniformDecimals(
					this.oSampleCell, null);
			if (lDecimals !== sap.zen.ResultDataCellWrapper.NO_DECIMALS) {
				lHasUniformFormat = true;
			}
			lHasUniformScalingFactor = false;
			lScalingFactor = sap.zen.ResultSetWrapper.sGetUniformScalingFactor(
					this.oSampleCell, null);
			if (lScalingFactor !== sap.zen.ResultDataCellWrapper.NO_SCALING_FACTOR) {
				lHasUniformScalingFactor = true;
			}
			if (lHasUniformCurrencyUnit) {
				lCurrencyUnit = null;
				if (oFF.notNull(lUniformCurrencyUnit)) {
					lHasUniformCurrencyUnit = true;
					lCurrencyUnit = lUniformCurrencyUnit.getPrefix();
					if (oFF.XStringUtils.isNullOrEmpty(lCurrencyUnit)) {
						lCurrencyUnit = lUniformCurrencyUnit.getSuffix();
					}
					if (oFF.XStringUtils.isNullOrEmpty(lCurrencyUnit)) {
						lCurrencyUnit = lUniformCurrencyUnit.getFormatted();
					}
				}
				if (oFF.XStringUtils.isNotNullAndNotEmpty(lCurrencyUnit)) {
					this.oJsonDataProjector.oRenderSerializer.addAttribute(
							"unitOfMeasure", lCurrencyUnit);
				}
			}
			if (lHasUniformFormat) {
				lFormatString = this.oSampleCell.getNumberFormatString(true,
						lHasUniformCurrencyUnit);
				this.oJsonDataProjector.oRenderSerializer.addAttribute(
						"formatString", lFormatString);
			}
			if (lHasUniformScalingFactor) {
				this.oJsonDataProjector.oRenderSerializer.addAttribute(
						"scalingFactor", oFF.XInteger
								.convertToString(lScalingFactor));
			}
		}
	};
