	sap.zen.BookmarkRequestHandler.prototype.onHttpResponse = function(
			extResult, response, customIdentifier) {
		var content;
		var rootNode;
		var bookmarkSetNode;
		var bookmarkDataNode;
		var dataProperty;
		var dataNodeText;
		var decoded;
		var mpropertiesNode;
		var titleProperty;
		var ownerProperty;
		var allBookmarksNode;
		var allBookmarksNodeEntries;
		var mpropertiesNode2;
		var i;
		var mpropertiesNode2String;
		var mpropertiesNode2XString;
		if (extResult.hasErrors() === false) {
			content = response.getString();
			this.oRootNode = sap.buddha.XXmlUtils.getRootNode(content);
			if (this.bwMode) {
				rootNode = sap.buddha.XXmlUtils.getRootNode(content);
				if (oFF.notNull(rootNode)) {
					bookmarkSetNode = rootNode.getFirstChildWithAttributeValue(
							"title", "type", "text", false);
					if (oFF.XString.containsString(bookmarkSetNode.getText(),
							"BookmarkSet('")) {
						bookmarkDataNode = rootNode
								.getFirstChildWithAttributeValue("link",
										"title", "Data", false);
						if (oFF.isNull(this.bm)) {
							this.bm = oFF.XArray.create(3);
						} else {
							this.bm.clear();
						}
						if (oFF.notNull(bookmarkDataNode)) {
							dataProperty = bookmarkDataNode
									.getFirstChildWithAttributeValue("d:Data",
											null, null, true);
							if (oFF.notNull(dataProperty)) {
								dataNodeText = dataProperty.getText();
								decoded = oFF.XByteArray
										.convertToString(oFF.XHttpUtils
												.decodeBase64ToByteArray(dataNodeText));
								if (oFF.notNull(decoded)) {
									this.bm.set(2, oFF.XStringValue
											.create(decoded));
								}
							}
						}
						mpropertiesNode = rootNode
								.getFirstChildWithAttributeValue("content",
										"type", "application/xml", false);
						if (oFF.notNull(mpropertiesNode)) {
							titleProperty = mpropertiesNode
									.getFirstChildWithAttributeValue("d:Title",
											null, null, true);
							if (oFF.notNull(titleProperty)) {
								this.bm.set(0, oFF.XStringValue
										.create(titleProperty.getText()));
							}
							ownerProperty = mpropertiesNode
									.getFirstChildWithAttributeValue("d:Owner",
											null, null, true);
							if (oFF.notNull(ownerProperty)) {
								this.bm.set(1, oFF.XStringValue
										.create(ownerProperty.getText()));
							}
						}
					} else {
						if (rootNode.getFirstChildWithAttributeValue("title",
								"type", "text", false) !== null) {
							allBookmarksNode = (rootNode
									.getFirstChildWithAttributeValue("title",
											"type", "text", false));
							if (oFF.XString.isEqual(allBookmarksNode.getText(),
									"BookmarkSet")) {
								if (oFF.isNull(this.tAllBookmarkIDs)) {
									this.tAllBookmarkIDs = oFF.XList.create();
								}
								if (!this.tAllBookmarkIDs.isEmpty()) {
									this.tAllBookmarkIDs.clear();
								}
								allBookmarksNodeEntries = rootNode
										.getChildrenWoBiNameSpace("entry");
								for (i = 0; i < allBookmarksNodeEntries.size(); i++) {
									mpropertiesNode2 = allBookmarksNodeEntries
											.get(i)
											.getFirstChildWithAttributeValue(
													"m:properties", null, null,
													true);
									mpropertiesNode2String = mpropertiesNode2
											.getFirstChildWithAttributeValue(
													"d:Id", null, null, true)
											.getText();
									mpropertiesNode2XString = oFF.XStringValue
											.create(mpropertiesNode2String);
									this.tAllBookmarkIDs
											.add(mpropertiesNode2XString);
								}
							}
						}
					}
				}
			}
		}
	};
	sap.zen.BookmarkRequestHandler.prototype.onFunctionExecuted = function(
			extResult, response, customIdentifier) {
		var responseStr;
		var jsonParser;
		var jsonElement;
		var bookmarkResponse;
		var d;
		var results;
		var resultsSize;
		var i;
		var currentBookmark;
		var bookmarkId;
		var bookmarkUserid;
		var bookmarkName;
		var bookmarkReadOnly;
		var bookmarkGlobal;
		var bookmarkGroupId;
		var currentBM;
		var data;
		var bookmarkData;
		var decoded;
		var title;
		var owner;
		if (extResult.hasErrors() === false
				&& response.getRootElement() !== null) {
			responseStr = response.toString();
			jsonParser = oFF.JsonParserFactory.newInstance();
			jsonElement = jsonParser.parse(responseStr);
			if (jsonParser.hasErrors()) {
				throw oFF.XException.createRuntimeException(jsonParser
						.getSummary());
			}
			if (oFF.notNull(jsonElement)) {
				if (jsonElement.getType() !== oFF.PrElementType.STRUCTURE) {
					throw oFF.XException
							.createRuntimeException("JSON string is not a structure");
				}
				bookmarkResponse = jsonElement.getPermaCopy().asStructure();
				if (oFF.notNull(bookmarkResponse)) {
					d = bookmarkResponse.getStructureByKey("d");
					if (oFF.notNull(d)) {
						if (d.hasStringByKey("results")) {
							if (oFF.isNull(this.tAllBookmarks)) {
								this.tAllBookmarks = oFF.XHashMapByString
										.create();
							}
							if (!this.tAllBookmarks.isEmpty()) {
								this.tAllBookmarks.clear();
							}
							results = d.getListByKey("results");
							if (oFF.notNull(results)) {
								resultsSize = results.size();
								for (i = 0; i < resultsSize; i++) {
									currentBookmark = results.getStructureAt(i);
									bookmarkId = currentBookmark
											.getStringByKey("Id");
									bookmarkUserid = currentBookmark
											.getStringByKeyExt("Owner", "");
									bookmarkName = currentBookmark
											.getStringByKeyExt("Title", "");
									bookmarkReadOnly = currentBookmark
											.getBooleanByKeyExt("IsReadOnly",
													false);
									bookmarkGlobal = currentBookmark
											.getBooleanByKeyExt("IsPublic",
													false);
									bookmarkGroupId = currentBookmark
											.getStringByKeyExt(
													"GroupIdentifier", "");
									currentBM = new sap.zen.Bookmark();
									currentBM.initMe2(bookmarkName,
											bookmarkUserid, "", bookmarkId,
											bookmarkGroupId, bookmarkGlobal,
											bookmarkReadOnly);
									this.tAllBookmarks.put(bookmarkId,
											currentBM);
								}
							}
						} else {
							if (d.hasStringByKey("Data")) {
								try {
									data = d.getStructureByKey("Data");
								} catch (e) {
									return;
								}
								bookmarkData = null;
								if (data.isStructure()) {
									bookmarkData = data.getStringByKeyExt(
											"Data", "");
								}
								if (oFF.XStringUtils
										.isNullOrEmpty(bookmarkData)) {
									this.bmId = d.getStringByKeyExt("Id", "");
								} else {
									if (oFF.isNull(this.bm)) {
										this.bm = oFF.XArray.create(3);
									} else {
										this.bm.clear();
									}
									decoded = oFF.XByteArray
											.convertToString(oFF.XHttpUtils
													.decodeBase64ToByteArray(bookmarkData));
									if (oFF.notNull(decoded)) {
										this.bm.set(2, oFF.XStringValue
												.create(decoded));
									}
									title = d.getStringByKey("Title");
									if (oFF.notNull(title)) {
										this.bm.set(0, oFF.XStringValue
												.create(title));
									} else {
										this.bm.set(0, oFF.XStringValue
												.create(""));
									}
									owner = d.getStringByKey("Owner");
									if (oFF.notNull(owner)) {
										this.bm.set(1, oFF.XStringValue
												.create(owner));
									}
								}
							}
						}
					}
				}
			}
		}
	};
