	sap.zen.LocalizationText.prototype.getLocalizationKey = function(
			oLocalization) {
		var lKey;
		var lArea;
		if (oFF.isNull(oLocalization)) {
			return null;
		}
		lKey = null;
		lArea = this.getLocalizationArea();
		if (oFF.notNull(lArea)) {
			lKey = oFF.XStringUtils.concatenate3(
					sap.zen.LocalizationText.defaultLocalizationPrefix, this
							.getLocalizationArea(), this.getId());
			if (oLocalization.hasText(lKey)) {
				return lKey;
			}
		}
		lKey = oFF.XStringUtils.concatenate2(
				sap.zen.LocalizationText.defaultLocalizationPrefix, this
						.getId());
		if (oLocalization.hasText(lKey)) {
			return lKey;
		}
		if (oFF.XString.isEqual(
				sap.zen.LocalizationText.defaultLocalizationPrefix, this
						.getLocalizationPrefix())) {
			return lKey;
		}
		lKey = oFF.XStringUtils.concatenate2(this.getLocalizationPrefix(), this
				.getId());
		if (oLocalization.hasText(lKey)) {
			return lKey;
		}
		return lKey;
	};
	sap.zen.LocalizationText.prototype.checkText = function(text, arg1, arg2,
			arg3) {
		if (oFF.isNull(text) || oFF.XString.startsWith(text, "MissingResource")) {
			text = this.defaultText;
			if (oFF.XStringUtils.isNotNullAndNotEmpty(arg1)) {
				text = oFF.XString.replace(text, "{0}", arg1);
			}
			if (oFF.XStringUtils.isNotNullAndNotEmpty(arg2)) {
				text = oFF.XString.replace(text, "{1}", arg2);
			}
			if (oFF.XStringUtils.isNotNullAndNotEmpty(arg3)) {
				text = oFF.XString.replace(text, "{2}", arg3);
			}
		}
	};
	sap.zen.LocalizationText.prototype.getText = function(oLocalization, arg1,
			arg2, arg3) {
		var lText = null;
		var lKey;
		if (oFF.notNull(oLocalization)) {
			lKey = this.getLocalizationKey(oLocalization);
			if (oFF.XStringUtils.isNotNullAndNotEmpty(arg3)) {
				lText = oLocalization.getText3(lKey, arg1, arg2, arg3);
			} else {
				if (oFF.XStringUtils.isNotNullAndNotEmpty(arg2)) {
					lText = oLocalization.getText2(lKey, arg1, arg2);
				} else {
					if (oFF.XStringUtils.isNotNullAndNotEmpty(arg1)) {
						lText = oLocalization.getText1(lKey, arg1);
					} else {
						lText = oLocalization.getText(lKey);
					}
				}
			}
			if (oFF.XString.isEqual(lKey, lText)) {
				lText = this.defaultText;
			}
			this.checkText(lText, arg1, arg2, arg3);
		}
		return lText;
	};
	sap.zen.LocalizationText.prototype.getTextWithTripleDots = function(
			oLocalization, arg1, arg2, arg3) {
		var lText = null;
		lText = this.getText(oLocalization, arg1, arg2, arg3);
		lText = sap.zen.LocalizationText.sAddTrailingTripleDotsToText(lText);
		return lText;
	};
