	sap.zen.ZBackendServices.prototype.getApplications = function(
			oMessageWriter) {
		var list = oFF.XList.create();
		var uri = oFF.XUri.create();
		var httpClient;
		var request;
		var processHttpRequest;
		var response;
		var content;
		var splitString;
		var i;
		var appName;
		var techName;
		var description;
		var member;
		var processHttpRequest2;
		var response2;
		var content2;
		var node;
		var entriesNodes;
		var i2;
		var entryNode;
		var contentNode;
		var propertiesNode;
		var techNameNode;
		var descrNode;
		var techName2;
		var description2;
		var member2;
		uri.setProtocolType(this.oSystemDescription.getProtocolType());
		httpClient = oFF.HttpClientFactory.newInstanceByConnection(
				this.oSystemDescription.getApplication().getSession(), uri);
		request = httpClient.getRequest();
		request.setFromConnectionInfo(this.oSystemDescription);
		request.setMethod(oFF.HttpRequestMethod.HTTP_GET);
		if (this.ishanaSystem()) {
			request.setAcceptContentType(oFF.ContentType.TEXT_PLAIN);
			request.setTextContentEncoding("UTF-8");
			request.setPath("/sap/bi/aas/rt/repo.xsjs?api=listAppNames");
			processHttpRequest = httpClient.processHttpRequest(
					oFF.SyncType.BLOCKING, null, null);
			oMessageWriter.createMessagesFromCollection(processHttpRequest);
			response = processHttpRequest.getData();
			if (processHttpRequest.hasErrors() === false) {
				content = response.getString();
				splitString = oFF.XStringTokenizer.splitString(content, "\n");
				for (i = 0; i < splitString.size(); i++) {
					appName = splitString.get(i);
					techName = appName;
					description = appName;
					member = sap.zen.Member.create(techName, description);
					list.add(member);
				}
			}
		} else {
			request.setAcceptContentType(oFF.ContentType.APPLICATION_XML);
			request.setTextContentEncoding("UTF-8");
			request
					.setPath("/sap/opu/odata/sap/RSAO_ODATA_SRV/BiApplicationSet");
			processHttpRequest2 = httpClient.processHttpRequest(
					oFF.SyncType.BLOCKING, null, null);
			oMessageWriter.createMessagesFromCollection(processHttpRequest2);
			response2 = processHttpRequest2.getData();
			if (processHttpRequest2.hasErrors() === false) {
				content2 = response2.getString();
				node = sap.buddha.XXmlUtils.getRootNode(content2);
				entriesNodes = node.getChildrenWoBiNameSpace("entry");
				for (i2 = 0; i2 < entriesNodes.size(); i2++) {
					entryNode = entriesNodes.get(i2);
					contentNode = entryNode
							.getFirstChildWoBiNameSpace("content");
					propertiesNode = contentNode
							.getFirstChildWoBiNameSpace("m:properties");
					techNameNode = propertiesNode
							.getFirstChildWoBiNameSpace("d:Techname");
					descrNode = propertiesNode
							.getFirstChildWoBiNameSpace("d:Descr");
					techName2 = techNameNode.getText();
					description2 = descrNode.getText();
					member2 = sap.zen.Member.create(techName2, description2);
					list.add(member2);
				}
			}
		}
		return list;
	};
