	sap.zen.XpCollection.prototype.getRows = function() {
		var lRows = 0;
		var lChildIndex;
		var loChild;
		var lObjectRows;
		for (lChildIndex = 0; lChildIndex < this.getAmountOfChildren(); lChildIndex++) {
			loChild = this.getChild(lChildIndex);
			if (oFF.isNull(loChild)) {
				continue;
			}
			lObjectRows = loChild.getLayout().getRows();
			lRows = lRows + lObjectRows;
		}
		return lRows;
	};
	sap.zen.XpCollection.prototype.getColumns = function() {
		var lColumns = 0;
		var lChildIndex;
		var loChild;
		var lObjectColumns;
		for (lChildIndex = 0; lChildIndex < this.getAmountOfChildren(); lChildIndex++) {
			loChild = this.getChild(lChildIndex);
			if (oFF.isNull(loChild)) {
				continue;
			}
			lObjectColumns = loChild.getLayout().getColumns();
			if (lObjectColumns > lColumns) {
				lColumns = lObjectColumns;
			}
		}
		return lColumns;
	};
