		loInternalDimension = sap.zen.Dimension.sGetDimensionObject(
				oDataSource, dimensionName);
		if (oFF.isNull(loInternalDimension)) {
			return null;
		}
		loInternalAttribute = sap.zen.Dimension.sGetAttributeObject(
				oDataSource, dimensionName, attributeName);
		if (oFF.isNull(loInternalAttribute)) {
			return null;
		}
		return sap.zen.Dimension
				.sGetPreferredTextPresentationForAttributeObject(loInternalAttribute);
