	sap.zen.Dimension.prototype.getResultSetFields = function() {
		var ltVisibleFieldNames = oFF.XListOfString.create();
		var loInternalDimension = this.getInternalObject();
		var loInternalResultSet;
		var ltInternalResultDimensions;
		var loInternalResultDimensionIterator;
		var loResultDimension;
		var ltVisibleFields;
		var loVisibleFieldIterator;
		var loVisibleField;
		var ltInternalResultSetAttributes;
		var loInternalResultSetAttributeIterator;
		var loInternalResultSetAttribute;
		var ltInternalResultSetFields;
		var loInternalResultSetFieldIterator;
		var loInternalResultSetField;
		if (oFF.isNull(loInternalDimension)) {
			return ltVisibleFieldNames;
		}
		loInternalResultSet = this.getResultSet().getInternalObject();
		if (oFF.notNull(loInternalResultSet)) {
			ltInternalResultDimensions = loInternalResultSet.getAxis(
					this.getAxis()).getRsDimensions();
			if (oFF.notNull(ltInternalResultDimensions)
					&& !ltInternalResultDimensions.isEmpty()) {
				loInternalResultDimensionIterator = ltInternalResultDimensions
						.getIterator();
				while (loInternalResultDimensionIterator.hasNext()) {
					loResultDimension = loInternalResultDimensionIterator
							.next();
					if (oFF.isNull(loResultDimension)) {
						continue;
					}
					if (oFF.XString.isEqual(loResultDimension.getName(),
							loInternalDimension.getName())) {
						ltVisibleFields = loResultDimension
								.getResultSetFields();
						if (oFF.notNull(ltVisibleFields)
								&& !ltVisibleFields.isEmpty()) {
							loVisibleFieldIterator = ltVisibleFields
									.getIterator();
							while (loVisibleFieldIterator.hasNext()) {
								loVisibleField = loVisibleFieldIterator.next();
								if (oFF.isNull(loVisibleField)) {
									continue;
								}
								if (!ltVisibleFieldNames
										.contains(loVisibleField.getName())) {
									ltVisibleFieldNames.add(loVisibleField
											.getName());
								}
							}
						}
					}
				}
			}
		} else {
			ltInternalResultSetAttributes = loInternalDimension
					.getResultSetAttributes();
			if (oFF.notNull(ltInternalResultSetAttributes)
					&& !ltInternalResultSetAttributes.isEmpty()) {
				loInternalResultSetAttributeIterator = ltInternalResultSetAttributes
						.getIterator();
				while (loInternalResultSetAttributeIterator.hasNext()) {
					loInternalResultSetAttribute = loInternalResultSetAttributeIterator
							.next();
					if (oFF.isNull(loInternalResultSetAttribute)) {
						continue;
					}
					ltInternalResultSetFields = loInternalResultSetAttribute
							.getResultSetFields();
					if (oFF.notNull(ltInternalResultSetFields)
							&& !ltInternalResultSetFields.isEmpty()) {
						loInternalResultSetFieldIterator = ltInternalResultSetFields
								.getIterator();
						while (loInternalResultSetFieldIterator.hasNext()) {
							loInternalResultSetField = loInternalResultSetFieldIterator
									.next();
							if (oFF.isNull(loInternalResultSetField)) {
								continue;
							}
							if (this.getResultSet().getDataSource()
									.isHanaSystem()) {
								if (this.isMeasureStructure()) {
									if (oFF.XString.isEqual(loInternalDimension
											.getTextField().getName(),
											loInternalResultSetField.getName())) {
										if (!ltVisibleFieldNames
												.contains(loInternalResultSetField
														.getName())) {
											ltVisibleFieldNames
													.add(loInternalResultSetField
															.getName());
										}
									}
								} else {
									if (sap.zen.DataSourceScriptApiUtils
											.isViewableDimension(loInternalDimension)) {
										if (!ltVisibleFieldNames
												.contains(loInternalResultSetField
														.getName())) {
											ltVisibleFieldNames
													.add(loInternalResultSetField
															.getName());
										}
									}
								}
							} else {
								if (!ltVisibleFieldNames
										.contains(loInternalResultSetField
												.getName())) {
									ltVisibleFieldNames
											.add(loInternalResultSetField
													.getName());
								}
							}
						}
					}
				}
			}
		}
		return ltVisibleFieldNames;
	};
