	sap.zen.Dimension.prototype.fetchDimensionMembers = function(fieldName,
			tValues, maxMembers) {
		var ltDimensionMembers = oFF.XListOfNameObject.create();
		var loInternalDimension = this.getInternalObject();
		var loSearchField;
		var loKeyField;
		var loDisplayKeyField;
		var loTextField;
		var ltInternalSelectorFields;
		var ltVisibleFields;
		var loVisibleFieldIterator;
		var lVisibleField;
		var loInternalField;
		var loValueIterator;
		var lSearchString;
		var loResult;
		var ltData;
		var loDataIterator;
		var loDataNode;
		var loInternalDimensionMember;
		var loDimensionMember;
		var loMemberWrapper;
		var loMemberCache;
		if (oFF.isNull(loInternalDimension)) {
			return ltDimensionMembers;
		}
		loSearchField = loInternalDimension.getFieldByName(fieldName);
		loKeyField = loInternalDimension.getFieldByName(this.getKeyField(null,
				false));
		loDisplayKeyField = loInternalDimension.getFieldByName(this
				.getKeyField(null, true));
		loTextField = loInternalDimension.getFieldByName(this.getTextField(
				null, null));
		loInternalDimension.clearSelectorFilter();
		if (oFF.notNull(tValues) && !tValues.isEmpty()) {
			loInternalDimension.setSelectorPagingEnd(-1);
		} else {
			loInternalDimension.setSelectorPagingEnd(maxMembers);
		}
		ltInternalSelectorFields = loInternalDimension.getSelectorFields();
		ltInternalSelectorFields.add(loKeyField);
		ltInternalSelectorFields.add(loDisplayKeyField);
		if (this.getMemberDisplayMode(null) !== sap.zen.CMemberDisplayMode.KEY
				&& !loInternalDimension.getKeyField().getValueType().isTypeOf(
						oFF.XValueType.DATE)) {
			ltInternalSelectorFields.add(loTextField);
			ltInternalSelectorFields.add(loInternalDimension.getTextField());
		}
		ltVisibleFields = this.getResultSetFields();
		if (oFF.notNull(ltVisibleFields) && !ltVisibleFields.isEmpty()) {
			loVisibleFieldIterator = ltVisibleFields.getIterator();
			while (loVisibleFieldIterator.hasNext()) {
				lVisibleField = loVisibleFieldIterator.next();
				if (oFF.isNull(lVisibleField)) {
					continue;
				}
				loInternalField = loInternalDimension
						.getFieldByName(lVisibleField);
				if (oFF.notNull(loInternalField)) {
					ltInternalSelectorFields.add(loInternalField);
				}
			}
		}
		if (oFF.XStringUtils.isNotNullAndNotEmpty(fieldName)
				&& oFF.notNull(tValues)) {
			if (!tValues.isEmpty()) {
				loValueIterator = tValues.getIterator();
				while (loValueIterator.hasNext()) {
					lSearchString = loValueIterator.next();
					if (oFF.isNull(lSearchString)) {
						continue;
					}
					if (!this.isMeasureStructure()) {
						if (!loInternalDimension.supportsLowerCase()
								|| loSearchField.getValueType() === oFF.XValueType.UPPER_CASE_STRING) {
							lSearchString = oFF.XString
									.toUpperCase(lSearchString);
						} else {
							if (loSearchField.getValueType() === oFF.XValueType.LOWER_CASE_STRING) {
								lSearchString = oFF.XString
										.toLowerCase(lSearchString);
							}
						}
					}
					loInternalDimension.addSelectorFilter(this
							.createValueObjectForField(loSearchField,
									lSearchString), loSearchField,
							oFF.ComparisonOperator.EQUAL);
				}
			}
		}
		loResult = loInternalDimension.processValueHelp(oFF.SyncType.BLOCKING,
				null, null);
		if (loResult.isValid()) {
			ltData = loResult.getData();
			if (oFF.notNull(ltData) && !ltData.isEmpty()) {
				loDataIterator = ltData.getIterator();
				while (loDataIterator.hasNext()) {
					loDataNode = loDataIterator.next();
					if (oFF.isNull(loDataNode)) {
						continue;
					}
					loInternalDimensionMember = loDataNode.getDimensionMember();
					loDimensionMember = sap.zen.DimensionMember
							.sGetDimensionMember(this,
									loInternalDimensionMember.getName());
					if (!ltDimensionMembers.contains(loDimensionMember)) {
						ltDimensionMembers.add(loDimensionMember);
					}
					if (!(this.isCompound() && loSearchField !== loKeyField)) {
						loMemberWrapper = sap.zen.MemberWrapper.create(this
								.getDataSource(), loInternalDimension,
								loInternalDimensionMember, false, null);
						loMemberCache = sap.zen.MemberCache.create(
								this.oDataSource, this.getName());
						loMemberCache.putMemberWrapper(loMemberWrapper);
					}
				}
			}
		}
		return ltDimensionMembers;
	};
	sap.zen.Dimension.prototype.createValueObjectForField = function(oField,
			value) {
		var lValueType = oField.getValueType();
		var loDate;
		var ltValuess;
		var ltDimensionMembers;
		try {
			if (lValueType === oFF.XValueType.STRING) {
				return oFF.XStringValue.create(value);
			} else {
				if (lValueType === oFF.XValueType.LONG) {
					return oFF.XLongValue.create(oFF.XLong
							.convertFromString(value));
				} else {
					if (lValueType === oFF.XValueType.INTEGER) {
						return oFF.XIntegerValue.create(oFF.XInteger
								.convertFromString(value));
					} else {
						if ((lValueType === oFF.XValueType.DOUBLE)
								|| (lValueType === oFF.XValueType.DECIMAL_FLOAT)) {
							return oFF.XDoubleValue.create(oFF.XDouble
									.convertFromString(value));
						} else {
							if (lValueType === oFF.XValueType.DATE) {
								loDate = null;
								try {
									loDate = oFF.XDate.createDateFromString(
											value, null);
								} catch (lABAPDateException) {
									loDate = null;
								}
								if (oFF.isNull(loDate)) {
									try {
										loDate = oFF.XDate
												.createDateFromString(
														value,
														oFF.XValueFormat.ISO_DATE);
									} catch (lISODateException) {
										loDate = null;
									}
								}
								if (oFF.isNull(loDate)
										&& oFF.XStringUtils
												.isNotNullAndNotEmpty(value)) {
									ltValuess = oFF.XListOfString.create();
									ltValuess.add(value);
									ltDimensionMembers = this
											.getDimensionMembersForFieldValues(
													this.getKeyField(null,
															false), ltValuess);
									if (!ltDimensionMembers.isEmpty()) {
										loDate = ltDimensionMembers.get(0)
												.getInternalObject()
												.getKeyFieldValue().getDate();
									}
								}
								return loDate;
							} else {
								if (lValueType === oFF.XValueType.TIME) {
									return oFF.XTime.createTimeFromString(
											value, null);
								} else {
									if (lValueType === oFF.XValueType.DATE_TIME) {
										return oFF.XDateTime
												.createDateTimeFromString(
														value, null);
									} else {
										if (lValueType === oFF.XValueType.TIMESPAN) {
											return oFF.XTimeSpan
													.create(oFF.XLong
															.convertFromString(value));
										}
									}
								}
							}
						}
					}
				}
			}
		} catch (e) {
			return null;
		}
		throw oFF.XException.createIllegalStateException(oFF.XStringUtils
				.concatenate2("Value type not supported: ", lValueType
						.getName()));
	};
	sap.zen.Dimension.prototype.getDimensionMembersInResultSet = function(
			maxMembers) {
		var ltDimensionMembers = oFF.XListOfNameObject.create();
		var loInternalDimension = this.getInternalObject();
		var loResultSet;
		var loInternalResultSet;
		var loDimensionMemberIterator;
		var loDimensionMember;
		var loInternalDimensionMemberIterator;
		var loInternalDimensionMember;
		var ltInternalDimensionMembers;
		var ltDimensionMemberMap;
		var ltAllDimensionMembers;
		var loDataSource;
		var loCharacteristicWrapper;
		var ltRanges;
		var ltRemoveDimensionMember;
		var loRangeIterator;
		var loRange;
		var loRemoveDimensionMemberIterator;
		if (oFF.isNull(loInternalDimension)) {
			return ltDimensionMembers;
		}
		loResultSet = this.getResultSet();
		if (oFF.isNull(loResultSet)) {
			return ltDimensionMembers;
		}
		loInternalResultSet = loResultSet.getInternalObject();
		if (oFF.isNull(loInternalResultSet)) {
			return ltDimensionMembers;
		}
		loDimensionMemberIterator = null;
		loDimensionMember = null;
		loInternalDimensionMemberIterator = null;
		loInternalDimensionMember = null;
		if (loResultSet.hasData() || !this.isMeasureStructure()) {
			ltInternalDimensionMembers = loInternalResultSet.getAxis(
					this.getAxis()).getAllMembers(loInternalDimension);
			if (oFF.notNull(ltInternalDimensionMembers)
					&& !ltInternalDimensionMembers.isEmpty()) {
				loInternalDimensionMemberIterator = ltInternalDimensionMembers
						.getIterator();
				while (loInternalDimensionMemberIterator.hasNext()) {
					loInternalDimensionMember = loInternalDimensionMemberIterator
							.next();
					if (oFF.isNull(loInternalDimensionMember)) {
						continue;
					}
					loDimensionMember = sap.zen.DimensionMember
							.sGetDimensionMember(this,
									loInternalDimensionMember.getName());
					if (!ltDimensionMembers.contains(loDimensionMember)) {
						ltDimensionMembers.add(loDimensionMember);
					}
				}
			}
		} else {
			ltDimensionMemberMap = oFF.XHashMapByString.create();
			ltAllDimensionMembers = this.getDimensionMembers(maxMembers);
			if (oFF.notNull(ltAllDimensionMembers)
					&& !ltAllDimensionMembers.isEmpty()) {
				loDimensionMemberIterator = ltAllDimensionMembers.getIterator();
				while (loDimensionMemberIterator.hasNext()) {
					loDimensionMember = loDimensionMemberIterator.next();
					if (oFF.isNull(loDimensionMember)) {
						continue;
					}
					ltDimensionMemberMap.put(loDimensionMember.getName(),
							loDimensionMember);
				}
			}
			loDataSource = this.getResultSet().getDataSource();
			loCharacteristicWrapper = sap.zen.CharacteristicWrapper.create(
					loDataSource, loInternalDimension, null, null,
					sap.zen.CMemberDisplayMode.KEY_TEXT, false);
			ltRanges = loCharacteristicWrapper.getAllSelections();
			ltRemoveDimensionMember = oFF.XList.create();
			if (oFF.notNull(ltRanges) && !ltRanges.isEmpty()) {
				loRangeIterator = ltRanges.getIterator();
				while (loRangeIterator.hasNext()) {
					loRange = loRangeIterator.next();
					if (oFF.isNull(loRange)) {
						continue;
					}
					if (!loRange.isExclude()) {
						if (loRange.getOperation() === sap.zen.Operation.EQ) {
							loDimensionMember = ltDimensionMemberMap
									.getByKey(loRange.getFrom().getKey());
							if (!ltDimensionMembers.contains(loDimensionMember)) {
								ltDimensionMembers.add(loDimensionMember);
							}
						}
					} else {
						if (loRange.getOperation() === sap.zen.Operation.EQ) {
							ltRemoveDimensionMember.add(ltDimensionMemberMap
									.getByKey(loRange.getFrom().getKey()));
						}
					}
				}
			}
			if (ltDimensionMembers.isEmpty()
					|| !ltRemoveDimensionMember.isEmpty()) {
				if (oFF.notNull(ltAllDimensionMembers)
						&& !ltAllDimensionMembers.isEmpty()) {
					loDimensionMemberIterator = ltAllDimensionMembers
							.getIterator();
					while (loDimensionMemberIterator.hasNext()) {
						loDimensionMember = loDimensionMemberIterator.next();
						if (oFF.isNull(loDimensionMember)) {
							continue;
						}
						if (!ltDimensionMembers.contains(loDimensionMember)) {
							ltDimensionMembers.add(loDimensionMember);
						}
					}
				}
			}
			if (oFF.notNull(ltRemoveDimensionMember)
					&& !ltRemoveDimensionMember.isEmpty()) {
				loRemoveDimensionMemberIterator = ltRemoveDimensionMember
						.getIterator();
				while (loRemoveDimensionMemberIterator.hasNext()) {
					loDimensionMember = loRemoveDimensionMemberIterator.next();
					if (oFF.isNull(loDimensionMember)) {
						continue;
					}
					ltDimensionMembers.removeElement(loDimensionMember);
				}
			}
		}
		return ltDimensionMembers;
	};
	sap.zen.Dimension.prototype.isDimensionMemberInResultSet = function(
			memberName) {
		var loInternalDimension = this.getInternalObject();
		var ltVisibleDimensionMembers;
		var lAmountOfVisibleDimensionMembers;
		var lAmountOfDimensionMembers;
		var lDimensionMemberIsVisible;
		var loVisibleDimensionMemberIterator;
		var loVisibleDimensionMember;
		if (oFF.isNull(loInternalDimension)) {
			return false;
		}
		ltVisibleDimensionMembers = this.getDimensionMembersInResultSet(-1);
		lAmountOfVisibleDimensionMembers = ltVisibleDimensionMembers.size();
		lAmountOfDimensionMembers = loInternalDimension
				.getAllStructureMembers().size();
		lDimensionMemberIsVisible = (lAmountOfDimensionMembers === lAmountOfVisibleDimensionMembers);
		if (lDimensionMemberIsVisible !== true) {
			if (!ltVisibleDimensionMembers.isEmpty()) {
				loVisibleDimensionMemberIterator = ltVisibleDimensionMembers
						.getIterator();
				while (loVisibleDimensionMemberIterator.hasNext()) {
					loVisibleDimensionMember = loVisibleDimensionMemberIterator
							.next();
					if (oFF.isNull(loVisibleDimensionMember)) {
						continue;
					}
					if (oFF.XString.isEqual(loVisibleDimensionMember.getName(),
							memberName)) {
						lDimensionMemberIsVisible = true;
						break;
					}
				}
			}
		}
		return lDimensionMemberIsVisible;
	};
	sap.zen.Dimension.prototype.addDimensionMemberToResultSet = function(
			memberName, triggerChangedEvent) {
		var loInternalDimension = this.getInternalObject();
		var loDimensionMember;
		var lDummy;
		var ltVisibleDimensionMembers;
		var ltRanges;
		var loRange;
		var loMemberWrapper;
		var loVisibleDimensionMemberIterator;
		var loVisibleDimensionMember;
		var loDataSourceChangeCause;
		if (oFF.isNull(loInternalDimension)) {
			return;
		}
		loDimensionMember = sap.zen.DimensionMember.sGetDimensionMember(this,
				memberName);
		if (oFF.notNull(loDimensionMember)
				&& loDimensionMember.getInternalObject().getResultVisibility() !== oFF.ResultVisibility.VISIBLE) {
			try {
				loDimensionMember.getInternalObject().setResultVisibility(
						oFF.ResultVisibility.VISIBLE);
			} catch (loException) {
				lDummy = true;
			}
		}
		ltVisibleDimensionMembers = this.getDimensionMembersInResultSet(-1);
		ltRanges = oFF.XList.create();
		loRange = null;
		loMemberWrapper = null;
		if (oFF.notNull(ltVisibleDimensionMembers)
				&& !ltVisibleDimensionMembers.isEmpty()) {
			loVisibleDimensionMemberIterator = ltVisibleDimensionMembers
					.getIterator();
			while (loVisibleDimensionMemberIterator.hasNext()) {
				loVisibleDimensionMember = loVisibleDimensionMemberIterator
						.next();
				if (oFF.isNull(loVisibleDimensionMember)) {
					continue;
				}
				loMemberWrapper = new sap.zen.MemberKeyWrapper();
				loMemberWrapper.initMe(loVisibleDimensionMember.getName());
				loRange = new sap.zen.Range();
				loRange.initMe2(loMemberWrapper);
				loRange.setOperation(sap.zen.Operation.EQ);
				loRange.setExclude(false);
				ltRanges.add(loRange);
			}
		}
		loMemberWrapper = new sap.zen.MemberKeyWrapper();
		loMemberWrapper.initMe(memberName);
		loRange = new sap.zen.Range();
		loRange.initMe2(loMemberWrapper);
		loRange.setOperation(sap.zen.Operation.EQ);
		loRange.setExclude(false);
		ltRanges.add(loRange);
		if (loInternalDimension.getAllStructureMembers().size() === ltRanges
				.size()) {
			this.clearFilter(false);
		} else {
			this.setFilterFromRange(ltRanges, false, false);
		}
		if (triggerChangedEvent) {
			loDataSourceChangeCause = new sap.zen.DataSourceChangeCause();
			loDataSourceChangeCause
					.setAction(sap.zen.CDataSourceChangeAction.AddMemberToResultSet);
			loDataSourceChangeCause.addProperties(this
					.getActionObjectProperties());
			loDataSourceChangeCause.addProperty(
					sap.zen.CDataSourceProperty.DIMENSION_MEMBER.getValue(),
					memberName);
			this.getDataSource().raiseDataSourceChangedEvent(
					loDataSourceChangeCause, false, true);
		}
	};
