	sap.zen.Dimension.prototype.setUDH = function(active, triggerChangedEvent) {
		var loInternalDimension = this.getInternalObject();
		var ltUDHDimensions;
		var loUDH;
		var loQueryModel;
		var loDataSourceChangeCause;
		if (oFF.isNull(loInternalDimension)) {
			return;
		}
		if (!this.isUDHSupported()) {
			return;
		}
		ltUDHDimensions = null;
		loUDH = sap.zen.Dimension.sGetUDHObject(loInternalDimension);
		ltUDHDimensions = oFF.XListOfString.create();
		if ((oFF.notNull(loUDH) && loUDH.isActive()) && active === false) {
			ltUDHDimensions.addAll(loUDH.getDimensionNames());
		} else {
			ltUDHDimensions.add(loInternalDimension.getName());
		}
		loQueryModel = loInternalDimension.getQueryModel();
		loQueryModel.getUniversalDisplayHierarchies().setHierarchy(
				ltUDHDimensions, 1, active);
		if (triggerChangedEvent) {
			loDataSourceChangeCause = new sap.zen.DataSourceChangeCause();
			loDataSourceChangeCause
					.setAction(sap.zen.CDataSourceChangeAction.SetUDH);
			loDataSourceChangeCause.addProperties(this
					.getActionObjectProperties());
			loDataSourceChangeCause.addProperty("Active", oFF.XBoolean
					.convertToString(active));
			this.getDataSource().raiseDataSourceChangedEvent(
					loDataSourceChangeCause, false, true);
		}
	};
