	sap.zen.Dimension.prototype.setUDHDrilledToDimension = function(
			dimensionName, triggerChangedEvent) {
		var loInternalDimension = this.getInternalObject();
		var lDrillLevel;
		var loUDH;
		var ltUDHDimensions;
		var lDimensionIndex;
		var loUDHDimensionIterator;
		var lDimensionName;
		if (oFF.isNull(loInternalDimension)) {
			return false;
		}
		if (!this.isUDHSupported()) {
			return false;
		}
		lDrillLevel = 0;
		loUDH = sap.zen.Dimension.sGetUDHObject(loInternalDimension);
		ltUDHDimensions = loUDH.getDimensionNames();
		if (oFF.notNull(ltUDHDimensions) && !ltUDHDimensions.isEmpty()) {
			lDimensionIndex = 0;
			loUDHDimensionIterator = ltUDHDimensions.getIterator();
			while (loUDHDimensionIterator.hasNext()) {
				lDimensionName = loUDHDimensionIterator.next();
				if (oFF.XString.isEqual(dimensionName, lDimensionName)) {
					lDrillLevel = lDimensionIndex + 1;
				}
				lDimensionIndex++;
			}
		}
		return this.setUDHDrillLevel(lDrillLevel, triggerChangedEvent);
	};
