	sap.zen.Dimension.prototype.getHierarchies = function() {
		var loInternalDimension = this.getInternalObject();
		var loDataSource;
		var loQueryManager;
		var loQueryModel;
		var ltHierarchies;
		var loSystemDescription;
		var loServiceConfiguration;
		var loResultCatalogManagerCreation;
		var loHierarchyCatalogManager;
		var loResult;
		var loHierarchyCatalog;
		if (oFF.isNull(loInternalDimension)) {
			return null;
		}
		loDataSource = this.getDataSource();
		if (oFF.isNull(loDataSource)) {
			return null;
		}
		loQueryManager = loDataSource.getQueryManager();
		if (oFF.isNull(loQueryManager)) {
			return null;
		}
		loQueryModel = loQueryManager.getQueryModel();
		if (oFF.isNull(loQueryModel)) {
			return null;
		}
		ltHierarchies = oFF.XList.create();
		if (this.isStructure()) {
			return ltHierarchies;
		}
		loSystemDescription = loQueryManager.getSystemDescription();
		if (oFF.HierarchyCatalogUtil
				.supportsHierarchyCatalog(loSystemDescription) === false) {
			return ltHierarchies;
		}
		loServiceConfiguration = oFF.OlapApiModule.SERVICE_TYPE_HIERARCHY_CATALOG
				.createServiceConfig(loQueryManager.getApplication());
		loServiceConfiguration.setSystemName(loSystemDescription.getName());
		loServiceConfiguration.setDimension(loInternalDimension);
		if (sap.zen.DataSourceScriptApiUtils.isHanaSystem(loDataSource)) {
			loServiceConfiguration.setDataSourceName(loQueryModel
					.getDataSource().getFullQualifiedName());
		}
		loResultCatalogManagerCreation = loServiceConfiguration
				.processHierarchyCatalogManagerCreation(oFF.SyncType.BLOCKING,
						null, null);
		if (loResultCatalogManagerCreation.hasErrors()) {
			return ltHierarchies;
		}
		loHierarchyCatalogManager = loResultCatalogManagerCreation.getData();
		loHierarchyCatalogManager.setFilterHierarchyDate(loQueryModel
				.getDueDate(), true);
		loResult = loHierarchyCatalogManager.processGetResult(
				oFF.SyncType.BLOCKING, null, null);
		if (loResult.hasErrors()) {
			return ltHierarchies;
		}
		loHierarchyCatalog = loResult.getData();
		ltHierarchies = oFF.HierarchyCatalogUtil
				.getHierarchyItems(loHierarchyCatalog);
		return ltHierarchies;
	};
	sap.zen.Dimension.prototype.getHierarchyObjectName = function(oHierarchy) {
		var loDueDate;
		var lVersion;
		var lName;
		var lHierarchyName;
		if (oFF.isNull(oHierarchy)) {
			return null;
		}
		loDueDate = oHierarchy.getDateTo();
		if (oFF.isNull(loDueDate)) {
			loDueDate = oFF.XDate.createDateWithValues(9999, 12, 31);
		}
		lVersion = oHierarchy.getVersionName();
		if (oFF.isNull(lVersion)) {
			lVersion = "";
		}
		lName = oHierarchy.getHierarchyName();
		if (oFF.XString.containsString(lName, "/")) {
			lName = oFF.XString.replace(lName, "/", "\\\\\\\\/");
		}
		lHierarchyName = lName;
		if (oFF.XStringUtils.isNotNullAndNotEmpty(lVersion)
				|| oFF.notNull(loDueDate)) {
			lHierarchyName = oFF.XStringUtils.concatenate3(lHierarchyName, "/",
					lVersion);
		}
		if (oFF.notNull(loDueDate)) {
			lHierarchyName = oFF.XStringUtils.concatenate3(lHierarchyName, "/",
					loDueDate.toIsoFormat());
		}
		return lHierarchyName;
	};
