	sap.zen.PageObject.convertXXmlNodeToJson = function(oXmlNode) {
		var lJsonString = null;
		var loPrElement = sap.zen.PageObject
				.convertXXmlNodeToPrElement(oXmlNode);
		if (oFF.notNull(loPrElement)) {
			lJsonString = oFF.PrUtils.serialize(loPrElement, false, false, 0);
		}
		return lJsonString;
	};
	sap.zen.PageObject.convertXXmlNodeToPrElement = function(oXmlNode) {
		var loJsonElement;
		var lPropertyName;
		var lPropertyValue;
		var ltChildNodes;
		var loJsonStructure;
		var lItemIndex;
		var loChildNode;
		var lChildPropertyName;
		var loChildJsonElement;
		if (oFF.isNull(oXmlNode)) {
			return null;
		}
		loJsonElement = null;
		lPropertyName = oXmlNode.getAttribute("name");
		lPropertyValue = oXmlNode.getAttribute("value");
		ltChildNodes = oXmlNode.getAllChildren();
		if (ltChildNodes.size() > 0) {
			loJsonStructure = oFF.PrStructure.create();
			for (lItemIndex = 0; lItemIndex < ltChildNodes.size(); lItemIndex++) {
				loChildNode = ltChildNodes.get(lItemIndex);
				if (oFF.isNull(loChildNode)) {
					continue;
				}
				lChildPropertyName = loChildNode.getAttribute("name");
				loChildJsonElement = sap.zen.PageObject
						.convertXXmlNodeToPrElement(loChildNode);
				if (oFF.notNull(loChildJsonElement)) {
					loJsonStructure.put(lChildPropertyName, loChildJsonElement);
				}
			}
			loJsonElement = loJsonStructure;
		} else {
			if (oFF.isNull(lPropertyValue)) {
				loJsonElement = oFF.PrStructure.create();
			} else {
				loJsonElement = oFF.PrString.createWithValue(lPropertyValue);
			}
		}
		return loJsonElement;
	};
