	sap.zen.PageObject.prototype.setProperty = function(name, value, asCData) {
		var loParent;
		var loPage;
		var lOldValue;
		var loPropertyNode;
		var loValueNode;
		var lValueChanged;
		if (oFF.isNull(this.oInitParameters)) {
			throw oFF.XException
					.createIllegalStateException("Initparameters are null");
		}
		loParent = this.getParent();
		loPage = this.getPage();
		lOldValue = null;
		loPropertyNode = this.getPropertyNode(name);
		if (oFF.notNull(loPropertyNode)) {
			if (asCData === true) {
				loValueNode = loPropertyNode.getFirstChild("value");
				if (oFF.notNull(loValueNode)) {
					lOldValue = loValueNode.getText();
				}
			} else {
				lOldValue = loPropertyNode.getAttribute("value");
			}
		} else {
			lOldValue = this.getDefaultProperty(name);
		}
		if (oFF.XString.isEqual("VISIBLE", name)
				|| oFF.XString.isEqual("ENABLED", name)
				|| oFF.XString.isEqual("ICONFIRST", name)
				|| oFF.XString.isEqual("DESIGNER_VISIBLE", name)) {
			lValueChanged = false;
			if (oFF.notNull(lOldValue)) {
				if (!oFF.XString.isEqual(value, lOldValue)) {
					lValueChanged = true;
				}
			} else {
				if (oFF.XString.isEqual("false", value)) {
					lValueChanged = true;
				}
			}
			if (!lValueChanged) {
				return;
			}
			if (!oFF.XString.isEqual("ENABLED", name)) {
				loParent = this.getParent();
				if (oFF.notNull(loParent)) {
					loParent.setContentChanged(true);
				}
			} else {
				this.setContentChanged(true);
			}
		}
		if (oFF.notNull(lOldValue)) {
			if (oFF.XString.isEqual(lOldValue, value)) {
				return;
			}
		}
		if (asCData === true) {
			this.oInitParameters.setProperty(name, value, true);
		} else {
			this.oInitParameters.setProperty(name, value, false);
		}
		if (!sap.zen.PageObject.positionParameterNameSet.containsKey(name)) {
			this.setOnlyPositionParameterChanged(false);
			if (this.doesParameterChangeContent(name)) {
				this.setContentChanged(true);
			}
		} else {
			if (!this.isContentChanged() && !this.hasChildrenContentChanged()) {
				this.setOnlyPositionParameterChanged(true);
			} else {
				this.setOnlyPositionParameterChanged(false);
				this.setContentChanged(true);
			}
			loParent = this.getParent();
			if (oFF.notNull(loParent)) {
				loParent.setChildrenContentChanged();
				if (oFF.notNull(loPage)) {
					loPage.setContentChanged(true);
				}
			}
		}
	};
