	sap.zen.PageObject.prototype.getPropertyNode = function(name) {
		var loParameterNode = null;
		var ltChildNodes;
		var lChildNodeIndex;
		var lname;
		if (oFF.notNull(this.tPropertyCache)) {
			loParameterNode = this.tPropertyCache.getByKey(name);
			if (oFF.notNull(loParameterNode)) {
				return loParameterNode;
			}
		}
		if (oFF.notNull(this.oInitParameters)) {
			ltChildNodes = this.oInitParameters.getChildren("property");
			for (lChildNodeIndex = 0; lChildNodeIndex < ltChildNodes.size(); lChildNodeIndex++) {
				loParameterNode = ltChildNodes.get(lChildNodeIndex);
				if (oFF.isNull(loParameterNode)) {
					continue;
				}
				lname = loParameterNode.getAttribute("name");
				if (oFF.XString.isEqual(name, lname)) {
					this.tPropertyCache.put(name, loParameterNode);
					return loParameterNode;
				}
			}
		}
		return null;
	};
	sap.zen.PageObject.prototype.getProperty = function(name) {
		var s;
		var loPropertyNode;
		var lValue;
		var loValueNode;
		if (oFF.isNull(this.oInitParameters)) {
			s = '<bi:component name="';
			s = oFF.XStringUtils.concatenate2(s, this.getName());
			s = oFF.XStringUtils.concatenate2(s, '" type="');
			s = oFF.XStringUtils.concatenate2(s, this.getType());
			s = oFF.XStringUtils.concatenate2(s, '"/>');
			this.oInitParameters = sap.buddha.XXmlUtils.getRootNode(s);
		}
		loPropertyNode = this.getPropertyNode(name);
		if (oFF.notNull(loPropertyNode)) {
			lValue = loPropertyNode.getAttribute("value");
			if (oFF.isNull(lValue)) {
				loValueNode = loPropertyNode.getFirstChild("value");
				if (oFF.notNull(loValueNode)) {
					return loValueNode.getText();
				}
			}
			return lValue;
		}
		return null;
	};
