	sap.zen.PageObject.prototype.makeBooleanPropertyWithDefault = function(
			value, defaultValue) {
		var loPage;
		if (oFF.isNull(value)) {
			return defaultValue;
		}
		if (oFF.XString.size(value) === 0) {
			return false;
		}
		if (oFF.XString.size(value) === 1) {
			if (oFF.XString.isEqual(value, "x")
					|| oFF.XString.isEqual(value, "X")) {
				return true;
			}
			return false;
		}
		if (oFF.XString.isEqual(value, "true")) {
			return true;
		}
		if (oFF.XString.isEqual(value, "false")) {
			return false;
		}
		loPage = this.getPage();
		if (oFF.notNull(loPage)) {
			loPage.addScriptExecutionMessage();
		}
		return defaultValue;
	};
