	sap.zen.PageObject.prototype.setObjectProperty = function(name, object) {
		var lJsonString = this.getPage().getWindow().stringifyJSON(object);
		var loPrElement = oFF.JsonParserFactory.createFromString(lJsonString);
		var loXmlNode = this.oInitParameters.getFirstChildWithNameTag(name);
		this.applyPrElementToXXmlNode(loPrElement, loXmlNode);
		this.setContentChanged(true);
	};
	sap.zen.PageObject.prototype.applyPrElementToXXmlNode = function(oElement,
			oPropertyNode) {
		var loJsonElementType;
		var loJsonStructure;
		var ltStructureElements;
		var lValue;
		var lStructureIndex;
		var lStructureElement;
		var loJsonElement;
		var loChildNode;
		var lPrString;
		if (oFF.isNull(oElement) || oFF.isNull(oPropertyNode)) {
			return;
		}
		loJsonElementType = oElement.getType();
		if (loJsonElementType === oFF.PrElementType.STRUCTURE) {
			loJsonStructure = oElement;
			ltStructureElements = loJsonStructure
					.getKeysAsReadOnlyListOfString();
			lValue = loJsonStructure.getStringByKey("__value__");
			if (oFF.notNull(lValue)) {
				oPropertyNode.setAttribute("value", lValue);
			}
			for (lStructureIndex = 0; lStructureIndex < ltStructureElements
					.size(); lStructureIndex++) {
				lStructureElement = ltStructureElements.get(lStructureIndex);
				if (oFF.isNull(lStructureElement)) {
					continue;
				}
				loJsonElement = loJsonStructure.getByKey(lStructureElement);
				loChildNode = oPropertyNode
						.getFirstChildWithNameTag(lStructureElement);
				if (oFF.isNull(loChildNode)) {
					loChildNode = oPropertyNode
							.createChildWithNameTag(lStructureElement);
				}
				this.applyPrElementToXXmlNode(loJsonElement, loChildNode);
			}
		} else {
			if (loJsonElementType === oFF.PrElementType.STRING) {
				lPrString = oElement;
				oPropertyNode.setAttribute("value", lPrString.getString());
			} else {
				oPropertyNode.setAttribute("value", oElement.toString());
			}
		}
	};
