	sap.zen.PageObject.prototype.createUniquePageObjectId = function(
			pageObjectType) {
		var ltComponentNames = this.getPage().getComponents();
		var lcComponent = "_COMPONENT";
		var lIndex;
		var lComponentNameIndex;
		var lIdWeUse;
		var lExists;
		if (oFF.XString.endsWith(pageObjectType, lcComponent)) {
			pageObjectType = oFF.XString.substring(pageObjectType, 0,
					oFF.XString.size(pageObjectType)
							- oFF.XString.size(lcComponent));
		}
		lIndex = 1;
		for (lComponentNameIndex = 0; lComponentNameIndex < ltComponentNames
				.size(); lComponentNameIndex++) {
			lIndex = lIndex + 1;
			lIdWeUse = oFF.XStringUtils.concatenate3(pageObjectType, "_",
					oFF.XInteger.convertToString(lIndex));
			lExists = ltComponentNames.containsKey(lIdWeUse);
			if (!lExists) {
				return lIdWeUse;
			}
		}
		return oFF.XStringUtils.concatenate3(pageObjectType, "_", oFF.XInteger
				.convertToString(lIndex));
	};
