	sap.zen.ZenMessageManager.prototype.createMessageForCategory = function(
			messageCategory, oMessage) {
		var loLogging;
		var lSeverity;
		if (oFF.isNull(oMessage)) {
			return;
		}
		loLogging = this.oPage.getLogging();
		if (oFF.notNull(loLogging)
				&& loLogging.isLoggable(sap.buddha.XLogging.XDEBUG)) {
			lSeverity = oMessage.getSeverity();
			if (oFF.Severity.ERROR === lSeverity) {
				loLogging.error(oMessage.getText(), oMessage.toString(),
						"message");
			} else {
				if (oFF.Severity.INFO === lSeverity) {
					loLogging.info(oMessage.getText(), oMessage.toString(),
							"message");
				} else {
					if (oFF.Severity.SEMANTICAL_ERROR === lSeverity) {
						loLogging.fatal(oMessage.getText(),
								oMessage.toString(), "message");
					} else {
						if (oFF.Severity.WARNING === lSeverity) {
							loLogging.warning(oMessage.getText(), oMessage
									.toString(), "message");
						}
					}
				}
			}
		}
		if (this.shouldSuppress(oMessage)) {
			return;
		}
		if (oFF.isNull(messageCategory)) {
			messageCategory = sap.zen.CMessageCategory.DEFAULT;
		}
		oMessage.setExtendendInfo(messageCategory);
		if (oFF.isNull(this.tMessages)) {
			this.tMessages = oFF.XList.create();
		}
		this.tMessages.add(oMessage);
		this.notifyListeners();
	};
	sap.zen.ZenMessageManager.prototype.createMessagesFromCollectionForCategory = function(
			messageCategory, oMessageCollection) {
		var ltMessages;
		var lMessageIndex;
		if (oFF.isNull(oMessageCollection)) {
			return;
		}
		ltMessages = null;
		lMessageIndex = 0;
		ltMessages = oMessageCollection.getSemanticalErrors();
		for (lMessageIndex = 0; lMessageIndex < ltMessages.size(); lMessageIndex++) {
			this.createMessageForCategory(messageCategory, ltMessages
					.get(lMessageIndex));
		}
		ltMessages = oMessageCollection.getErrors();
		for (lMessageIndex = 0; lMessageIndex < ltMessages.size(); lMessageIndex++) {
			this.createMessageForCategory(messageCategory, ltMessages
					.get(lMessageIndex));
		}
		ltMessages = oMessageCollection.getWarnings();
		for (lMessageIndex = 0; lMessageIndex < ltMessages.size(); lMessageIndex++) {
			this.createMessageForCategory(messageCategory, ltMessages
					.get(lMessageIndex));
		}
		ltMessages = oMessageCollection.getInfos();
		for (lMessageIndex = 0; lMessageIndex < ltMessages.size(); lMessageIndex++) {
			this.createMessageForCategory(messageCategory, ltMessages
					.get(lMessageIndex));
		}
	};
