	sap.zen.ZenMessageManager.prototype.removeNoValuesSetForMandatoryVariableMessages = function() {
		var lMessageRemoved = false;
		var lMessageIndex;
		var loMessage;
		if (oFF.notNull(this.tMessages)) {
			for (lMessageIndex = 0; lMessageIndex < this.tMessages.size(); lMessageIndex++) {
				loMessage = this.tMessages.get(lMessageIndex);
				if (oFF.isNull(loMessage)) {
					continue;
				}
				if (((loMessage.getCode() === 42522) && (loMessage
						.getExtendedInfo() === null))
						|| (loMessage.getCode() === 629)
						|| ((loMessage.getCode() === 0) && (oFF.XString
								.isEqual(loMessage.getText(),
										"Error when setting variable structure")))) {
					this.tMessages.removeAt(lMessageIndex);
					lMessageRemoved = true;
					lMessageIndex--;
				}
			}
			if (this.tMessages.size() === 0) {
				this.tMessages = null;
			}
		}
		if (lMessageRemoved) {
			this.notifyListeners();
		}
		return lMessageRemoved;
	};
