	sap.zen.XpDSItemCell.prototype.getValueForFilter = function(formatted) {
		var loDimension;
		var loVariable;
		var loInternalVariable;
		var lUseKey;
		var lValueType;
		var ltSelopts;
		var lValueTypeFilter;
		var lValue;
		if (this.getDataSourceItem() !== sap.zen.CXpDSItem.VARIABLES
				&& this.getDataSourceItem() !== sap.zen.CXpDSItem.FILTERS) {
			return null;
		}
		loDimension = null;
		loVariable = null;
		loInternalVariable = null;
		if (this.getDataSourceItem() === sap.zen.CXpDSItem.VARIABLES) {
			loVariable = this.oContentProvider;
			loInternalVariable = this.oInternalVariable;
			loDimension = this.oDimension;
		}
		if (this.getDataSourceItem() === sap.zen.CXpDSItem.FILTERS) {
			loDimension = this.oContentProvider;
		}
		if (this.getColumnIndex() > 0) {
			lUseKey = false;
			lValueType = sap.zen.Dimension.VALUE_TYPE_EXT;
			ltSelopts = this.getFilterValues();
			if (!this.isSeloptSingular(ltSelopts)) {
				lValueType = sap.zen.Dimension.VALUE_TYPE_EXT
						+ sap.zen.Dimension.VALUE_TYPE_TEXT;
			} else {
				if (!formatted) {
					lValueTypeFilter = this.getValueType();
					if (lValueTypeFilter.isTypeOf(oFF.XValueType.DATE)
							|| lValueTypeFilter.isTypeOf(oFF.XValueType.TIME)
							|| lValueTypeFilter
									.isTypeOf(oFF.XValueType.DATE_TIME)) {
						lUseKey = true;
					}
				}
			}
			lValue = "";
			if (lUseKey) {
				if (oFF.notNull(ltSelopts) && ltSelopts.size() > 0) {
					lValue = ltSelopts.get(0).getFrom().getKey();
				}
			} else {
				lValue = sap.zen.Dimension.sGetValuesFromRangeList(ltSelopts,
						lValueType);
			}
			return lValue;
		}
		if (this.getDataSourceItem() === sap.zen.CXpDSItem.VARIABLES) {
			if (oFF.notNull(loInternalVariable)) {
				if (loInternalVariable.getText() !== null) {
					return loInternalVariable.getText();
				}
				return loInternalVariable.getName();
			}
		}
		if (this.getDataSourceItem() === sap.zen.CXpDSItem.FILTERS) {
			if (oFF.notNull(loDimension)) {
				return loDimension.getFilterHeaderText();
			}
		}
		return null;
	};
	sap.zen.XpDSItemCell.prototype.getValueTypeForTechInfo = function() {
		var lTechInfo;
		if (this.getDataSourceItem() !== sap.zen.CXpDSItem.TECHNICAL_INFORMATION) {
			return null;
		}
		if (this.getColumnIndex() > 0) {
			lTechInfo = this.oContentProvider;
			if (lTechInfo.containsAny(sap.zen.CXpDSTechInfo.CREATED_ON)
					|| lTechInfo.containsAny(sap.zen.CXpDSTechInfo.CHANGED_ON)
					|| lTechInfo
							.containsAny(sap.zen.CXpDSTechInfo.REFRESHED_ON)
					|| lTechInfo
							.containsAny(sap.zen.CXpDSTechInfo.LAST_DATA_UPDATE)) {
				return oFF.XValueType.DATE_TIME;
			}
		}
		return null;
	};
	sap.zen.XpDSItemCell.prototype.getValueTypeForFilter = function() {
		var loDimension;
		var loVariable;
		var loInternalVariable;
		var loDimensionMemberVariable;
		var loInternalDimension;
		if (this.getDataSourceItem() !== sap.zen.CXpDSItem.VARIABLES
				&& this.getDataSourceItem() !== sap.zen.CXpDSItem.FILTERS) {
			return null;
		}
		loDimension = null;
		loVariable = null;
		loInternalVariable = null;
		if (this.getDataSourceItem() === sap.zen.CXpDSItem.VARIABLES) {
			loVariable = this.oContentProvider;
			loInternalVariable = this.oInternalVariable;
			loDimension = this.oDimension;
		}
		if (this.getDataSourceItem() === sap.zen.CXpDSItem.FILTERS) {
			loDimension = this.oContentProvider;
		}
		if (this.getColumnIndex() > 0) {
			if (this.isSeloptSingular(this.getFilterValues())) {
				if (this.getDataSourceItem() === sap.zen.CXpDSItem.VARIABLES) {
					if (oFF.notNull(loInternalVariable)) {
						if (loInternalVariable.getVariableType() === oFF.VariableType.DIMENSION_MEMBER_VARIABLE) {
							loDimensionMemberVariable = loInternalVariable;
							loInternalDimension = loDimensionMemberVariable
									.getDimension();
							if (oFF.XStringUtils
									.isNullOrEmpty(loDimensionMemberVariable
											.getHierarchyName())
									&& oFF.XStringUtils
											.isNullOrEmpty(loInternalDimension
													.getHierarchyName())) {
								return loDimensionMemberVariable.getDimension()
										.getFlatKeyField().getValueType();
							}
							return loDimensionMemberVariable.getDimension()
									.getHierarchyKeyField().getValueType();
						}
						return loInternalVariable.getValueType();
					}
				}
				if (this.getDataSourceItem() === sap.zen.CXpDSItem.FILTERS) {
					if (oFF.notNull(loDimension)) {
						return loDimension.getValueType();
					}
				}
			}
		}
		return null;
	};
	sap.zen.XpDSItemCell.prototype.getFormatStringForTechInfo = function() {
		var loDataSourceInfo;
		var lInfo;
		var lTechInfo;
		if (this.getDataSourceItem() !== sap.zen.CXpDSItem.TECHNICAL_INFORMATION) {
			return null;
		}
		if (this.getColumnIndex() > 0) {
			loDataSourceInfo = this.getDataSource().getInfo();
			lInfo = null;
			lTechInfo = this.oContentProvider;
			if (lTechInfo.containsAny(sap.zen.CXpDSTechInfo.QUERY_NAME)) {
				lInfo = loDataSourceInfo.queryTechnicalName;
			} else {
				if (lTechInfo
						.containsAny(sap.zen.CXpDSTechInfo.INFOPROVIDER_NAME)) {
					lInfo = loDataSourceInfo.infoProviderTechnicalName;
				}
			}
			if (oFF.XStringUtils.isNotNullAndNotEmpty(lInfo)) {
				return oFF.XStringUtils.concatenate3('@ "(', lInfo, ')"');
			}
			if (lTechInfo.containsAny(sap.zen.CXpDSTechInfo.QUERY_DESCRIPTION)) {
				lInfo = loDataSourceInfo.queryTechnicalName;
			} else {
				if (lTechInfo
						.containsAny(sap.zen.CXpDSTechInfo.INFOPROVIDER_DESCRIPTION)) {
					lInfo = loDataSourceInfo.infoProviderTechnicalName;
				}
			}
			if (oFF.XStringUtils.isNotNullAndNotEmpty(lInfo)) {
				return oFF.XStringUtils.concatenate3('@ "[', lInfo, ']"');
			}
		}
		return null;
	};
	sap.zen.XpDSItemCell.prototype.getFormatStringForFilter = function() {
		var ltSelopts;
		var lExternal;
		var lText;
		if (this.getDataSourceItem() !== sap.zen.CXpDSItem.VARIABLES
				&& this.getDataSourceItem() !== sap.zen.CXpDSItem.FILTERS) {
			return null;
		}
		if (this.getColumnIndex() > 0) {
			ltSelopts = this.getFilterValues();
			if (this.isSeloptSingular(ltSelopts)) {
				lExternal = sap.zen.Dimension.sGetValuesFromRangeList(
						ltSelopts, sap.zen.Dimension.VALUE_TYPE_EXT);
				lText = sap.zen.Dimension.sGetValuesFromRangeList(ltSelopts,
						sap.zen.Dimension.VALUE_TYPE_TEXT);
				if (this.getValueType().isString()
						&& !oFF.XString.isEqual(lExternal, lText)) {
					return oFF.XStringUtils.concatenate3('@ "(', lText, ')"');
				}
			}
		}
		return null;
	};
	sap.zen.XpDSItemCell.prototype.getFilterValues = function() {
		if (this.getDataSourceItem() !== sap.zen.CXpDSItem.VARIABLES
				&& this.getDataSourceItem() !== sap.zen.CXpDSItem.FILTERS) {
			return null;
		}
		if (this.getDataSourceItem() === sap.zen.CXpDSItem.VARIABLES) {
			return this.oContentProvider.getAllSelections();
		}
		if (this.getDataSourceItem() === sap.zen.CXpDSItem.FILTERS) {
			return this.oContentProvider.getFilterValues();
		}
		return null;
	};
	sap.zen.XpDSItemCell.prototype.isSeloptSingular = function(tSelopts) {
		var loSelopt;
		if (tSelopts.size() === 1) {
			loSelopt = tSelopts.get(0);
			if (loSelopt.getOperation() === sap.zen.Operation.EQ
					&& !loSelopt.isExclude()) {
				return true;
			}
		}
		return false;
	};
