	sap.zen.HierarchyVariableWrapper.prototype.oInternalHierarchyNameVariable = null;
	sap.zen.HierarchyVariableWrapper.prototype.initMe3 = function(oDataSource,
			oInternalVariable, memberDisplay) {
		this.oInternalHierarchyNameVariable = oInternalVariable;
		sap.zen.CharacteristicMemberVariableWrapper.prototype.initMe2.call(
				this, oDataSource, oInternalVariable, memberDisplay);
		oFF.XHashMapOfStringByString.create();
	};
	sap.zen.HierarchyVariableWrapper.prototype.getMemberType = function() {
		return sap.zen.Type.HIERARCHY;
	};
	sap.zen.HierarchyVariableWrapper.prototype.hasSelectionState = function() {
		var loDimensionMember = this.oInternalHierarchyNameVariable
				.getDimensionMember();
		return oFF.notNull(loDimensionMember)
				&& oFF.XStringUtils.isNotNullAndNotEmpty(loDimensionMember
						.getString());
	};
	sap.zen.HierarchyVariableWrapper.prototype.getSelectionStateMembers = function() {
		var ltMemberWrapper = oFF.XList.create();
		var loDimensionMember = this.oInternalHierarchyNameVariable
				.getDimensionMember();
		var lDimensionMemberStringValue;
		var loMemberWrapper;
		if (oFF.notNull(loDimensionMember)) {
			lDimensionMemberStringValue = loDimensionMember.getString();
			if (oFF.XStringUtils
					.isNotNullAndNotEmpty(lDimensionMemberStringValue)) {
				loMemberWrapper = new sap.zen.HierarchyObjectWrapper();
				loMemberWrapper.initMe(lDimensionMemberStringValue,
						loDimensionMember.getText());
				ltMemberWrapper.add(loMemberWrapper);
			}
		}
		return ltMemberWrapper;
	};
	sap.zen.HierarchyVariableWrapper.prototype.resetQuery = function() {
		this.oInternalHierarchyNameVariable.getMemberFilter().clear();
	};
	sap.zen.HierarchyVariableWrapper.prototype.setInternalKey = function(key) {
		this.oInternalHierarchyNameVariable.setValueByString(key);
		return true;
	};
	sap.zen.HierarchyVariableWrapper.prototype.getInternalKey = function() {
		var loDimensionMember = this.oInternalHierarchyNameVariable
				.getDimensionMember();
		if (oFF.isNull(loDimensionMember)) {
			return "";
		}
		return loDimensionMember.getString();
	};
	sap.zen.HierarchyVariableWrapper.prototype.getAllSelections = function() {
		var ltRanges = sap.zen.CharacteristicMemberVariableWrapper.prototype.getAllSelections
				.call(this);
		if (oFF.notNull(ltRanges)
				&& ltRanges.size() === 1
				&& (oFF.XStringUtils.isNullOrEmpty(ltRanges.get(0).getKey()) || oFF.XString
						.isEqual("-", ltRanges.get(0).getKey()))) {
			return oFF.XList.create();
		}
		return ltRanges;
	};
