	sap.zen.DataSource.prototype.initDimensions = function(reset, bookmark) {
		var loQueryModel = this.getQueryManager().getQueryModel();
		var ltDimensions;
		var loDimensionIterator;
		var loDimension;
		var loInternalMeasureDimension;
		var ltInternalDimensionMembers;
		var loInternalDimensionMemberIterator;
		var loInternalDimensionMember;
		var lDummy;
		var loProperties;
		var lMemberDisplay;
		if (oFF.isNull(loQueryModel)) {
			return;
		}
		if (reset) {
			sap.zen.Dimension.sReleaseDimensions(this);
		}
		ltDimensions = this.getAllDimensions();
		if (this.isHanaSystem()) {
			loQueryModel
					.convertToFieldLayoutType(oFF.FieldLayoutType.FIELD_BASED);
		}
		if (oFF.notNull(ltDimensions) && !ltDimensions.isEmpty()) {
			loDimensionIterator = ltDimensions.getIterator();
			while (loDimensionIterator.hasNext()) {
				loDimension = loDimensionIterator.next();
				if (oFF.isNull(loDimension)) {
					continue;
				}
				if (loDimension.isMeasureStructure()) {
					loInternalMeasureDimension = loQueryModel
							.getMeasureDimension();
					ltInternalDimensionMembers = loInternalMeasureDimension
							.getAllStructureMembers();
					loInternalDimensionMemberIterator = ltInternalDimensionMembers
							.getIterator();
					while (loInternalDimensionMemberIterator.hasNext()) {
						loInternalDimensionMember = loInternalDimensionMemberIterator
								.next();
						if (oFF.isNull(loInternalDimensionMember)) {
							continue;
						}
						if (loInternalDimensionMember.getResultVisibility() !== oFF.ResultVisibility.VISIBLE) {
							try {
								loInternalDimensionMember
										.setResultVisibility(oFF.ResultVisibility.VISIBLE);
							} catch (loException) {
								lDummy = true;
							}
						}
					}
				}
				loProperties = loDimension.getProperties();
				if (oFF.notNull(loProperties)) {
					if (bookmark) {
						if (oFF.XStringUtils.isNotNullAndNotEmpty(loProperties
								.getHierarchyDueDate())) {
							loProperties.setHierarchyDueDate("99991231", false);
						}
					}
					lMemberDisplay = loProperties.getMemberDisplayMode(null);
					loProperties.setMemberDisplay(null, lMemberDisplay, null,
							false);
				}
			}
		}
	};
	sap.zen.DataSource.prototype.initNavigationInformation = function() {
		var ltDimensions;
		var loDimensionIterator;
		var loDimension;
		var lInternalName;
		var lExternalName;
		var ltDimensionNames;
		this.tNavigationSemanticSources.clear();
		this.tNavigationMapIntToExt.clear();
		this.tNavigationMapExtToInt.clear();
		ltDimensions = this.getAllDimensions();
		if (oFF.notNull(ltDimensions) && !ltDimensions.isEmpty()) {
			loDimensionIterator = ltDimensions.getIterator();
			while (loDimensionIterator.hasNext()) {
				loDimension = loDimensionIterator.next();
				if (oFF.isNull(loDimension)) {
					continue;
				}
				lInternalName = loDimension.getName();
				lExternalName = loDimension.getExternalName();
				if (oFF.XStringUtils.isNullOrEmpty(lExternalName)) {
					continue;
				}
				this.tNavigationSemanticSources.add(lExternalName);
				ltDimensionNames = null;
				if (this.tNavigationMapExtToInt.containsKey(lExternalName)) {
					ltDimensionNames = this.tNavigationMapExtToInt
							.getByKey(lExternalName);
				} else {
					ltDimensionNames = oFF.XHashSetOfString.create();
					this.tNavigationMapExtToInt.put(lExternalName,
							ltDimensionNames);
				}
				ltDimensionNames.add(lInternalName);
				this.tNavigationMapIntToExt.put(lInternalName, lExternalName);
			}
		}
	};
