	sap.zen.DataSource.prototype.getFullqualifiedName = function(name,
			setViewAndPackage, dataSourceType) {
		var lSystemName;
		if (oFF.isNull(name)) {
			if (setViewAndPackage) {
				this.packageName = null;
			}
			return null;
		}
		lSystemName = this.getTemplateDataSourceConnectionSystemName(null);
		if (!this.getPage().isBWSystem(lSystemName)) {
			name = this.getHanaViewSpec(name, setViewAndPackage);
		} else {
			if (oFF.XString.isEqual(dataSourceType, "INFOPROVIDER")) {
				name = oFF.XStringUtils.concatenate3("infoprovider:[", name,
						"]");
			} else {
				if (oFF.XString.isEqual(dataSourceType, "QUERY")) {
					name = oFF.XStringUtils.concatenate3("query:[", name, "]");
				} else {
					if (oFF.XString.isEqual(dataSourceType, "VIEW")) {
						name = oFF.XStringUtils.concatenate3("view:[", name,
								"]");
					}
				}
			}
			if (setViewAndPackage) {
				this.packageName = "";
			}
		}
		return name;
	};
	sap.zen.DataSource.prototype.getHanaViewSpec = function(name,
			setViewAndPackage) {
		var splitString = oFF.XStringTokenizer.splitString(name, "/");
		var cnt = splitString.size();
		var hanaViewName = "";
		var schemaName = null;
		var type = null;
		var packagePos = 0;
		var pos = 0;
		var packageName;
		var viewName;
		if (cnt > 2) {
			type = splitString.get(0);
			schemaName = splitString.get(1);
			packagePos = 2;
			hanaViewName = oFF.XStringUtils.concatenate2(type, ":");
			hanaViewName = oFF.XStringUtils.concatenate4(hanaViewName, "[",
					schemaName, "]");
			pos = oFF.XString.indexOf(name, "/");
			name = oFF.XString.substring(name, pos + 1, -1);
			pos = oFF.XString.indexOf(name, "/");
			name = oFF.XString.substring(name, pos + 1, -1);
		} else {
			hanaViewName = "view:";
		}
		packageName = splitString.get(packagePos);
		hanaViewName = oFF.XStringUtils.concatenate3(hanaViewName, "[",
				packageName);
		if (setViewAndPackage) {
			this.packageName = packageName;
		}
		hanaViewName = oFF.XStringUtils.concatenate2(hanaViewName, "][");
		pos = oFF.XString.indexOf(name, "/");
		viewName = oFF.XString.substring(name, pos + 1, -1);
		hanaViewName = oFF.XStringUtils.concatenate2(hanaViewName, viewName);
		hanaViewName = oFF.XStringUtils.concatenate2(hanaViewName, "]");
		return hanaViewName;
	};
	sap.zen.DataSource.prototype.getHanaViewSpec2 = function(name,
			setViewAndPackage) {
		var splitString = oFF.XStringTokenizer.splitString(name, "/");
		var packageName = splitString.get(0);
		var viewName;
		name = oFF.XStringUtils.concatenate2("view:[][", packageName);
		if (setViewAndPackage) {
			this.packageName = packageName;
		}
		name = oFF.XStringUtils.concatenate2(name, "][");
		viewName = "";
		viewName = splitString.get(1);
		name = oFF.XStringUtils.concatenate2(name, viewName);
		name = oFF.XStringUtils.concatenate2(name, "]");
		return name;
	};
	sap.zen.DataSource.prototype.getDataCell = function(measure, oJsonObject) {
		var ltJson = oJsonObject.getJSON();
		var loQueryManager = this.getQueryManager();
		var loResultSet;
		var loMessages;
		var lDataRows;
		var lDataCols;
		var lUseCol;
		var lUseRow;
		var loResultDataCell;
		if (oFF.isNull(loQueryManager)) {
			return null;
		}
		sap.zen.DataSourceScriptApiUtils.logGetResultSet(this.getPage(),
				loQueryManager, "DataSource getDataCell");
		loResultSet = this.getResultSet();
		if (oFF.isNull(loResultSet) || !loResultSet.isValid()) {
			loMessages = loQueryManager.getResultSetMessages();
			this.getPage().createMessagesFromCollection(loMessages);
			return null;
		}
		lDataRows = loResultSet.getAmountOfDataRows();
		lDataCols = loResultSet.getAmountOfDataColumns();
		lUseCol = this.getCorrectPositionOnAxis(measure, ltJson,
				oFF.AxisType.COLUMNS, lDataCols);
		lUseRow = this.getCorrectPositionOnAxis(measure, ltJson,
				oFF.AxisType.ROWS, lDataRows);
		if (lUseCol === -1 || lUseRow === -1) {
			sap.zen.CLocalizationDataSourceMessages.CELL_NOT_FOUND
					.addMessageToMessageHandler(this.getPage(),
							oFF.Severity.INFO, null, null, null);
			return null;
		}
		loResultDataCell = loResultSet.getResultDataCell(lUseRow, lUseCol);
		return loResultDataCell;
	};
	sap.zen.DataSource.prototype.getCorrectPositionOnAxis = function(
			measureName, tJson, axisType, cntRows) {
		var loResultSet = this.getResultSet();
		var loResultSetInfo = null;
		var j = 0;
		var lUseRow = -1;
		var loTuple;
		var q;
		var itAllFits;
		var numberOfFits;
		var underspecified;
		var resultWasFound;
		var loTupleElement;
		var loDimensionMember;
		var loDimension;
		var memberName;
		var cnt;
		var timesItShouldHaveBeenFound;
		for (j = 0; j < (cntRows); j++) {
			if (loResultSet.getAmountOfTuplesOnAxis(axisType) > 0) {
				loResultSetInfo = sap.zen.ResultSetHelper.create(loResultSet,
						axisType, j, 0);
				loTuple = loResultSetInfo.getTuple();
				q = 0;
				itAllFits = true;
				numberOfFits = 0;
				underspecified = false;
				resultWasFound = false;
				while (q < loTuple.getAmountOfTupleElements()) {
					loTupleElement = loTuple.getTupleElement(q, null);
					loDimensionMember = loTupleElement.getDimensionMember();
					loDimension = loTupleElement.getDimension();
					if (loDimension.isMeasureStructure()) {
						if (!oFF.XString.isEqual(loDimensionMember.getName(),
								measureName)) {
							itAllFits = false;
						} else {
							if (loTuple.getAmountOfTupleElements() === 1) {
								return j;
							}
						}
					} else {
						memberName = tJson.getByKey(loDimension.getName());
						cnt = loResultSet
								.getAmountOfTuplesOnAxis(loResultSetInfo
										.getAxis());
						if (tJson.size() < cnt) {
							underspecified = true;
							if (tJson.containsKey(loDimension.getName())
									&& oFF.XString.isEqual(memberName,
											loDimensionMember.getName())) {
								numberOfFits = numberOfFits + 1;
							} else {
								if ((loResultSetInfo.isTotal() || loDimensionMember
										.isTotal())) {
									resultWasFound = true;
								} else {
									itAllFits = false;
									resultWasFound = false;
								}
							}
						} else {
							if (tJson.containsKey(loDimension.getName())
									&& oFF.XString.isEqual(memberName,
											loDimensionMember.getName())) {
								numberOfFits = numberOfFits + 1;
							} else {
								itAllFits = false;
							}
						}
					}
					q = q + 1;
				}
				timesItShouldHaveBeenFound = tJson.size();
				if (!underspecified && itAllFits) {
					lUseRow = j;
					break;
				} else {
					if (underspecified && itAllFits
							&& numberOfFits === timesItShouldHaveBeenFound) {
						lUseRow = j;
						break;
					}
				}
			} else {
				return 0;
			}
		}
		return lUseRow;
	};
	sap.zen.DataSource.prototype.getDataAsString = function(measureName, json) {
		var lFormattedValue = "";
		var loResultDataCell = this.getDataInternal(measureName, json);
		var lValueException;
		var lDouble;
		if (oFF.notNull(loResultDataCell)) {
			lFormattedValue = loResultDataCell.getFormattedValue();
			lValueException = loResultDataCell.getValueException();
			if (oFF.isNull(lValueException)
					|| lValueException === oFF.ValueException.NORMAL) {
				lFormattedValue = loResultDataCell.getFormattedValue();
				lDouble = 0;
				if (oFF.XString.startsWith(lFormattedValue, ".")
						|| oFF.XString.startsWith(lFormattedValue, ",")) {
					lDouble = loResultDataCell.getDoubleValue();
					lFormattedValue = sap.buddha.XMathZen.roundDouble(lDouble);
				} else {
					if (oFF.XString.isEqual("0", lFormattedValue)) {
						lDouble = loResultDataCell.getDoubleValue();
						lFormattedValue = oFF.XDoubleValue.create(lDouble)
								.toString();
					}
				}
			}
		}
		return lFormattedValue;
	};
