		lMessage = oFF.XStringUtils.concatenate2(lMessage, " for member ");
		lMessage = oFF.XStringUtils.concatenate2(lMessage, memberName);
		lMessage = oFF.XStringUtils.concatenate2(lMessage, " with value ");
		lMessage = oFF.XStringUtils.concatenate2(lMessage, value);
