	sap.zen.DataSource.prototype.setMeasureFilter = function(oMeasureDimension,
			oObject) {
		var lValue = null;
		var loJsonObject = sap.buddha.XJsonObject.create(oObject);
		var ltStructureMembers;
		var ltWriteableStructureMembers;
		var loStructureMember;
		var loJsonArray;
		var lJsonArraySize;
		var lIndex;
		var loJsonArrayObject;
		if (loJsonObject.isString() || loJsonObject.isScriptableMember()) {
			lValue = loJsonObject.getString();
			ltStructureMembers = oMeasureDimension.getAllStructureMembers();
			ltWriteableStructureMembers = ltStructureMembers;
			loStructureMember = ltWriteableStructureMembers.getByKey(lValue);
			if (oFF.notNull(loStructureMember)) {
				ltWriteableStructureMembers.clear();
				ltWriteableStructureMembers.add(loStructureMember);
			}
		} else {
			if (loJsonObject.isArray()) {
				loJsonArray = loJsonObject.getArray();
				lJsonArraySize = loJsonArray.size();
				for (lIndex = 0; lIndex < lJsonArraySize; lIndex++) {
					loJsonArrayObject = loJsonArray.get(lIndex);
					if (oFF.isNull(loJsonArrayObject)) {
						continue;
					}
					lValue = loJsonArrayObject.getString();
				}
			}
		}
	};
