	sap.zen.DataSource.prototype.expandNode = function(dimensionName,
			memberKeyOrMemberOrJSON) {
		var loJsonObject = sap.buddha.XJsonObject
				.create(memberKeyOrMemberOrJSON);
		var loDimension = sap.zen.Dimension.sGetDimension(this, dimensionName);
		var lMemberName = null;
		var loJsonArray;
		var lJsonArraySize;
		var lArrayIndex;
		var loJsonArrayObject;
		if (loJsonObject.isString()) {
			lMemberName = loJsonObject.getString();
			sap.zen.DataSourceScriptApiUtils.logGetResultSet(this.getPage(),
					this.getQueryManager(), "DataSource expandNode");
			loDimension.expandCollapseHierarchyNode(lMemberName,
					oFF.DrillState.EXPANDED, true);
		} else {
			if (loJsonObject.isArray()) {
				loJsonArray = loJsonObject.getArray();
				lJsonArraySize = loJsonArray.size();
				for (lArrayIndex = 0; lArrayIndex < lJsonArraySize; lArrayIndex++) {
					loJsonArrayObject = loJsonArray.get(lArrayIndex);
					if (oFF.isNull(loJsonArrayObject)) {
						continue;
					}
					lMemberName = loJsonArrayObject.getString();
				}
			}
		}
	};
