	sap.zen.DataSource.prototype.setTotalsPosition = function(axis,
			totalsPosition) {
		var loQueryManager = this.getQueryManager();
		var loQueryModel;
		var loAxis;
		if (oFF.isNull(loQueryManager)) {
			return;
		}
		loQueryModel = loQueryManager.getQueryModel();
		if (oFF.isNull(loQueryModel)) {
			return;
		}
		loAxis = sap.zen.DataSourceScriptApiUtils.getAxis(loQueryModel, axis);
		if (oFF.isNull(loAxis)) {
			return;
		}
		sap.zen.Dimension.sSetTotalsPositionForAxis(this, loAxis.getType(),
				totalsPosition, true);
	};
	sap.zen.DataSource.prototype.getTotalsPosition = function(axis) {
		var loQueryManager = this.getQueryManager();
		var loQueryModel;
		var loAxis;
		var lResultAlignment;
		if (oFF.isNull(loQueryManager)) {
			return null;
		}
		loQueryModel = loQueryManager.getQueryModel();
		if (oFF.isNull(loQueryModel)) {
			return null;
		}
		loAxis = sap.zen.DataSourceScriptApiUtils.getAxis(loQueryModel, axis);
		if (oFF.isNull(loAxis)) {
			return null;
		}
		lResultAlignment = sap.zen.Dimension.sGetTotalsPositionForAxis(this,
				loAxis.getType());
		if (oFF.ResultAlignment.TOP.isEqualTo(lResultAlignment)) {
			return sap.zen.TotalsPosition.getBEFOREInternal();
		} else {
			if (oFF.ResultAlignment.BOTTOM.isEqualTo(lResultAlignment)) {
				return sap.zen.TotalsPosition.getAFTERInternal();
			} else {
				if (oFF.ResultAlignment.NONE.isEqualTo(lResultAlignment)) {
					return sap.zen.TotalsPosition.getDEFAULTInternal();
				}
			}
		}
		return sap.zen.TotalsPosition.getDEFAULTInternal();
	};
	sap.zen.DataSource.prototype.setFilterByRectangle = function(dimension, x0,
			y0, x1, y1) {
		var loQueryModel;
		var agg;
		var loJsonFixedFilter;
		var loJsonSelection;
		var loJsonOperand;
		var s;
		this.getQueryManager().invalidateState();
		loQueryModel = this.getQueryManager().getQueryModel();
		agg = oFF.PrStructure.create();
		loJsonFixedFilter = agg.putNewStructure("FixedFilter");
		loJsonSelection = loJsonFixedFilter.putNewStructure("Selection");
		loJsonOperand = loJsonSelection.putNewStructure("GeometryOperand");
		s = oFF.XStringUtils.concatenate3(oFF.XDouble.convertToString(y0), " ",
				oFF.XDouble.convertToString(x0));
		s = oFF.XStringUtils.concatenate2(s, ", ");
		s = oFF.XStringUtils.concatenate4(s, oFF.XDouble.convertToString(y0),
				" ", oFF.XDouble.convertToString(x1));
		s = oFF.XStringUtils.concatenate2(s, ", ");
		s = oFF.XStringUtils.concatenate4(s, oFF.XDouble.convertToString(y1),
				" ", oFF.XDouble.convertToString(x1));
		s = oFF.XStringUtils.concatenate2(s, ", ");
		s = oFF.XStringUtils.concatenate4(s, oFF.XDouble.convertToString(y1),
				" ", oFF.XDouble.convertToString(x0));
		s = oFF.XStringUtils.concatenate2(s, ", ");
		s = oFF.XStringUtils.concatenate4(s, oFF.XDouble.convertToString(y0),
				" ", oFF.XDouble.convertToString(x0));
		loJsonOperand.putString("Comparison", "WITHIN");
		loJsonOperand.putString("AttributeName", dimension);
		loJsonOperand.putString("Value", oFF.XStringUtils.concatenate3(
				"POLYGON(( ", s, "))"));
		loQueryModel.setProtocolExtension(agg, false);
		this.raiseDataSourceChangedEvent(null, false, true);
	};
