	sap.zen.Component.prototype.renderOnlyPlaceholder = function(renderManager) {
		var renderSerializer = renderManager.getRenderSerializer();
		renderSerializer.openTag("component");
		renderSerializer.addAttribute("id", this.getPage().getIdForRendering(
				this.getId()));
		renderSerializer.addAttribute("type", this.getType());
		renderSerializer.closeTag();
	};
	sap.zen.Component.prototype.renderComponentInternal = function(
			renderManager) {
		if (!this.isVisible() && !this.renderEvenIfNotVisible()) {
			this.resetStateFlags();
			return;
		}
		if (!this.shouldRender()) {
			this.resetStateFlags();
			return;
		}
		if (this.isContentChanged()) {
			this.renderComponentPropertiesAndContent(renderManager,
					renderManager.getRenderSerializer());
		} else {
			if (this.hasChildrenContentChanged()) {
				this.renderChildren(renderManager);
			} else {
				if (this.isOnlyPositionParameterChanged()) {
					this.renderComponentAndCommonAttributes(renderManager
							.getRenderSerializer(), true);
				} else {
					if (this.isRenderOnlyPlaceholder()) {
						this.renderOnlyPlaceholder(renderManager);
					}
				}
			}
		}
		this.resetStateFlags();
	};
	sap.zen.Component.prototype.shouldRender = function() {
		return true;
	};
	sap.zen.Component.prototype.renderComponentPropertiesAndContent = function(
			renderManager, renderSerializer) {
		this.renderComponentAndCommonAttributes(renderSerializer, false);
		renderSerializer.openTag("content");
		this.renderContentInternal(renderManager);
		renderSerializer.closeTag();
		renderSerializer.closeTag();
	};
	sap.zen.Component.prototype.renderComponentAndCommonAttributes = function(
			renderSerializer, renderCloseTag) {
		var showLoadingStateFlag;
		var loadingText;
		renderSerializer.openTag("component");
		renderSerializer.addAttribute("id", this.getPage().getIdForRendering(
				this.getId()));
		renderSerializer.addAttribute("type", this.getType());
		if (!this.ignorePositionParameter()) {
			if (this.getWidthAsString() !== null) {
				renderSerializer.addAttribute("width", this.getWidthAsString());
			}
			if (this.getHeightAsString() !== null) {
				renderSerializer.addAttribute("height", this
						.getHeightAsString());
			}
			if (this.getLeftMarginAsString() !== null) {
				renderSerializer.addAttribute("leftmargin", this
						.getLeftMarginAsString());
			}
			if (this.getRightMarginAsString() !== null) {
				renderSerializer.addAttribute("rightmargin", this
						.getRightMarginAsString());
			}
			if (this.getTopMarginAsString() !== null) {
				renderSerializer.addAttribute("topmargin", this
						.getTopMarginAsString());
			}
			if (this.getBottomMarginAsString() !== null) {
				renderSerializer.addAttribute("bottommargin", this
						.getBottomMarginAsString());
			}
			if (this.isRenderCssAndShowLoadingState()) {
				if (this.getStringPropertyWithDefault("CSS_CLASS", "") !== null) {
					renderSerializer.addAttribute("cssclass", this
							.getStringPropertyWithDefault("CSS_CLASS", ""));
				}
				showLoadingStateFlag = this.getBooleanPropertyWithDefault(
						"SHOW_LOADING_STATE", false);
				renderSerializer.addBooleanAttribute("showLoadingState",
						showLoadingStateFlag);
				if (showLoadingStateFlag) {
					loadingText = this.getStringPropertyWithDefault(
							"SHOW_LOADING_STATE_TEXT", null);
					if (oFF.notNull(loadingText)) {
						renderSerializer.addAttribute("showLoadingStateText",
								loadingText);
					}
				}
			}
			if (this.getPage().isDesignMode()) {
				renderSerializer.addBooleanAttribute("visible", this
						.isVisible());
			}
			this.writeItemMessage(renderSerializer, this.getItemMessage());
		}
		if (renderCloseTag === true) {
			renderSerializer.closeTag();
		}
	};
