	sap.zen.Component.prototype.writeItemMessage = function(renderSerializer,
			itemMessage) {
		var messageType;
		var typeAsString;
		var text;
		if (oFF.notNull(itemMessage)) {
			renderSerializer.openTag("message");
			messageType = itemMessage.getMessageType();
			if (oFF.notNull(messageType)) {
				typeAsString = messageType.getType();
				renderSerializer.addAttribute("type", typeAsString);
			}
			text = itemMessage.getMessage();
			renderSerializer.addText(text);
			renderSerializer.closeTag();
		}
	};
