	sap.zen.Component.prototype.applyInitParameters = function(initParameter) {
		var oldInitParameters = this.getInitParameters();
		var allChildren = oldInitParameters.getAllChildren();
		var i;
		var xmlNode;
		var nodeName;
		var newChildren;
		var j;
		var newChild;
		for (i = 0; i < allChildren.size(); i++) {
			xmlNode = allChildren.get(i);
			nodeName = xmlNode.getNodeName();
			if (!oFF.XString.isEqual(nodeName, "bi:component")) {
				oldInitParameters.removeChild(xmlNode);
			}
		}
		newChildren = initParameter.getAllChildren();
		for (j = 0; j < newChildren.size(); j++) {
			newChild = newChildren.get(j);
			oldInitParameters.appendChild(newChild);
		}
		this.setContentChanged(true);
		this.clearPropertyCache();
	};
	sap.zen.Component.prototype.applyGlobalVariableInitParameters = function(
			initParameter) {
		var oldInitParameters = this.getInitParameters();
		var oldInitParametersChildren = this.getInitParameters()
				.getAllChildren();
		var i;
		var xmlNode;
		var newInitParametersChildren;
		var j;
		var newChild;
		for (i = 0; i < oldInitParametersChildren.size(); i++) {
			xmlNode = oldInitParametersChildren.get(i);
			if (oFF.XString.isEqual(xmlNode.getNodeName(), "bi:property")) {
				if (oFF.XString.isEqual(xmlNode.getAttribute("name"),
						"GLOBALVARIABLES")) {
					oldInitParameters.removeChild(xmlNode);
				}
			}
		}
		newInitParametersChildren = initParameter.getAllChildren();
		for (j = 0; j < newInitParametersChildren.size(); j++) {
			newChild = newInitParametersChildren.get(j);
			if (oFF.XString.isEqual(newChild.getNodeName(), "bi:property")) {
				if (oFF.XString.isEqual(newChild.getAttribute("name"),
						"GLOBALVARIABLES")) {
					oldInitParameters.appendChild(newChild);
				}
			}
		}
		this.setContentChanged(true);
		this.clearPropertyCache();
	};
	sap.zen.Component.prototype.moveToParent = function(parent) {
		var lParent = this.getParent();
		var lParentContainer;
		if (oFF.notNull(lParent)) {
			lParentContainer = lParent;
			lParentContainer.removeChild(this);
		}
		parent.addChild(this);
		this.setParent(parent);
	};
