	sap.zen.Page.sGetDshUrlParameters = function(oParameters) {
		var ltUrlParams = oFF.XListOfString.create();
		var loParameterValueAsString;
		var loParameterValue;
		var loList;
		var lListIndex;
		var loElement;
		var ltKnownUrlParams;
		ltUrlParams.add("appName");
		ltUrlParams.add("sap-ushell-defaultedParameterNames");
		if (oFF.notNull(oParameters)) {
			loParameterValueAsString = oParameters
					.getByKey("sap-ushell-defaultedParameterNames");
			if (oFF.notNull(loParameterValueAsString)) {
				loParameterValue = sap.zen.Page
						.sConvertJsonStringToJsonObject(loParameterValueAsString
								.asString().getString());
				if (oFF.notNull(loParameterValue) && loParameterValue.isList()) {
					loList = loParameterValue.asList();
					for (lListIndex = 0; lListIndex < loList.size(); lListIndex++) {
						loElement = loList.get(lListIndex);
						if (oFF.isNull(loElement)) {
							continue;
						}
						if (loElement.isString()) {
							if (!ltUrlParams.contains(loElement.asString()
									.getString())) {
								ltUrlParams.add(loElement.asString()
										.getString());
							}
						}
					}
				}
			}
		}
		ltKnownUrlParams = sap.zen.CUrlParam.sGetUrlParams();
		ltUrlParams.addAll(ltKnownUrlParams);
		return ltUrlParams;
	};
