		ltDataSourceNodes = this.oRootNode.getChildren("data_source_alias");
		ltComponentNodes = this.oRootNode.getChildren("component");
		loComponentNodeIterator = ltComponentNodes.getIterator();
		loInitParametersNode = null;
		while (loComponentNodeIterator.hasNext()) {
			loInitParametersNode = loComponentNodeIterator.next();
			lComponentType = this.getComponentType(loInitParametersNode);
			if (oFF.XString.isEqual(lComponentType, "APPLICATION_PROPERTIES")) {
				loComponent = this.createComponentObject(loInitParametersNode,
						null);
				break;
			}
		}
		loApplicationProperties = this.getApplicationPropertiesComponent();
		lPromptMode = loApplicationProperties.getPromptMode();
