		ltNavigationParameterRules = this
				.extractNavigationParameterRules(ltParameters);
		loApplicationProperties.addGlobalVariables(this.oWindow, ltParameters);
		this.asynchronousEnabled = true;
		this.dataSourceInitializeMode = this.isAsynchronousEnabled();
