	sap.zen.Page.prototype.triggerAsynchronousRefreshResultSets = function(
			initial) {
		var ltDataSources;
		var lRender;
		var lDataSourceIndex;
		var loDataSource;
		var loResponse;
		if (!this.isAsynchronousEnabled()) {
			return;
		}
		ltDataSources = null;
		if (this.optimizeDSRequests === true) {
			ltDataSources = this.getUsedDataSourcesByDummyRendering();
		} else {
			ltDataSources = this.getDataSources();
		}
		lRender = true;
		this.numberOfStartedRefreshes = 0;
		if (oFF.notNull(ltDataSources)) {
			this.numberOfStartedRefreshes = ltDataSources.size();
			for (lDataSourceIndex = 0; lDataSourceIndex < ltDataSources.size(); lDataSourceIndex++) {
				loDataSource = ltDataSources.get(lDataSourceIndex);
				if (oFF.isNull(loDataSource)
						|| loDataSource.getQueryManager() === null) {
					this.numberOfStartedRefreshes--;
					continue;
				}
				loResponse = loDataSource.triggerRefresh(this,
						oFF.XBooleanValue.create(loDataSource.getResultSet()
								.isValid()));
				if (oFF.notNull(loResponse) && loResponse.actionWasPerformed()) {
					if (!loResponse.hasErrors()) {
						if (ltDataSources.size() === 1
								&& !this.asyncResultSetAlreadyFetched) {
							this.oWindow.increaseLock();
						} else {
							lRender = false;
						}
					} else {
						this.numberOfStartedRefreshes--;
					}
					this.asyncResultSetAlreadyFetched = true;
				} else {
					this.numberOfStartedRefreshes--;
				}
			}
		}
		if (lRender) {
			this.rerender();
		}
	};
	sap.zen.Page.prototype.handleDataSourceAfterRefresh = function(oContext,
			oResponse, oBaggage) {
		var lWasValidResultSet;
		this.numberOfStartedRefreshes--;
		lWasValidResultSet = oBaggage;
		if (lWasValidResultSet.getBoolean() === false) {
			sap.zen.DataSourceChangeCause.NO_REFRESH_REQUIRED
					.setAction(sap.zen.CDataSourceChangeAction.AsyncResultSet);
			oContext.raiseDataSourceChangedEvent(
					sap.zen.DataSourceChangeCause.NO_REFRESH_REQUIRED, false,
					true);
		}
		if (this.numberOfStartedRefreshes === 0) {
			this.rerender();
		}
	};
