	sap.zen.Page.prototype.render = function() {
		var loStringBuffer;
		var loRenderManager;
		var lClientServerMode;
		var loRenderSerializer;
		var lIsInterComponentDragDropDAllowed;
		var lInitial;
		var i;
		var lScript;
		if (!this.oRootComponent.isInFillManadatoryVariablesMode()) {
			this.callOnresultsetChangedScripts();
		}
		loStringBuffer = null;
		loRenderManager = new sap.zen.RenderManager();
		lClientServerMode = this.isClientServerMode();
		if (lClientServerMode) {
			loStringBuffer = oFF.XStringBuffer.create();
			loRenderManager.setStringBuffer(loStringBuffer);
		}
		loRenderManager.createRenderSerializer();
		loRenderSerializer = loRenderManager.getRenderSerializer();
		loRenderSerializer.openTag("content");
		if (oFF.notNull(this.pageId)) {
			loRenderSerializer.addAttribute("pageId", this.pageId);
		}
		lIsInterComponentDragDropDAllowed = this
				.getApplicationPropertiesComponent()
				.isInterComponentDragDropEnabled();
		if (lIsInterComponentDragDropDAllowed) {
			loRenderSerializer.addBooleanAttribute(
					"bInterComponentDragDropEnabled",
					lIsInterComponentDragDropDAllowed);
		}
		loRenderSerializer.openTag("pageContent");
		lInitial = this.initial || this.inBackToStartMode;
		if (!lInitial) {
			loRenderSerializer.openArray("delta");
		}
		this.oRootComponent.renderComponentInternal(loRenderManager);
		if (!lInitial) {
			loRenderSerializer.closeArray();
		}
		loRenderSerializer.closeTag();
		if ((oFF.notNull(this.tAddtionalRequiredJavaScripts))
				&& (this.tAddtionalRequiredJavaScripts.size() > 0)) {
			loRenderSerializer.openArray("addtionalRequiredJavaScripts");
			for (i = 0; i < this.tAddtionalRequiredJavaScripts.size(); i++) {
				lScript = this.tAddtionalRequiredJavaScripts.get(i);
				if (oFF.isNull(lScript)) {
					continue;
				}
				loRenderSerializer.addSimpleValueToArray(lScript);
			}
			loRenderSerializer.closeArray();
		}
		this.writeNewRequiredModules(loRenderSerializer);
		loRenderSerializer.closeTag();
		this.setContentChanged(false);
		this.initial = false;
		if (lClientServerMode) {
			if (oFF.notNull(loStringBuffer)) {
				this.json = loStringBuffer.toString();
			}
		} else {
			this.jsonObj = loRenderSerializer.getRenderedObject();
		}
		this.renderStep++;
	};
