	sap.zen.Page.prototype.getUrlComponent = function(percentage) {
		var result;
		var indexOf = oFF.XString.indexOf(percentage, ".");
		var substring = oFF.XString.substring(percentage, 0, indexOf);
		var value;
		substring = oFF.XString.replace(substring, ",", "");
		value = oFF.XInteger.convertFromString(substring);
		if (value < -70) {
			result = "m4";
		} else {
			if (value < -40) {
				result = "m3";
			} else {
				if (value < -20) {
					result = "m2";
				} else {
					if (value < -10) {
						result = "m1";
					} else {
						if (value > 70) {
							result = "p4";
						} else {
							if (value > 40) {
								result = "p3";
							} else {
								if (value > 20) {
									result = "p2";
								} else {
									if (value > 10) {
										result = "p1";
									} else {
										result = "p0";
									}
								}
							}
						}
					}
				}
			}
		}
		return result;
	};
