		var componentParamString;
		var originParamString;
		var positionParamString1;
		var positionParamString2;
		var containerParam;
		var componentParam;
		var originParam;
		var positionParam1;
		var positionParam2;
		var left;
		var top;
		var loContainerComponent;
		var loOriginComponent;
		var initParameters;
		var originInitParameters;
		var componentType;
		var uid;
		var smartlayoutControl;
		var smartlayoutControlOriginal;
		var paramString1;
		var paramString2;
		var param1;
		var param2;
		var parent;
		var changeOrientation;
		var testComp;
		var component;
		var component2;
		url = oFF.XString.substring(url, oFF.XString.size("zen://drop?"), -1);
		strings = oFF.XStringTokenizer.splitString(url, "&");
		containerParamString = strings.get(0);
