		originParamString = strings.get(2);
		positionParamString1 = strings.get(3);
		positionParamString2 = strings.get(4);
		containerParam = oFF.XStringTokenizer.splitString(containerParamString,
				"=");
		componentParam = oFF.XStringTokenizer.splitString(componentParamString,
				"=");
		originParam = oFF.XStringTokenizer.splitString(originParamString, "=");
		positionParam1 = oFF.XStringTokenizer.splitString(positionParamString1,
				"=");
		positionParam2 = oFF.XStringTokenizer.splitString(positionParamString2,
				"=");
		left = positionParam1.get(1);
		top = positionParam2.get(1);
		loContainerComponent = this.getComponent(containerParam.get(1));
		loOriginComponent = this.getComponent(originParam.get(1));
		initParameters = loOriginComponent.getInitParameters();
		originInitParameters = initParameters.cloneNode(true);
		componentType = componentParam.get(1);
		uid = oFF.XStringUtils.concatenate2(componentType, oFF.XInteger
				.convertToString(this.newComponentIdIndex));
		originInitParameters.setAttribute("name", uid);
		this.newComponentIdIndex++;
		if (loContainerComponent.isSmartLayout()) {
			smartlayoutControl = loContainerComponent;
			smartlayoutControlOriginal = loContainerComponent;
			paramString1 = strings.get(5);
			paramString2 = strings.get(6);
			param1 = oFF.XStringTokenizer.splitString(paramString1, "=");
			param2 = oFF.XStringTokenizer.splitString(paramString2, "=");
			parent = smartlayoutControl.getParent();
			changeOrientation = true;
			testComp = smartlayoutControl;
			if (parent.isSmartLayout()) {
				testComp = parent;
			}
			if (((oFF.XString.isEqual(param1.get(1), "top") || oFF.XString
					.isEqual(param1.get(1), "bottom")) && (oFF.XString.isEqual(
					testComp.getOrientation(), "VERTICAL")))
					|| (((oFF.XString.isEqual(param1.get(1), "right") || oFF.XString
							.isEqual(param1.get(1), "left")) && (oFF.XString
							.isEqual(testComp.getOrientation(), "HORIZONTAL"))))) {
				changeOrientation = false;
			}
			if (parent.isSmartLayout() && !changeOrientation) {
				smartlayoutControl = parent;
			}
			component = this.createComponentObject(originInitParameters,
					smartlayoutControl);
			if (oFF.XString.isEqual(param1.get(1), "top")) {
				smartlayoutControl.setOrientation("VERTICAL");
				smartlayoutControl.addTop(component, changeOrientation,
						smartlayoutControlOriginal);
			} else {
				if (oFF.XString.isEqual(param1.get(1), "bottom")) {
					smartlayoutControl.setOrientation("VERTICAL");
					smartlayoutControl.addBottom(component, changeOrientation,
							smartlayoutControlOriginal);
				} else {
					if (oFF.XString.isEqual(param1.get(1), "right")) {
						smartlayoutControl.setOrientation("HORIZONTAL");
						smartlayoutControl.addRight(component,
								changeOrientation, smartlayoutControlOriginal);
					} else {
						if (oFF.XString.isEqual(param1.get(1), "left")) {
							smartlayoutControl.setOrientation("HORIZONTAL");
							smartlayoutControl.addLeft(component,
									changeOrientation,
									smartlayoutControlOriginal);
						} else {
							loContainerComponent.addChild(component);
						}
					}
				}
			}
			component.setLeftMarginAsString("0");
			component.setTopMarginAsString("0");
			component.setRightMarginAsString("0");
			component.setBottomMarginAsString("0");
			component.setWidthAsString("auto");
			component.setHeightAsString("auto");
		} else {
			component2 = this.createComponentObject(originInitParameters,
					loContainerComponent);
			component2.setLeftMarginAsString(left);
			component2.setTopMarginAsString(top);
			loContainerComponent.addChild(component2);
		}
