	sap.zen.Page.prototype.setVariableValueRange = function(variableName,
			variableValueLow, variableValueHigh) {
		var ltDataSources = this.getDataSources();
		var loDataSourceIterator;
		var loDataSource;
		var loVariableProcessor;
		if (oFF.isNull(ltDataSources) || ltDataSources.isEmpty()) {
			return;
		}
		loDataSourceIterator = ltDataSources.getIterator();
		while (loDataSourceIterator.hasNext()) {
			loDataSource = loDataSourceIterator.next();
			if (oFF.isNull(loDataSource)) {
				continue;
			}
			loVariableProcessor = loDataSource.getVariableProcessor();
			if (oFF.notNull(loVariableProcessor)) {
				sap.zen.DataSourceScriptApiUtils.setVariableValueRange(
						loDataSource, variableName, variableValueLow,
						variableValueHigh,
						!this.inVarSubmitOrBackgroundProcessingScript);
				loDataSource.raiseDataSourceChangedEvent(null, true, false);
				if (this.inVarSubmitOrBackgroundProcessingScript) {
					this.addVariableProcessorInQueue(loDataSource);
				}
			}
		}
		this.invalidateDataSourcesReasonVariablesChange();
	};
	sap.zen.Page.prototype.setVariableValueFromFilterArray = function(
			variableName, variableValue, displayKey) {
		var ltDataSources = this.getDataSources();
		var lValuesWereApplied;
		var loDataSourceIterator;
		var loDataSource;
		var lValuesAppliedLocally;
		if (oFF.isNull(ltDataSources) || ltDataSources.isEmpty()) {
			return false;
		}
		lValuesWereApplied = true;
		loDataSourceIterator = ltDataSources.getIterator();
		while (loDataSourceIterator.hasNext()) {
			loDataSource = loDataSourceIterator.next();
			if (oFF.isNull(loDataSource)) {
				continue;
			}
			if (sap.zen.VariablesUtils.getInputEnabledVariable_DataSource(
					loDataSource, variableName) !== null) {
				lValuesAppliedLocally = sap.zen.DataSourceScriptApiUtils
						.setVariableValue(loDataSource, variableName,
								variableValue, displayKey);
				if (lValuesAppliedLocally) {
					loDataSource.raiseDataSourceChangedEvent(null, true, false);
					if (this.inVarSubmitOrBackgroundProcessingScript) {
						this.addVariableProcessorInQueue(loDataSource);
					}
				} else {
					lValuesWereApplied = false;
				}
			} else {
				lValuesWereApplied = false;
			}
		}
		this.invalidateDataSourcesReasonVariablesChange();
		return lValuesWereApplied;
	};
