	sap.zen.Page.prototype.getQueriesAsList = function(systemName,
			searchString, planningModels) {
		var ltMembers = oFF.XList.create();
		var loSystemDescription;
		var loBackendServices;
		var loOlapCatalogManager;
		var ltQueries;
		var loQueryIterator;
		var loQuery;
		var lDataSourceName;
		var lText;
		var lQueryType;
		var lSchemaName;
		var lPackageName;
		var loMember;
		var loScriptableArray;
		if ((oFF.XString.size(systemName) === 0) || (this.isHanaMode())) {
			systemName = "self";
		}
		loSystemDescription = this.getApplication().getSystemLandscape()
				.getSystemDescription(systemName);
		loBackendServices = new sap.zen.ZBackendServices();
		loBackendServices.setSystem(loSystemDescription);
		loOlapCatalogManager = loBackendServices.create(this);
		if (!oFF.XString.endsWith(searchString, "*")) {
			searchString = oFF.XStringUtils.concatenate2(searchString, "*");
		}
		ltQueries = loBackendServices.getQueries(loOlapCatalogManager,
				searchString, this, planningModels);
		loQueryIterator = ltQueries.getObjectsIterator();
		while (loQueryIterator.hasNext()) {
			loQuery = loQueryIterator.next();
			lDataSourceName = "";
			lText = "";
			if (loBackendServices.ishanaSystem()) {
				lQueryType = loQuery.getType();
				lSchemaName = loQuery.getSchemaName();
				lPackageName = loQuery.getPackageName();
				lDataSourceName = loQuery.getName();
				lText = oFF.XStringUtils.concatenate3("[",
						lQueryType.getName(), "]");
				lText = oFF.XStringUtils.concatenate4(lText, "[", lSchemaName,
						"]");
				lText = oFF.XStringUtils.concatenate4(lText, "[", lPackageName,
						"]");
				lText = oFF.XStringUtils.concatenate4(lText, "[",
						lDataSourceName, "]");
				lDataSourceName = oFF.XStringUtils.concatenate5(lQueryType
						.getName(), "/", lSchemaName, "/", lPackageName);
				lDataSourceName = oFF.XStringUtils.concatenate3(
						lDataSourceName, "/", loQuery.getName());
			} else {
				lDataSourceName = loQuery.getName();
				lText = loQuery.getName();
			}
			loMember = sap.zen.Member.create(lDataSourceName, lText);
			ltMembers.add(loMember);
		}
		loScriptableArray = this.getWindow().createJSArray(ltMembers);
		return loScriptableArray;
	};
