	sap.zen.Page.prototype.doExport = function(exportType, exportVersion) {
		var loDataSourceIterator;
		var loDataSource;
		var loResultSet;
		var ltContent;
		var loContent;
		var ltAxisPaging;
		var loAxisPaging;
		var lcPropertyPagingMode;
		var lcPropertyOffset;
		var ltAxisProperties;
		var ltAxesProperties;
		var ltResultSetPagingInfo;
		var lAxisPagingIndex;
		var loResultSetPagingInfoIterator;
		var loAxisIterator;
		var lAxisType;
		var lPagingMode;
		var lOffset;
		if (!oFF.XString.isEqual(exportType, sap.zen.ExportType.EXCEL_xlsx)) {
			sap.zen.CLocalizationCommandResolverMessages.PAGE_UNSUPPORTED_EXPORT
					.addMessageToMessageHandler(this, oFF.Severity.ERROR,
							exportType, null, null);
			return;
		}
		loDataSourceIterator = this.getDataSources().getIterator();
		loDataSource = null;
		loResultSet = null;
		ltContent = oFF.XList.create();
		loContent = null;
		ltAxisPaging = null;
		loAxisPaging = null;
		lcPropertyPagingMode = "PAGING_MODE";
		lcPropertyOffset = "OFFSET";
		ltAxisProperties = oFF.XHashMapByString.create();
		ltAxesProperties = oFF.XSimpleMap.create();
		ltResultSetPagingInfo = oFF.XSimpleMap.create();
		while (loDataSourceIterator.hasNext()) {
			loDataSource = loDataSourceIterator.next();
			if (oFF.isNull(loDataSource)) {
				continue;
			}
			loResultSet = loDataSource.getResultSet();
			ltAxisPaging = loResultSet.getServerPaging().getAxesPaging();
			ltAxesProperties.clear();
			for (lAxisPagingIndex = 0; lAxisPagingIndex < ltAxisPaging.size(); lAxisPagingIndex++) {
				loAxisPaging = ltAxisPaging.get(lAxisPagingIndex);
				if (oFF.isNull(loAxisPaging)) {
					continue;
				}
				ltAxisProperties.clear();
				ltAxisProperties.put(lcPropertyPagingMode, oFF.XIntegerValue
						.create(loAxisPaging.getPagingMode()));
				ltAxisProperties.put(lcPropertyOffset, oFF.XIntegerValue
						.create(loAxisPaging.getOffset()));
				ltAxesProperties.put(loAxisPaging.getAxis(), ltAxisProperties);
			}
			ltResultSetPagingInfo.put(loResultSet, ltAxesProperties);
			loAxisPaging = ltAxisPaging.getByKey(oFF.AxisType.ROWS.getName());
			loAxisPaging.setPagingMode(
					sap.zen.CResultSetPagingMode.ACTIVATE_PAGING
							.getBinaryValue(),
					sap.zen.ResultSetAxisPaging.OFFSET_DEFAULT,
					sap.zen.ResultSetAxisPaging.SIZE_DEFAULT);
			loAxisPaging = ltAxisPaging
					.getByKey(oFF.AxisType.COLUMNS.getName());
			loAxisPaging.setPagingMode(0,
					sap.zen.ResultSetAxisPaging.OFFSET_DEFAULT,
					sap.zen.ResultSetAxisPaging.SIZE_DEFAULT);
			if (!loResultSet.getServerPaging().getState().isTypeOf(
					oFF.SyncState.IN_SYNC)) {
				loResultSet.synchronize(null, null, false);
			}
			loContent = sap.zen.XpDataSource.createDataSource(null,
					loDataSource, null);
			ltContent.add(loContent);
		}
		this.exportToExcel(ltContent, exportVersion);
		ltContent.clear();
		loResultSetPagingInfoIterator = ltResultSetPagingInfo
				.getKeysAsIterator();
		while (loResultSetPagingInfoIterator.hasNext()) {
			loResultSet = loResultSetPagingInfoIterator.next();
			if (oFF.isNull(loResultSet)) {
				continue;
			}
			ltAxisPaging = loResultSet.getServerPaging().getAxesPaging();
			ltAxesProperties = ltResultSetPagingInfo.getByKey(loResultSet);
			loAxisIterator = ltAxesProperties.getKeysAsIterator();
			while (loAxisIterator.hasNext()) {
				lAxisType = loAxisIterator.next();
				loAxisPaging = ltAxisPaging.getByKey(lAxisType.getName());
				ltAxisProperties = ltAxesProperties.getByKey(lAxisType);
				lPagingMode = ltAxisProperties.getByKey(lcPropertyPagingMode)
						.getInteger();
				lOffset = ltAxisProperties.getByKey(lcPropertyOffset)
						.getInteger();
				loAxisPaging.setPagingMode(lPagingMode, lOffset,
						sap.zen.ResultSetAxisPaging.SIZE_DEFAULT);
			}
			if (!loResultSet.getServerPaging().getState().isTypeOf(
					oFF.SyncState.IN_SYNC)) {
				loResultSet.synchronize(null, null, false);
			}
		}
	};
	sap.zen.Page.prototype.exportToExcel = function(tContent, exportVersion) {
		var lSettingsOffset;
		var lExportFormat;
		var lLayout;
		var lFormat;
		var lMergeContent;
		var lSettings;
		var loExcelWorkbook;
		var lContentIndex;
		var loContent;
		if (oFF.XString.isEqual(oFF.XStringBuffer.create()
				.append(exportVersion).toString(), "undefined")) {
			exportVersion = null;
		}
		if (oFF.XStringUtils.isNullOrEmpty(exportVersion)) {
			exportVersion = oFF.XDoubleValue.create(this.useExcelVersion)
					.toString();
		}
		lSettingsOffset = oFF.XString.indexOf(exportVersion, ".");
		lExportFormat = oFF.XInteger.convertFromString(oFF.XString.substring(
				exportVersion, 0, lSettingsOffset));
		lLayout = null;
		if (lExportFormat === 0) {
			lLayout = sap.zen.CXpDSExportLayout.SHEETS_GRID_FILTERS;
		} else {
			if (lExportFormat === 1) {
				lLayout = sap.zen.CXpDSExportLayout.SHEETS_GRID_FILTERS_VARIABLES;
			} else {
				if (lExportFormat === 2) {
					lLayout = sap.zen.CXpDSExportLayout.SHEETS_GRID_FILTERS_VARIABLES_INFO;
				} else {
					if (lExportFormat === 3) {
						lLayout = sap.zen.CXpDSExportLayout.SHEETS_GRID_INFO;
					} else {
						if (lExportFormat === 4) {
							lLayout = sap.zen.CXpDSExportLayout.SINGLE_SHEET_ALL;
						} else {
							lLayout = sap.zen.CXpDSExportLayout.SHEETS_GRID_FILTERS;
						}
					}
				}
			}
		}
		lFormat = false;
		lMergeContent = false;
		if (lSettingsOffset >= 0) {
			lSettings = oFF.XString.substring(exportVersion,
					lSettingsOffset + 1, -1);
			lFormat = oFF.XString.containsString(oFF.XString.substring(
					lSettings, 0, 1), "1");
			lMergeContent = oFF.XString.containsString(oFF.XString.substring(
					lSettings, 1, 2), "1");
		}
		loExcelWorkbook = sap.zen.Workbook.create(this.useExcelOpenOfficeType,
				lFormat);
		for (lContentIndex = 0; lContentIndex < tContent.size(); lContentIndex++) {
			loContent = tContent.get(lContentIndex);
			if (oFF.isNull(loContent)) {
				continue;
			}
			loContent.setLayout(lLayout);
			loContent.prepare();
			loContent.getDSItem(sap.zen.CXpDSItem.GRID).getGrid()
					.setMergeContent(lMergeContent);
			this.writeWorkbookContent(loContent, loExcelWorkbook, null, null);
		}
		loExcelWorkbook.save("excel.xlsx");
	};
	sap.zen.Page.prototype.writeWorkbookContent = function(oCollection,
			oExcelWorkbook, oExcelWorkSheet, oExcelWorkSheetRow) {
		var lChildOnSheet;
		var lChild;
		var loChild;
		var loContainer;
		var loCellInfo;
		var loDataCell;
		var lValue;
		var lValueType;
		var lFormatString;
		var lXpFormatString;
		var loDate;
		var loDateTime;
		var loTime;
		var lDouble;
		var lDigits;
		if (oFF.isNull(oExcelWorkbook)) {
			oExcelWorkbook = sap.zen.Workbook.create(
					this.useExcelOpenOfficeType, false);
		}
		lChildOnSheet = false;
		for (lChild = 0; lChild < oCollection.getAmountOfChildren(); lChild++) {
			loChild = oCollection.getChild(lChild);
			if (oFF.isNull(loChild)) {
				continue;
			}
			if (loChild.getObjectType() === sap.zen.CXpObjectType.CONTAINER) {
				loContainer = loChild;
				if (loContainer.getAmountOfChildren() <= 0) {
					continue;
				}
				if (oFF.isNull(oExcelWorkSheet)) {
					lChildOnSheet = true;
				}
				if (lChildOnSheet) {
					oExcelWorkSheet = oExcelWorkbook.addWorksheet(loContainer
							.getName());
				} else {
					if (lChild > 0) {
						oExcelWorkSheetRow = oExcelWorkSheet.addRow();
					}
					if (loContainer.hasTitle()) {
						oExcelWorkSheetRow = oExcelWorkSheet.addRow();
						loCellInfo = sap.zen.WorksheetCellInfo.create();
						loCellInfo.setValue(loContainer.getTitle());
						loCellInfo.setFormattedValue(loCellInfo.getValue());
						loCellInfo.setStyle(sap.zen.CXpStyle.HEADER);
						loCellInfo.setColSpan(loContainer.getLayout()
								.getColumns());
						oExcelWorkSheetRow.addCellWithContent(loCellInfo);
					}
				}
				this.writeWorkbookContent(loChild, oExcelWorkbook,
						oExcelWorkSheet, oExcelWorkSheetRow);
				if (lChildOnSheet) {
					if (oFF.notNull(oExcelWorkSheet)) {
						oExcelWorkSheet.close();
					}
					oExcelWorkSheet = null;
				}
				continue;
			}
			if (loChild.getObjectType() === sap.zen.CXpObjectType.DATA_ROW) {
				if (oFF.isNull(oExcelWorkSheet)) {
					oExcelWorkSheet = oExcelWorkbook.addWorksheet("");
				}
				oExcelWorkSheetRow = oExcelWorkSheet.addRow();
				this.writeWorkbookContent(loChild, oExcelWorkbook,
						oExcelWorkSheet, oExcelWorkSheetRow);
				continue;
			}
			if (loChild.getObjectType() === sap.zen.CXpObjectType.DATA_CELL) {
				loDataCell = loChild;
				if (oFF.isNull(oExcelWorkSheet)) {
					oExcelWorkSheet = oExcelWorkbook.addWorksheet("");
				}
				loCellInfo = sap.zen.WorksheetCellInfo.create();
				loCellInfo.setStyle(loDataCell.getDataCellStyle());
				loCellInfo.setRowSpan(loDataCell.getRowSpan());
				loCellInfo.setColSpan(loDataCell.getColumnSpan());
				lValue = loDataCell.getValue();
				loCellInfo.setFormattedValue(loDataCell.getFormattedValue());
				lValueType = loDataCell.getValueType();
				if (oFF.XStringUtils.isNullOrEmpty(lValue)) {
					lValueType = oFF.XValueType.STRING;
				}
				lFormatString = null;
				if (lValueType.isNumber()) {
					lFormatString = loDataCell.provideNumberFormatString(",",
							".");
				} else {
					lFormatString = loDataCell.getFormatString();
				}
				lXpFormatString = null;
				if (lValueType.isTypeOf(oFF.XValueType.DATE)) {
					loDate = oFF.XDate.createDateFromSAPFormat(lValue);
					if (oFF.notNull(loDate)) {
						lValue = loDate.toIsoFormat();
						if (oFF.XStringUtils.isNullOrEmpty(lFormatString)) {
							lXpFormatString = "dd mmm yyyy";
						}
					}
				} else {
					if (lValueType.isTypeOf(oFF.XValueType.DATE_TIME)) {
						loDateTime = oFF.XDateTime
								.createDateTimeFromSAPFormat(lValue);
						if (oFF.notNull(loDateTime)) {
							lValue = loDateTime.toIsoFormat();
							lValue = oFF.XStringUtils.concatenate2(lValue, "Z");
							if (oFF.XStringUtils.isNullOrEmpty(lFormatString)) {
								lXpFormatString = "dd mmm yyyy, hh.mm:ss AM/PM";
							}
						}
					} else {
						if (lValueType === oFF.XValueType.TIME) {
							loTime = oFF.XTime.createTimeFromSAPFormat(lValue);
							if (oFF.notNull(loTime)) {
								lValue = loTime.toIsoFormat();
								if (oFF.XStringUtils
										.isNullOrEmpty(lFormatString)) {
									lXpFormatString = "hh:mm:ss AM/PM";
								}
							}
						} else {
							if (lValueType === oFF.XValueType.PERCENT) {
								lDouble = oFF.XDouble.convertFromString(lValue);
								lDouble = lDouble / 100;
								lValue = oFF.XDouble.convertToString(lDouble);
							}
						}
					}
				}
				if (oFF.notNull(lXpFormatString)) {
					if (oFF.XStringUtils.isNotNullAndNotEmpty(lFormatString)) {
						lFormatString = oFF.XStringUtils.concatenate3(
								lXpFormatString, " ", lFormatString);
					} else {
						lFormatString = lXpFormatString;
					}
				}
				loCellInfo.setValue(lValue);
				loCellInfo.setFormatString(lFormatString);
				if (lValueType.isNumber()) {
					if (this.excelNumberHandling !== 0) {
						lDigits = loDataCell.getDigits();
						if (this.excelNumberHandling === 1 || lDigits > 15) {
							lValue = loCellInfo.getFormattedValue();
							lValueType = oFF.XValueType.STRING;
							lFormatString = sap.zen.XpDataCell.NO_FORMAT_STRING;
						}
					}
					if (lValueType.isNumber()) {
						loCellInfo
								.setValueType(sap.zen.CXpDataCellValueType.NUMBER);
					} else {
						loCellInfo
								.setValueType(sap.zen.CXpDataCellValueType.NUMBER_AS_STRING);
					}
				} else {
					if (lValueType.isTypeOf(oFF.XValueType.DATE)) {
						loCellInfo
								.setValueType(sap.zen.CXpDataCellValueType.DATE);
					} else {
						if (lValueType.isTypeOf(oFF.XValueType.TIME)) {
							loCellInfo
									.setValueType(sap.zen.CXpDataCellValueType.TIME);
						} else {
							if (lValueType.isTypeOf(oFF.XValueType.DATE_TIME)) {
								loCellInfo
										.setValueType(sap.zen.CXpDataCellValueType.DATE);
							} else {
								loCellInfo
										.setValueType(sap.zen.CXpDataCellValueType.STANDARD);
							}
						}
					}
				}
				oExcelWorkSheetRow.addCellWithContent(loCellInfo);
				continue;
			}
		}
	};
