	sap.zen.Page.prototype.getLogsAsExcelWorkbook = function() {
		var ltLogs = this.getLogs();
		var loWorkbook = sap.zen.Workbook.create(this.useExcelOpenOfficeType,
				false);
		var loWorkSheet = loWorkbook.addWorksheet("logs");
		var loWorkSheetRow = loWorkSheet.addRow();
		var loCellInfo = null;
		var loLog;
		loCellInfo = sap.zen.WorksheetCellInfo.create();
		loCellInfo.setValue("Level");
		loCellInfo.setFormattedValue(loCellInfo.getValue());
		loWorkSheetRow.addCellWithContent(loCellInfo);
		loCellInfo = sap.zen.WorksheetCellInfo.create();
		loCellInfo.setValue("Date");
		loCellInfo.setFormattedValue(loCellInfo.getValue());
		loWorkSheetRow.addCellWithContent(loCellInfo);
		loCellInfo = sap.zen.WorksheetCellInfo.create();
		loCellInfo.setValue("Time");
		loCellInfo.setFormattedValue(loCellInfo.getValue());
		loWorkSheetRow.addCellWithContent(loCellInfo);
		loCellInfo = sap.zen.WorksheetCellInfo.create();
		loCellInfo.setValue("TimeStamp");
		loCellInfo.setFormattedValue(loCellInfo.getValue());
		loWorkSheetRow.addCellWithContent(loCellInfo);
		loCellInfo = sap.zen.WorksheetCellInfo.create();
		loCellInfo.setValue("Component");
		loCellInfo.setFormattedValue(loCellInfo.getValue());
		loWorkSheetRow.addCellWithContent(loCellInfo);
		loCellInfo = sap.zen.WorksheetCellInfo.create();
		loCellInfo.setValue("Message");
		loCellInfo.setFormattedValue(loCellInfo.getValue());
		loWorkSheetRow.addCellWithContent(loCellInfo);
		loCellInfo = sap.zen.WorksheetCellInfo.create();
		loCellInfo.setValue("Details");
		loCellInfo.setFormattedValue(loCellInfo.getValue());
		loWorkSheetRow.addCellWithContent(loCellInfo);
		while (ltLogs.hasNext()) {
			loLog = ltLogs.next();
			loWorkSheetRow = loWorkSheet.addRow();
			loCellInfo.setValue(oFF.XInteger.convertToString(loLog.getLevel()));
			loCellInfo.setValueType(sap.zen.CXpDataCellValueType.NUMBER);
			loWorkSheetRow.addCellWithContent(loCellInfo);
			loCellInfo.setValue(loLog.getDate());
			loCellInfo.setValueType(sap.zen.CXpDataCellValueType.STANDARD);
			loWorkSheetRow.addCellWithContent(loCellInfo);
			loCellInfo.setValue(loLog.getTime());
			loCellInfo.setValueType(sap.zen.CXpDataCellValueType.STANDARD);
			loWorkSheetRow.addCellWithContent(loCellInfo);
			loCellInfo.setValue(oFF.XInteger.convertToString(loLog
					.getTimeStamp()));
			loCellInfo.setValueType(sap.zen.CXpDataCellValueType.NUMBER);
			loWorkSheetRow.addCellWithContent(loCellInfo);
			loCellInfo.setValue(loLog.getComponent());
			loCellInfo.setValueType(sap.zen.CXpDataCellValueType.STANDARD);
			loWorkSheetRow.addCellWithContent(loCellInfo);
			loCellInfo.setValue(loLog.getMessage());
			loCellInfo.setValueType(sap.zen.CXpDataCellValueType.STANDARD);
			loWorkSheetRow.addCellWithContent(loCellInfo);
			loCellInfo.setValue(loLog.getDetails());
			loCellInfo.setValueType(sap.zen.CXpDataCellValueType.STANDARD);
			loWorkSheetRow.addCellWithContent(loCellInfo);
		}
		loWorkSheet.close();
		return loWorkbook;
	};
