	sap.zen.Page.prototype.getSupportZip = function() {
		var loSupportZip = sap.buddha.XZip.create();
		var loSystemDescription = this.getApplication().getSystemLandscape()
				.getSystemDescription("self");
		var loBackendServices;
		var loApplicationAsZip;
		var loLogWorkbook;
		var loLogWorkbookBinary;
		var loStringBuffer;
		var loUrlParameterKeyIterator;
		var lUrlParameterKey;
		var lUrlParameterValue;
		if (oFF.notNull(loSystemDescription)) {
			loBackendServices = new sap.zen.ZBackendServices();
			loBackendServices.setSystem(loSystemDescription);
			loApplicationAsZip = loBackendServices.getApplicationAsZip(this,
					this.getAppName());
			loSupportZip.saveToFile("APPLICATION.zip", loApplicationAsZip
					.getZipAsBinary());
		}
		loLogWorkbook = this.getLogsAsExcelWorkbook();
		loLogWorkbookBinary = loLogWorkbook.getAsBinary();
		loSupportZip.saveToFile("LOGS.xlsx", loLogWorkbookBinary);
		loStringBuffer = oFF.XStringBuffer.create();
		if (oFF.notNull(this.tUrlParametersForSupportZip)) {
			loUrlParameterKeyIterator = this.tUrlParametersForSupportZip
					.getKeysAsIteratorOfString();
			while (loUrlParameterKeyIterator.hasNext()) {
				lUrlParameterKey = loUrlParameterKeyIterator.next();
				lUrlParameterValue = this.tUrlParametersForSupportZip
						.getByKey(lUrlParameterKey);
				loStringBuffer.append("&");
				loStringBuffer.append(lUrlParameterKey);
				loStringBuffer.append("=");
				loStringBuffer.append(lUrlParameterValue);
			}
		}
		loSupportZip.saveStringToFile("URLParameter.txt", loStringBuffer
				.toString());
		loSupportZip.saveStringToFile("trace.rstt", this.oRsttStringBuffer
				.toString());
		loSupportZip.saveZip("DSH_SUPPORT.zip");
	};
