	sap.zen.Page.prototype.initializePlanning = function(oApplicationProperties) {
		var lPlanningConnection = null;
		var lPlanningSchema;
		var lPlanningModelAndEnvironment;
		var lEnvironment;
		var lModel;
		var loPlanningServiceConfig;
		var loConfigProperties;
		var loResult;
		var loSystemDescription;
		var lSystemType;
		var loPlanningService;
		if (this.isHanaMode() === true) {
			lPlanningConnection = "self";
		} else {
			lPlanningConnection = oApplicationProperties
					.getStringPropertyWithDefault("PLANNING_CONNECTION", null);
		}
		if ((oFF.notNull(lPlanningConnection))
				&& (this.isBWSystem(lPlanningConnection))) {
			lPlanningSchema = oApplicationProperties
					.getStringPropertyWithDefault("PLANNING_SCHEMA", null);
			lPlanningModelAndEnvironment = oApplicationProperties
					.getStringPropertyWithDefault("PLANNING_MODEL", null);
			lEnvironment = null;
			lModel = null;
			if ((oFF.notNull(lPlanningModelAndEnvironment))
					&& oFF.XString.size(lPlanningModelAndEnvironment) > 0) {
				lEnvironment = oFF.XString.substring(
						lPlanningModelAndEnvironment, 0, 20);
				lModel = oFF.XString.substring(lPlanningModelAndEnvironment,
						20, oFF.XString.size(lPlanningModelAndEnvironment));
			}
			loPlanningServiceConfig = oFF.OlapApiModule.SERVICE_TYPE_PLANNING
					.createServiceConfig(this.getApplication());
			loPlanningServiceConfig.setSystemName(lPlanningConnection);
			loConfigProperties = loPlanningServiceConfig.getProperties();
			loConfigProperties.put(oFF.PlanningConstants.DATA_AREA,
					"MY_DATA_AREA");
			loConfigProperties.put(oFF.PlanningConstants.ENVIRONMENT,
					lEnvironment);
			loConfigProperties.put(oFF.PlanningConstants.MODEL, lModel);
			loConfigProperties.put(oFF.PlanningConstants.CELL_LOCKING,
					oFF.CellLockingType.DEFAULT_SETTING_BACKEND.toString());
			loResult = null;
			try {
				loResult = loPlanningServiceConfig.processServiceCreation(
						oFF.SyncType.BLOCKING, null, null);
			} catch (e) {
				sap.zen.CLocalizationDataSourceMessages.PLANNING_ERR_LONG
						.addMessageToMessageHandler(this.getMessageManager(),
								oFF.Severity.ERROR, null, null, null);
				return;
			}
			if (loResult.hasErrors() === false) {
				loSystemDescription = loPlanningServiceConfig
						.getSystemDescription();
				lSystemType = loSystemDescription.getSystemType();
				loPlanningService = loResult.getData();
				if (oFF.notNull(loPlanningService)) {
					this.oPlanningContext = loPlanningService
							.getPlanningContext();
				}
			} else {
				sap.zen.CLocalizationDataSourceMessages.PLANNING_ERR_LONG
						.addMessageToMessageHandler(this.getMessageManager(),
								oFF.Severity.ERROR, null, null, null);
			}
			this.createMessagesFromCollection(loResult);
		}
	};
