	sap.zen.XpDSContainer.prototype.getDSItem = function(dataSourceItem) {
		var loDSItem = null;
		var loChild = this.getChildByKey(dataSourceItem.getValue());
		var ltChildren;
		var loChildKeyIterator;
		var lChildKey;
		var lDataSourceItem;
		if (oFF.notNull(loChild)) {
			loDSItem = loChild;
			return loDSItem;
		}
		ltChildren = this.getChildren();
		loChildKeyIterator = ltChildren.getKeysAsIteratorOfString();
		while (loChildKeyIterator.hasNext()) {
			lChildKey = loChildKeyIterator.next();
			lDataSourceItem = sap.zen.CXpDSItem.valueOf2(lChildKey);
			if (oFF.isNull(lDataSourceItem)) {
				continue;
			}
			loChild = ltChildren.getByKey(lDataSourceItem.getValue());
			if (oFF.isNull(loChild)) {
				continue;
			}
			loDSItem = loChild.getDSItem(dataSourceItem);
			if (oFF.notNull(loDSItem)) {
				return loDSItem;
			}
		}
		return null;
	};
	sap.zen.XpDSContainer.prototype.addDSItem = function(dataSourceItem) {
		var loDSItem = null;
		if (dataSourceItem === sap.zen.CXpDSItem.TECHNICAL_INFORMATION) {
			loDSItem = sap.zen.XpDSItemContainerTechInfo
					.createTechInfoContainer(this, this.oDataSource,
							this.oResultSet);
		} else {
			if (dataSourceItem === sap.zen.CXpDSItem.VARIABLES) {
				loDSItem = sap.zen.XpDSItemContainerVariables
						.createVariableContainer(this, this.oDataSource,
								this.oResultSet);
			} else {
				if (dataSourceItem === sap.zen.CXpDSItem.FILTERS) {
					loDSItem = sap.zen.XpDSItemContainerFilter
							.createFilterContainer(this, this.oDataSource,
									this.oResultSet);
				} else {
					if (dataSourceItem === sap.zen.CXpDSItem.GRID) {
						loDSItem = sap.zen.XpDSItemContainerGrid
								.createGridContainer(this, this.oDataSource,
										this.oResultSet);
					} else {
						if (dataSourceItem === sap.zen.CXpDSItem.INFO) {
							loDSItem = sap.zen.XpDSItemContainerInfo
									.createInfoContainer(this,
											this.oDataSource, this.oResultSet);
						} else {
							if (dataSourceItem === sap.zen.CXpDSItem.DATASOURCE) {
								loDSItem = sap.zen.XpDSItemContainerDataSource
										.createDataSourceContainer(this,
												this.oDataSource,
												this.oResultSet);
							}
						}
					}
				}
			}
		}
		if (oFF.notNull(loDSItem)) {
			this.addChildByKey(dataSourceItem.getValue(), loDSItem);
		}
		return loDSItem;
	};
	sap.zen.XpDSContainer.prototype.prepare = function() {
		var ltChildren = this.getChildren();
		var loChildKeyIterator = ltChildren.getKeysAsIteratorOfString();
		var lChildKey;
		var lDataSourceItem;
		var loChild;
		while (loChildKeyIterator.hasNext()) {
			lChildKey = loChildKeyIterator.next();
			lDataSourceItem = sap.zen.CXpDSItem.valueOf2(lChildKey);
			if (oFF.isNull(lDataSourceItem)) {
				continue;
			}
			loChild = ltChildren.getByKey(lDataSourceItem.getValue());
			if (oFF.isNull(loChild)) {
				continue;
			}
			loChild.prepare();
		}
	};
