	sap.zen.ActionlistControl.prototype.create = function() {
		var lUid = oFF.XStringUtils
				.concatenate2(this.getName(), "_actionlist1");
		var listOfItems;
		var itemsNode;
		var itemsNodeChildren;
		var valuesAsIterator;
		var selectionItemNode;
		var children;
		var valuesAsIterator2;
		var newItem;
		var next;
		var value;
		var text;
		this.getPage().addRequireModule(
				"zen.rt.components.actionlist/resources/js/actionlist_handler");
		this.initControl(lUid, "actionlist");
		listOfItems = oFF.XList.create();
		itemsNode = this.getInitParameters().getFirstChildWithNameTag(
				"ACTION_LIST_ITEMS");
		if (oFF.notNull(itemsNode)) {
			itemsNodeChildren = itemsNode.getChildren("property");
			if (oFF.notNull(itemsNodeChildren)) {
				valuesAsIterator = itemsNodeChildren.getIterator();
				while (valuesAsIterator.hasNext()) {
					selectionItemNode = valuesAsIterator.next();
					if (oFF.notNull(selectionItemNode)) {
						children = selectionItemNode.getChildren("property");
						valuesAsIterator2 = children.getIterator();
						newItem = new sap.zen.ListItem();
						while (valuesAsIterator2.hasNext()) {
							next = valuesAsIterator2.next();
							if (oFF.XString.compare(next.getAttribute("name"),
									"VALUE") === 0) {
								value = next.getAttribute("value");
								newItem.setValue(value);
							} else {
								text = next.getAttribute("value");
								newItem.setText(text);
							}
						}
						listOfItems.add(newItem);
					}
				}
			}
		}
		this.setItems(listOfItems);
	};
	sap.zen.ActionlistControl.prototype.setItems = function(tItems) {
		this.tAllItems = tItems;
	};
	sap.zen.ActionlistControl.prototype.onClick = function(value) {
		var lItemIndex;
		var loListItem;
		var lCommand;
		for (lItemIndex = 0; lItemIndex < this.tAllItems.size(); lItemIndex++) {
			loListItem = this.tAllItems.get(lItemIndex);
			if (oFF.isNull(loListItem)) {
				continue;
			}
			if (oFF.XString.compare(loListItem.getValue(), value) === 0) {
				this.setSelectedText(loListItem.getText());
				this.setSelectedValue(loListItem.getValue());
			}
		}
		lCommand = this.getOnClick();
		if (oFF.XString.size(lCommand) > 0) {
			this.getPage().execWithoutRerender(lCommand);
		}
	};
