	sap.zen.FioriHelperControl.prototype.getShellURL = function(URLParameters) {
		var loUriBase = oFF.XUri.createFromUri("");
		var ltQueryMap;
		var loJsonParser;
		var loJsonStructure;
		var ltJsonStructureElementNames;
		var lSize;
		var lElementName;
		var lElementIndex;
		var loBuffer;
		var lQueryString;
		var lUrl;
		if (oFF.XStringUtils.isNotNullAndNotEmpty(URLParameters)) {
			loUriBase.setQuery(URLParameters);
		}
		ltQueryMap = loUriBase.getQueryMap();
		loJsonParser = oFF.JsonParserFactory.newInstance();
		loJsonStructure = loJsonParser.parse(this.paramJSON).asStructure();
		ltJsonStructureElementNames = loJsonStructure
				.getKeysAsReadOnlyListOfString();
		lSize = ltJsonStructureElementNames.size();
		for (lElementIndex = 0; lElementIndex < lSize; lElementIndex++) {
			lElementName = ltJsonStructureElementNames.get(lElementIndex);
			if (!ltQueryMap.containsKey(lElementName)) {
				loUriBase.addQueryElement(lElementName, loJsonStructure
						.getStringByKey(lElementName));
			}
		}
		loBuffer = oFF.XStringBuffer.create();
		loBuffer.append(this.baseURL);
		loBuffer.append("#");
		loBuffer.append(this.hashBase);
		lQueryString = loUriBase.getQuery();
		if (oFF.XStringUtils.isNotNullAndNotEmpty(lQueryString)) {
			loBuffer.append("?");
			loBuffer.append(loUriBase.getQuery());
		}
		lUrl = loBuffer.toString();
		return lUrl;
	};
