	sap.zen.FioriHelperControl.prototype.onJumpTargetsFetched = function(
			targetsJsonURIencoded) {
		var lJsonString;
		var loJsonParser;
		var loJsonRootElement;
		var loJsonList;
		var lJsonListSize;
		var lJsonListIndex;
		var loJsonStructure;
		var text;
		var hash;
		var loKeyValueObject;
		var lOnJumpTargetsFetchedScript;
		this.tJumpTargets = oFF.XList.create();
		lJsonString = oFF.XHttpUtils.decodeURIComponent(targetsJsonURIencoded);
		loJsonParser = oFF.JsonParserFactory.newInstance();
		loJsonRootElement = loJsonParser.parse(lJsonString);
		if (oFF.isNull(loJsonRootElement)) {
			return;
		}
		loJsonList = loJsonRootElement.asList();
		lJsonListSize = loJsonList.size();
		for (lJsonListIndex = 0; lJsonListIndex < lJsonListSize; lJsonListIndex++) {
			loJsonStructure = loJsonList.getStructureAt(lJsonListIndex);
			if (oFF.isNull(loJsonStructure)) {
				continue;
			}
			text = loJsonStructure.getStringByKey("text");
			hash = loJsonStructure.getStringByKey("hash");
			loKeyValueObject = sap.zen.KeyValueObject.create(hash, text);
			this.tJumpTargets.add(loKeyValueObject);
		}
		this.tJumpTargets.sortByDirection(oFF.XSortDirection.ASCENDING);
		lOnJumpTargetsFetchedScript = this.getStringPropertyWithDefault(
				"ON_JUMP_TARGETS_FETCHED", "");
		if (oFF.XStringUtils.isNotNullAndNotEmpty(lOnJumpTargetsFetchedScript)) {
			this.getPage().execWithoutRerender(lOnJumpTargetsFetchedScript);
		}
	};
