	sap.zen.FioriHelperControl.prototype.renderFilterContext = function(
			oRenderSerializer, tSelectionsPerDimension) {
		var loSelectionsPerDimensionIterator = tSelectionsPerDimension
				.getKeysAsIteratorOfString();
		var lDimensionName;
		var loRangeIterator;
		var loRange;
		var lOperation;
		var loLowMember;
		var loHighMember;
		var lHighString;
		while (loSelectionsPerDimensionIterator.hasNext()) {
			lDimensionName = loSelectionsPerDimensionIterator.next();
			oRenderSerializer.openTag("dimension");
			oRenderSerializer.addAttribute("name", lDimensionName);
			oRenderSerializer.openArray("selections");
			loRangeIterator = tSelectionsPerDimension.getByKey(lDimensionName)
					.getIterator();
			while (loRangeIterator.hasNext()) {
				loRange = loRangeIterator.next();
				oRenderSerializer.openJsonTag();
				if (!loRange.isExclude()) {
					oRenderSerializer.addAttribute("Sign", "I");
				} else {
					oRenderSerializer.addAttribute("Sign", "E");
				}
				lOperation = loRange.getOperation();
				loLowMember = loRange.getFrom();
				oRenderSerializer.addAttribute("Low", loLowMember
						.getExternalKey(this.oDataSource));
				oRenderSerializer.addAttribute("LowType", loLowMember.getType()
						.toString());
				oRenderSerializer.addAttribute("Option", lOperation.toString());
				if (lOperation === sap.zen.Operation.BT) {
					loHighMember = loRange.getTo();
					lHighString = null;
					if (oFF.notNull(loHighMember)) {
						lHighString = loHighMember
								.getExternalKey(this.oDataSource);
					}
					if (oFF.notNull(lHighString)) {
						oRenderSerializer.addAttribute("High", lHighString);
						if (oFF.notNull(loHighMember)) {
							oRenderSerializer.addAttribute("HighType",
									loHighMember.getType().toString());
						}
					} else {
						oRenderSerializer.addNullAttribute("High");
					}
				}
				oRenderSerializer.closeJsonTag();
			}
			oRenderSerializer.closeArray();
			oRenderSerializer.closeTag();
		}
	};
	sap.zen.FioriHelperControl.prototype.renderContextForTargetFetch = function(
			oRenderSerializer) {
		var loDataSource = this.oDataSource;
		var lElementIndex;
		var loSelectionCapableElement;
		var ltSelectionsPerDimension;
		if (oFF.isNull(loDataSource)
				&& !this.getPage().getDataSources().isEmpty()) {
			loDataSource = this.getPage().getDataSources()
					.getValuesAsReadOnlyList().get(0);
		}
		if (oFF.isNull(loDataSource) || !loDataSource.isInitialized()) {
			return;
		}
		oRenderSerializer.openTag("context");
		if (oFF.notNull(this.tSelectionCapableElements)) {
			for (lElementIndex = 0; lElementIndex < this.tSelectionCapableElements
					.size(); lElementIndex++) {
				loSelectionCapableElement = this.tSelectionCapableElements
						.get(lElementIndex);
				if (oFF.isNull(loSelectionCapableElement)) {
					continue;
				}
				ltSelectionsPerDimension = loSelectionCapableElement
						.getSelections();
				if (!ltSelectionsPerDimension.isEmpty()) {
					oRenderSerializer.openArray("selections");
					loDataSource.renderJumpToSelectorContext(oRenderSerializer,
							ltSelectionsPerDimension);
					oRenderSerializer.closeArray();
					break;
				}
			}
		}
		loDataSource.renderJumpToVariableFilterContext(oRenderSerializer);
		oRenderSerializer.closeTag();
	};
	sap.zen.FioriHelperControl.prototype.renderNavigationInformation = function(
			oRenderSerializer) {
		var ltAllowedDestinations = this.getPage()
				.getNavigationAllowedSemanticSources();
		var lSize;
		var lIndex;
		var lAllowedDestination;
		if (oFF.isNull(ltAllowedDestinations)
				|| ltAllowedDestinations.size() === 0) {
			return;
		}
		oRenderSerializer.openTag("navigation");
		oRenderSerializer.openArray("allowed_semantic_sources");
		lSize = ltAllowedDestinations.size();
		for (lIndex = 0; lIndex < lSize; lIndex++) {
			lAllowedDestination = ltAllowedDestinations.get(lIndex);
			if (oFF.isNull(lAllowedDestination)) {
				continue;
			}
			oRenderSerializer.openTag("entry");
			oRenderSerializer.addAttribute("semanticname", lAllowedDestination);
			oRenderSerializer.closeTag();
		}
		oRenderSerializer.closeArray();
		oRenderSerializer.addAttribute("length", oFF.XInteger
				.convertToString(lSize));
		oRenderSerializer.closeTag();
	};
