	sap.zen.MessageviewControl.sTranslateMessageSeverityToLevel = function(
			severity) {
		if (severity.isEqualTo(oFF.Severity.WARNING)) {
			return "WARNING";
		} else {
			if (severity.isEqualTo(oFF.Severity.INFO)) {
				return "INFO";
			} else {
				return "ERROR";
			}
		}
	};
	sap.zen.MessageviewControl.sRenderMessages = function(oRenderSerializer,
			oPage, tMessages, msgIndex) {
		var lRendered = false;
		var lMessageTypes = sap.zen.MessageviewControl.sGetMessageTypes(oPage);
		var lDisplayAll = oFF.XString.isEqual(lMessageTypes, "ALL");
		var lDisplayOnlyErrors = oFF.XString.isEqual(lMessageTypes, "ERRORS");
		var lMessageIndex;
		var loMessage;
		var lSeverity;
		if (!oFF.XString.isEqual(lMessageTypes, "NONE")
				&& oFF.notNull(tMessages) && !tMessages.isEmpty()) {
			oRenderSerializer.openArray("messages");
			for (lMessageIndex = 0; lMessageIndex < tMessages.size(); lMessageIndex++) {
				loMessage = tMessages.get(lMessageIndex);
				if (oFF.isNull(loMessage)) {
					continue;
				}
				lSeverity = loMessage.getSeverity();
				if (oFF.notNull(lSeverity)) {
					if (msgIndex < 0) {
						msgIndex = 0;
					}
					if ((lDisplayAll && lSeverity.isEqualTo(oFF.Severity.INFO))
							|| lSeverity.isEqualTo(oFF.Severity.ERROR)
							|| lSeverity
									.isEqualTo(oFF.Severity.SEMANTICAL_ERROR)
							|| (lSeverity.isEqualTo(oFF.Severity.WARNING) && !lDisplayOnlyErrors)) {
						oRenderSerializer.openJsonTag();
						oRenderSerializer.openTag("message");
						oRenderSerializer.addIntegerAttribute("msg_idx",
								msgIndex);
						oRenderSerializer
								.addAttribute(
										"id",
										"com.sap.ip.bi.zen.rt.framework.impl.services.command.resolver.PageCommandResolver-MESSAGE");
						oRenderSerializer.addAttribute("short_text", loMessage
								.getText());
						oRenderSerializer.addAttribute("long_text", loMessage
								.getText());
						oRenderSerializer
								.addAttribute(
										"level",
										sap.zen.MessageviewControl
												.sTranslateMessageSeverityToLevel(lSeverity));
						oRenderSerializer.closeTag();
						oRenderSerializer.closeJsonTag();
						msgIndex++;
					}
				}
			}
			oRenderSerializer.closeArray();
			lRendered = true;
		}
		return lRendered;
	};
