	sap.zen.GlobalScriptsControl.prototype.create = function() {
		var lName;
		var lScript;
		var loFunctionNodes;
		var ltFunctionNodes;
		var lFunctionNodeIndex;
		var loFunctionNode;
		var loFunctionNameNode;
		var lFunctionName;
		var loReturnTypeNode;
		var loFunctionBodyNode;
		var loValueNode;
		var lValueNodeScript;
		var loInputParametersNode;
		var loInputParameterNodes;
		var lInputParameterNodeIndex;
		var loInputParameterNode;
		var loInputParameterNameNode;
		var lInputParameterName;
		var loInputParameterTypeNode;
		if (this.getInitParameters() !== null) {
			lName = this.getId();
			lScript = "new function(){";
			loFunctionNodes = this.getInitParameters()
					.getFirstChildWithNameTag("FUNCTIONS");
			if (oFF.notNull(loFunctionNodes)) {
				ltFunctionNodes = loFunctionNodes.getChildren("property");
				for (lFunctionNodeIndex = 0; lFunctionNodeIndex < ltFunctionNodes
						.size(); lFunctionNodeIndex++) {
					loFunctionNode = ltFunctionNodes.get(lFunctionNodeIndex);
					if (oFF.isNull(loFunctionNode)) {
						continue;
					}
					loFunctionNameNode = loFunctionNode
							.getFirstChildWithNameTag("NAME");
					lFunctionName = loFunctionNameNode.getAttribute("value");
					lScript = oFF.XStringUtils.concatenate4(lScript, "this.",
							lFunctionName, " = function(");
					loReturnTypeNode = loFunctionNode
							.getFirstChildWithNameTag("RETURN_TYPE");
					loFunctionBodyNode = loFunctionNode
							.getFirstChildWithNameTag("FUNCTION_BODY");
					loValueNode = loFunctionBodyNode.getFirstChild("value");
					lValueNodeScript = loValueNode.getText();
					loInputParametersNode = loFunctionNode
							.getFirstChildWithNameTag("INPUT_PARAMETERS");
					if (oFF.notNull(loInputParametersNode)) {
						loInputParameterNodes = loInputParametersNode
								.getChildren("property");
						for (lInputParameterNodeIndex = 0; lInputParameterNodeIndex < loInputParameterNodes
								.size(); lInputParameterNodeIndex++) {
							loInputParameterNode = loInputParameterNodes
									.get(lInputParameterNodeIndex);
							if (oFF.isNull(loInputParameterNode)) {
								continue;
							}
							if (lInputParameterNodeIndex > 0) {
								lScript = oFF.XStringUtils.concatenate2(
										lScript, ",");
							}
							loInputParameterNameNode = loInputParameterNode
									.getFirstChildWithNameTag("NAME");
							lInputParameterName = loInputParameterNameNode
									.getAttribute("value");
							loInputParameterTypeNode = loInputParameterNode
									.getFirstChildWithNameTag("PARAMETER_TYPE");
							lScript = oFF.XStringUtils.concatenate2(lScript,
									lInputParameterName);
						}
					}
					lScript = oFF.XStringUtils.concatenate2(lScript, "){");
					lScript = oFF.XStringUtils.concatenate2(lScript,
							lValueNodeScript);
					lScript = oFF.XStringUtils.concatenate2(lScript, "\n};");
				}
			}
			lScript = oFF.XStringUtils.concatenate2(lScript, "};");
			this.getPage().getWindow().putGlobalScriptInContext(lName, lScript);
		}
	};
