	sap.zen.DataProviderReferenceComponent.prototype.getDescriptionOrKey = function(
			oTupleElement) {
		var loDimension = oTupleElement.getDimension();
		var loInternalDimension = loDimension.getInternalObject();
		var loDimensionMember = oTupleElement.getDimensionMember();
		var loInternalDimensionMember = loDimensionMember.getInternalObject();
		var loTextField;
		var loFieldValue;
		var lValue;
		if (!loDimensionMember.isTotal()) {
			loTextField = loInternalDimension.getTextField();
			if (oFF.notNull(loTextField)) {
				loFieldValue = loInternalDimensionMember
						.getFieldValue(loTextField);
				if (oFF.notNull(loFieldValue)) {
					lValue = loFieldValue.getFormattedValue();
					if (oFF.notNull(lValue)) {
						return lValue;
					}
				}
			}
		}
		return loDimensionMember.getFormattedValue();
	};
	sap.zen.DataProviderReferenceComponent.prototype.getKey = function(
			oTupleElement) {
		var value = "";
		var loDimension = oTupleElement.getDimension();
		var loInternalDimension = loDimension.getInternalObject();
		var loDimensionMember = oTupleElement.getDimensionMember();
		var loInternalDimensionMember = loDimensionMember.getInternalObject();
		var lTextField;
		var lFieldValue;
		if (!loDimensionMember.isTotal()) {
			lTextField = loInternalDimension.getKeyField();
			if (oFF.notNull(lTextField)) {
				lFieldValue = loInternalDimensionMember
						.getFieldValue(lTextField);
				if (oFF.notNull(lFieldValue)) {
					value = lFieldValue.getFormattedValue();
					if (oFF.notNull(value)) {
						return value;
					}
				}
			}
		}
		value = loDimensionMember.getFormattedValue();
		return value;
	};
