	sap.zen.AbsoluteLayoutControl.prototype.getDelayTimeForLoadingIndicator = function() {
		var lValue = this.getPage().getApplicationPropertiesComponent()
				.getIntPropertyWithDefault("LOADING_INDICATOR_TIMEOUT", 1000);
		return lValue;
	};
	sap.zen.AbsoluteLayoutControl.prototype.renderControlSpecificContent = function(
			oRenderSerializer) {
		var lScript;
		if ((oFF.notNull(this.urlToRender))
				&& (oFF.XString.size(this.urlToRender) > 0)) {
			oRenderSerializer.addAttribute("newurl", this.urlToRender);
			this.urlToRender = "";
		}
		oRenderSerializer.addIntegerAttribute("loadingIndicatorDelay", this
				.getDelayTimeForLoadingIndicator());
		if (this.afterRendering) {
			if (this.afterRendering) {
				lScript = this
						.createMethodCallScript("doAfterRenderingCommand");
				oRenderSerializer.addAttribute("afterRendering", lScript);
				this.afterRendering = false;
			}
		}
	};
