	sap.zen.DialogControl.prototype.renderControlProperties = function(
			oRenderSerializer) {
		oRenderSerializer.addAttribute("title", this.getTitle());
		oRenderSerializer.addBooleanAttribute("draggable", this
				.getIsDraggable());
		oRenderSerializer.addBooleanAttribute("resizable", this
				.getIsResizable());
		oRenderSerializer.addBooleanAttribute("fullscreen", this
				.getIsFullscreen());
		oRenderSerializer.addBooleanAttribute("show", this.isOpen());
	};
	sap.zen.DialogControl.prototype.renderButtonsCollection = function(
			oRenderSerializer) {
		var loButtonIterator;
		var loButton;
		var lOnButtonClickAction;
		var lArguments;
		oRenderSerializer.openArray("Buttons");
		if (this.tButtons.size() > 0) {
			loButtonIterator = this.tButtons.getIterator();
			while (loButtonIterator.hasNext()) {
				loButton = loButtonIterator.next();
				if (oFF.isNull(loButton)) {
					continue;
				}
				oRenderSerializer.openTag("Button");
				oRenderSerializer.addAttribute("buttonkey", loButton.getKey());
				oRenderSerializer.addAttribute("text", loButton.getText());
				if (loButton.isEnabled()) {
					oRenderSerializer.addAttribute("buttonenabled", "X");
				} else {
					oRenderSerializer.addAttribute("buttonenabled", "");
				}
				if (loButton.isVisible()) {
					oRenderSerializer.addAttribute("buttonvisible", "X");
				} else {
					oRenderSerializer.addAttribute("buttonvisible", "");
				}
				lOnButtonClickAction = oFF.XStringUtils.concatenate2(this
						.getId(), ".onDlgBtnClick(__arguments__);");
				lArguments = oFF.XStringUtils.concatenate2('"', loButton
						.getKey());
				lArguments = oFF.XStringUtils.concatenate2(lArguments, '"');
				lOnButtonClickAction = this.createScriptAction(
						lOnButtonClickAction, lArguments);
				oRenderSerializer.addAttribute("onclick", lOnButtonClickAction);
				oRenderSerializer.closeTag();
			}
		}
		oRenderSerializer.closeArray();
	};
	sap.zen.DialogControl.prototype.getButtons = function() {
		var ltButtons = oFF.XList.create();
		var loButtonsNode = this.getInitParameters().getFirstChildWithNameTag(
				"DIALOGBUTTONS");
		var ltButtonNodes;
		var loButtonNodeIterator;
		var loButtonNode;
		var loButton;
		var valueNode;
		var lButtonKey;
		var textNode;
		var enNode;
		var visNode;
		var actionNode;
		var actionValue;
		var action;
		if (oFF.isNull(loButtonsNode)) {
			return ltButtons;
		}
		ltButtonNodes = loButtonsNode.getChildren("property");
		if (oFF.isNull(ltButtonNodes)) {
			return ltButtons;
		}
		loButtonNodeIterator = ltButtonNodes.getIterator();
		while (loButtonNodeIterator.hasNext()) {
			loButtonNode = loButtonNodeIterator.next();
			if (oFF.isNull(loButtonNode)) {
				continue;
			}
			loButton = new sap.zen.DialogButtonItem();
			valueNode = loButtonNode.getFirstChildWithNameTag("VALUE");
			if (oFF.notNull(valueNode)) {
				loButton.setKey(valueNode.getAttribute("value"));
			}
			if (oFF.XStringUtils.isNullOrEmpty(loButton.getKey())) {
				lButtonKey = loButtonNode.getAttribute("value");
				if (oFF.notNull(lButtonKey)) {
					loButton.setKey(lButtonKey);
				}
			}
			textNode = loButtonNode.getFirstChildWithNameTag("TEXT");
			if (oFF.notNull(textNode)) {
				loButton.setText(textNode.getAttribute("value"));
			}
			enNode = loButtonNode.getFirstChildWithNameTag("ENABLED");
			if (oFF.notNull(enNode)) {
				loButton.setEnabled(oFF.XString.isEqual(enNode
						.getAttribute("value"), "X"));
			} else {
				loButton.setEnabled(true);
			}
			visNode = loButtonNode.getFirstChildWithNameTag("VISIBLE");
			if (oFF.notNull(visNode)) {
				loButton.setVisible(oFF.XString.isEqual(visNode
						.getAttribute("value"), "X"));
			} else {
				loButton.setVisible(true);
			}
			actionNode = loButtonNode.getFirstChildWithNameTag("ON_CLICK");
			if (oFF.notNull(actionNode)) {
				actionValue = actionNode.getChildren("value");
				if (oFF.notNull(actionValue)) {
					action = actionValue.get(0).getText();
					if (oFF.XStringUtils.isNotNullAndNotEmpty(action)) {
						loButton.setOnClickAction(action);
					}
				}
			}
			ltButtons.add(loButton);
		}
		return ltButtons;
	};
