	sap.zen.FilterBarControl.prototype.processControlSpecificAddDimensions = function() {
		var dimensionsConfig;
		var dataSourceName;
		var loDataSource;
		var loQueryManager;
		var ltDimensions;
		var lDimensionIndex;
		var loDimension;
		var ltDimensionsSorted;
		var lKeyfigureDimension;
		var lComparator;
		var jsonParser;
		var dimensionsConfigList;
		var dimensionsIterator;
		var cconfig;
		if (!(this.getPage().isDesignMode())) {
			dimensionsConfig = this.getDimensionsConfig();
			dataSourceName = this.getDataSource();
			loDataSource = null;
			if (oFF.XStringUtils.isNotNullAndNotEmpty(dataSourceName)) {
				loDataSource = this.getPage().getDataSource(dataSourceName);
				loDataSource.addDataSourceChangeListener(this, null);
			}
			if (oFF.notNull(loDataSource)) {
				loQueryManager = loDataSource.getQueryManager();
				if (oFF.notNull(loQueryManager)) {
					if (this.createFilters) {
						this.createFilters = false;
						this.removeAllComponents();
						if (oFF.XString.isEqual(dimensionsConfig, "")
								|| oFF.XString.isEqual(dimensionsConfig, "[]")) {
							ltDimensions = loQueryManager.getQueryModel()
									.getFilter().getDimensions();
							lDimensionIndex = 0;
							loDimension = null;
							ltDimensionsSorted = oFF.XList.create();
							lKeyfigureDimension = null;
							for (lDimensionIndex = 0; lDimensionIndex < ltDimensions
									.size(); lDimensionIndex++) {
								loDimension = ltDimensions.get(lDimensionIndex);
								if (oFF.isNull(loDimension)) {
									continue;
								}
								if (loDimension.isMeasureStructure()) {
									lKeyfigureDimension = loDimension;
									continue;
								}
								ltDimensionsSorted.add(loDimension);
							}
							lComparator = new sap.zen.SortDimensionsAscByTextComparator();
							ltDimensionsSorted.sortByComparator(lComparator);
							if (oFF.notNull(lKeyfigureDimension)) {
								ltDimensionsSorted.add(lKeyfigureDimension);
							}
							for (lDimensionIndex = 0; lDimensionIndex < ltDimensionsSorted
									.size(); lDimensionIndex++) {
								loDimension = ltDimensionsSorted
										.get(lDimensionIndex);
								if (oFF.isNull(loDimension)) {
									continue;
								}
								if (!sap.zen.DataSourceScriptApiUtils
										.isViewableDimension(loDimension)) {
									continue;
								}
								if (loDimension.supportsAxis(oFF.AxisType.ROWS)
										|| loDimension.isMeasureStructure()) {
									this.createDimFilter(dataSourceName,
											loDimension.getName(), this
													.getTargetDataSource(),
											loDimension);
								}
							}
						} else {
							if (oFF.notNull(dimensionsConfig)) {
								jsonParser = this.getJsonParser();
								dimensionsConfigList = sap.zen.CharacteristicConfig
										.parseJSON(jsonParser, dimensionsConfig);
								dimensionsIterator = dimensionsConfigList
										.getIterator();
								while (dimensionsIterator.hasNext()) {
									cconfig = dimensionsIterator.next();
									this.createDimFilter(dataSourceName,
											cconfig.getName(), this
													.getTargetDataSource(),
											null);
								}
							}
						}
					}
				}
			}
		}
	};
	sap.zen.FilterBarControl.prototype.collectAllChildrenSubmit = function() {
		var lScript = "";
		var loScriptSequence;
		var lChildIndex;
		var loDimensionFilterComponent;
		var loScriptSequenceItem;
		if (oFF.notNull(this.tChildren) && this.tChildren.size() > 0) {
			loScriptSequence = new sap.zen.ScriptSequence();
			for (lChildIndex = 0; lChildIndex < this.tChildren.size(); lChildIndex++) {
				loDimensionFilterComponent = this.tChildren.get(lChildIndex);
				if (oFF.isNull(loDimensionFilterComponent)) {
					continue;
				}
				loScriptSequenceItem = this
						.createScriptSequenceItemWithPlaceHolders2(
								loDimensionFilterComponent,
								"doSubmitFilterCommand", oFF.XStringUtils
										.concatenate3("__STRING__", "__", this
												.getPage().getIdForRendering(
														loDimensionFilterComponent
																.getName())),
								sap.zen.PlaceHolderType.STRING, "X",
								sap.zen.PlaceHolderType.STRING);
				loScriptSequence.add(loScriptSequenceItem);
			}
			lScript = loScriptSequence.createScript(this.getPage());
		}
		return lScript;
	};
