	sap.zen.FilterBarClassicControl.prototype.removeDimFilter = function(
			dataSourceName, dimensionName) {
		var loDataSource = this.getPage().getDataSource(dataSourceName);
		var ltChildrenToRemove = oFF.XList.create();
		var lChildIndex;
		var loDimensionFilterComponent;
		for (lChildIndex = 0; lChildIndex < this.tChildren.size(); lChildIndex++) {
			loDimensionFilterComponent = this.tChildren.get(lChildIndex);
			if (oFF.isNull(loDimensionFilterComponent)) {
				continue;
			}
			if (oFF.XString.isEqual(loDimensionFilterComponent.getDataSource()
					.getName(), dataSourceName)
					&& oFF.XString.isEqual(loDimensionFilterComponent
							.getDimensionKey(), dimensionName)) {
				ltChildrenToRemove.add(loDimensionFilterComponent);
			}
		}
		for (lChildIndex = 0; lChildIndex < ltChildrenToRemove.size(); lChildIndex++) {
			this.removeChild(ltChildrenToRemove.get(lChildIndex));
		}
	};
