	sap.zen.Html5ChartControl.prototype.setSelectionByJson = function(
			oJsonObject) {
		var loJsonParser;
		var loJsonRootElement;
		var loJsonStructure;
		var loJsonListSelectedMembers;
		var lSize;
		var lSelectedMemberIndex;
		var loJsonElementSelectedMember;
		var loJsonStructureSelectedElement;
		var lDimension;
		var lValue;
		var loMember;
		this.setAllMemberListByJson(oJsonObject);
		if (oJsonObject.isString() === true) {
			loJsonParser = this.getJsonParser();
			loJsonRootElement = loJsonParser.parse(oJsonObject.getString());
			loJsonStructure = loJsonRootElement.asStructure();
			this.tMembers = oFF.XList.create();
			loJsonListSelectedMembers = loJsonStructure
					.getListByKey("selectedMembers");
			lSize = loJsonListSelectedMembers.size();
			for (lSelectedMemberIndex = 0; lSelectedMemberIndex < lSize; lSelectedMemberIndex++) {
				loJsonElementSelectedMember = loJsonListSelectedMembers
						.get(lSelectedMemberIndex);
				if (oFF.isNull(loJsonElementSelectedMember)) {
					continue;
				}
				loJsonStructureSelectedElement = loJsonElementSelectedMember
						.asStructure();
				lDimension = loJsonStructureSelectedElement
						.getStringByKey("dimension");
				lValue = loJsonStructureSelectedElement.getStringByKey("value");
				loMember = sap.zen.Member.create(lDimension, lValue);
				this.tMembers.add(loMember);
			}
		}
		this.onSelect();
	};
	sap.zen.Html5ChartControl.prototype.setAllMemberList = function(oObject) {
		this.setAllMemberListByJson(sap.buddha.XJsonObject.create(oObject));
	};
	sap.zen.Html5ChartControl.prototype.setAllMemberListByJson = function(
			oJsonObject) {
		var loJsonParser = this.getJsonParser();
		var loJsonRootElement = loJsonParser.parse(oJsonObject.getString());
		var loJsonStructure = loJsonRootElement.asStructure();
		var loJsonStructureAllSelection;
		var ltAllSelectionNames;
		var lAllSelectionIndex;
		var lSelectionName;
		var loJsonListDimension;
		this.tAllMembers = oFF.XHashMapByString.create();
		loJsonStructureAllSelection = loJsonStructure
				.getStructureByKey("allSelection");
		ltAllSelectionNames = loJsonStructureAllSelection
				.getKeysAsReadOnlyListOfString();
		for (lAllSelectionIndex = 0; lAllSelectionIndex < ltAllSelectionNames
				.size(); lAllSelectionIndex++) {
			lSelectionName = ltAllSelectionNames.get(lAllSelectionIndex);
			if (oFF.isNull(lSelectionName)) {
				continue;
			}
			loJsonListDimension = loJsonStructureAllSelection
					.getListByKey(lSelectionName);
			this.tAllMembers.put(lSelectionName, loJsonListDimension);
		}
	};
