	sap.zen.Html5ChartControl.prototype.getSelectedMember = function(
			dimensionName) {
		var loScriptableMember = null;
		var lMemberIndex;
		var loMember;
		if ((oFF.isNull(this.tMembers)) || (this.tMembers.size() === 0)) {
			loScriptableMember = sap.zen.ScriptableMember
					.createForDimensionMemberName("");
			return loScriptableMember;
		}
		for (lMemberIndex = 0; lMemberIndex < this.tMembers.size(); lMemberIndex++) {
			loMember = this.tMembers.get(lMemberIndex);
			if (oFF.isNull(loMember)) {
				continue;
			}
			if (oFF.XString.isEqual(loMember.getKey(), dimensionName)) {
				loScriptableMember = sap.zen.ScriptableMember
						.createForDimensionMemberName(loMember.getValue());
				return loScriptableMember;
			}
		}
		return null;
	};
	sap.zen.Html5ChartControl.prototype.getSelectedMembers = function(
			dimensionName) {
		var ltMembers;
		var loListMembers;
		var lListIndex;
		var loStructureMember;
		var loScriptableMember;
		if (this.tAllMembers.isEmpty()
				|| this.tAllMembers.getByKey(dimensionName) === null) {
			return this.getPage().getWindow().createJSArray(oFF.XList.create());
		}
		ltMembers = oFF.XList.create();
		loListMembers = this.tAllMembers.getByKey(dimensionName);
		for (lListIndex = 0; lListIndex < loListMembers.size(); lListIndex++) {
			loStructureMember = loListMembers.getStructureAt(lListIndex);
			if (oFF.isNull(loStructureMember)) {
				continue;
			}
			loScriptableMember = sap.zen.ScriptableMember
					.createForDimensionMemberName(loStructureMember
							.getStringByKey("key"));
			ltMembers.add(loScriptableMember);
		}
		return this.getPage().getWindow().createJSArray(ltMembers);
	};
