	sap.zen.Html5ChartControl.prototype.renderNodeAsJSON = function(oNode,
			oRenderSerializer, name) {
		var tPropertyNodes;
		var lPropertyNodeIndex;
		var loPropertyNode;
		if (oFF.isNull(name)) {
			name = oNode.getAttribute("name");
		}
		tPropertyNodes = oNode.getChildren("property");
		if (tPropertyNodes.size() > 0) {
			oRenderSerializer.openTag(name);
			for (lPropertyNodeIndex = 0; lPropertyNodeIndex < tPropertyNodes
					.size(); lPropertyNodeIndex++) {
				loPropertyNode = tPropertyNodes.get(lPropertyNodeIndex);
				if (oFF.isNull(loPropertyNode)) {
					continue;
				}
				this.renderNodeAsJSON(loPropertyNode, oRenderSerializer, null);
			}
			oRenderSerializer.closeTag();
		} else {
			if (oFF.XString.isEqual(oNode.getAttribute("value"), "X")) {
				oRenderSerializer.addBooleanAttribute(name, true);
			} else {
				oRenderSerializer.addAttribute(name, oNode
						.getAttribute("value"));
			}
		}
	};
	sap.zen.Html5ChartControl.prototype.getNewChartOption = function(path) {
		var lValue = null;
		var ltPath = this.getNewChartOptionsPaths(path);
		var loChartTypeNode = this.getChartTypeNode(true);
		if (oFF.notNull(loChartTypeNode)) {
			loChartTypeNode = this.getNodeValue(loChartTypeNode, ltPath);
			if (oFF.notNull(loChartTypeNode)) {
				lValue = loChartTypeNode.getAttribute("value");
			}
		}
		return lValue;
	};
	sap.zen.Html5ChartControl.prototype.addToNewChartOptionsXml = function(
			path, value) {
		var loChartTypeNode = this.getChartTypeNode(true);
		var loNode;
		if (oFF.notNull(loChartTypeNode)) {
			loNode = this.findOrCreateNode(loChartTypeNode, this
					.getNewChartOptionsPaths(path));
			loNode.setAttribute("value", value);
		}
	};
	sap.zen.Html5ChartControl.prototype.getNewChartOptionsPaths = function(path) {
		var ltPath = oFF.XStringTokenizer.splitString(path, ".");
		ltPath.insert(0, "properties");
		return ltPath;
	};
	sap.zen.Html5ChartControl.prototype.getChartTypeNode = function(create) {
		var loChartTypeNode = null;
		var loTypeNode;
		var lChartType;
		var ltPath;
		if (this.getPropertyNode("TYPE") === null) {
			this.setStringProperty("TYPE", this.getChartType());
		}
		loTypeNode = this.getPropertyNode("TYPE");
		lChartType = loTypeNode.getAttribute("value");
		loChartTypeNode = loTypeNode.getFirstChildWithNameTag(lChartType);
		if (oFF.isNull(loChartTypeNode) && create) {
			ltPath = oFF.XListOfString.create();
			ltPath.add(lChartType);
			loChartTypeNode = this.createNodes(loTypeNode, ltPath);
		}
		return loChartTypeNode;
	};
	sap.zen.Html5ChartControl.prototype.findOrCreateNode = function(oNode,
			tPath) {
		var lNodeName = tPath.get(0);
		var loNode = this.findNodeWithName(oNode, lNodeName);
		if (oFF.isNull(loNode)) {
			loNode = this.createNodes(oNode, tPath);
		} else {
			if (tPath.size() > 1) {
				tPath.removeAt(0);
				loNode = this.findOrCreateNode(loNode, tPath);
			}
		}
		return loNode;
	};
	sap.zen.Html5ChartControl.prototype.getNodeValue = function(oParentNode,
			tPath) {
		var lNodeName = tPath.get(0);
		var loNode = this.findNodeWithName(oParentNode, lNodeName);
		if (oFF.notNull(loNode) && tPath.size() > 1) {
			tPath.removeAt(0);
			loNode = this.getNodeValue(loNode, tPath);
		}
		return loNode;
	};
	sap.zen.Html5ChartControl.prototype.createNodes = function(oParentNode,
			tPath) {
		var lNodeName = tPath.get(0);
		var loNode = oParentNode.createChildWithNameTag(lNodeName);
		if (tPath.size() > 1) {
			tPath.removeAt(0);
			loNode = this.createNodes(loNode, tPath);
		}
		return loNode;
	};
	sap.zen.Html5ChartControl.prototype.findNodeWithName = function(
			oParentNode, name) {
		var loNode = null;
		var ltPropertyNodes = oParentNode.getChildren("property");
		var lPropertyNodeIndex;
		var loPropertyNode;
		for (lPropertyNodeIndex = 0; lPropertyNodeIndex < ltPropertyNodes
				.size()
				&& oFF.isNull(loNode); lPropertyNodeIndex++) {
			loPropertyNode = ltPropertyNodes.get(lPropertyNodeIndex);
			if (oFF.isNull(loPropertyNode)) {
				continue;
			}
			if (oFF.XString.isEqual(name, loPropertyNode.getAttribute("name"))) {
				loNode = loPropertyNode;
			}
		}
		return loNode;
	};
