	sap.zen.ImageTableControl.prototype.renderControlContent = function(
			renderManager) {
		var loDataSource = this.getDataSource();
		var loQueryManager;
		var loQueryModel;
		var lDimensionName;
		var loDimension;
		var loRenderSerializer;
		var loResultSet;
		var lAmountOfTuples;
		var lTupleIndex;
		var loTupleWrapper;
		var loTupleElementWrapper;
		var loDimensionMember;
		var lDimensionMemberName;
		if (oFF.isNull(loDataSource)) {
			return;
		}
		loQueryManager = loDataSource.getQueryManager();
		if (oFF.isNull(loQueryManager)) {
			return;
		}
		loQueryModel = loQueryManager.getQueryModel();
		if (oFF.isNull(loQueryModel)) {
			return;
		}
		lDimensionName = this
				.getStringPropertyWithDefault("DIMENSION_NAME", "");
		loDimension = sap.zen.Dimension.sGetDimension(this.getDataSource(),
				lDimensionName);
		if (oFF.isNull(loDimension)) {
			return;
		}
		loRenderSerializer = renderManager.getRenderSerializer();
		sap.zen.DataSourceScriptApiUtils.logGetResultSet(this.getPage(),
				loQueryManager, "ImageTableControl renderControlContent");
		loResultSet = this.getDataSource().getResultSet();
		lAmountOfTuples = loResultSet
				.getAmountOfTuplesOnAxis(oFF.AxisType.ROWS);
		loRenderSerializer.openArray("images");
		for (lTupleIndex = 0; lTupleIndex < lAmountOfTuples; lTupleIndex++) {
			loTupleWrapper = loResultSet.getTuple(oFF.AxisType.ROWS,
					lTupleIndex, null, null);
			if (oFF.isNull(loTupleWrapper)) {
				continue;
			}
			loTupleElementWrapper = loTupleWrapper.getTupleElement(-1,
					loDimension);
			loDimensionMember = loTupleElementWrapper.getDimensionMember();
			lDimensionMemberName = loDimensionMember.getName();
			if (oFF.XString.size(lDimensionMemberName) > 0) {
				loRenderSerializer.openJsonTag();
				loRenderSerializer.addAttribute("image", lDimensionMemberName);
				loRenderSerializer.closeJsonTag();
			}
		}
		loRenderSerializer.closeArray();
		loRenderSerializer.addBooleanAttribute("enabled", this.isEnabled());
	};
