	sap.zen.PagebookControl.prototype.mapCachingMode = function(cachingMode) {
		if (oFF.XString.isEqual(cachingMode, "NONE")) {
			cachingMode = "none";
		}
		if (oFF.XString.isEqual(cachingMode, "ADJACENT")) {
			cachingMode = "adjacent";
		}
		if (oFF.XString.isEqual(cachingMode, "ALL")) {
			cachingMode = "all";
		}
		return cachingMode;
	};
	sap.zen.PagebookControl.prototype.renderControlContent = function(
			renderManager) {
		var loRenderSerializer = renderManager.getRenderSerializer();
		var lSelectedPageIndex;
		this.setContentChangedAccordingToCaching();
		lSelectedPageIndex = this
				.renderControlSpecificContent(loRenderSerializer);
		loRenderSerializer.openArray("content");
		this.renderChildren(renderManager);
		loRenderSerializer.closeArray();
	};
	sap.zen.PagebookControl.prototype.renderControlSpecificContent = function(
			oRenderSerializer) {
		var lSelectedPageIndex = this.getSelectedPageIndex();
		var transitionDirection;
		var lTransitionEffect;
		var lCommand;
		var lScriptAction;
		oRenderSerializer.addIntegerAttribute("selectedpageindex",
				lSelectedPageIndex);
		oRenderSerializer.addAttribute("cachingmode", this.mapCachingMode(this
				.getCachingMode()));
		transitionDirection = this.getTransitionDirection();
		if (oFF.XString.isEqual(transitionDirection, "horizontal")) {
			oRenderSerializer.addAttribute("transitiondirection", "horizontal");
		} else {
			oRenderSerializer.addAttribute("transitiondirection", "vertical");
		}
		lTransitionEffect = this.getTransitionEffect();
		if (oFF.XString.isEqual(lTransitionEffect, "SLIDE_IN")) {
			oRenderSerializer.addAttribute("transitioneffect", "slide_in");
		} else {
			if (oFF.XString.isEqual(lTransitionEffect, "FADE")) {
				oRenderSerializer.addAttribute("transitioneffect", "fade");
			} else {
				if (oFF.XString.isEqual(lTransitionEffect, "FLIP")) {
					oRenderSerializer.addAttribute("transitioneffect", "flip");
				} else {
					if (oFF.XString.isEqual(lTransitionEffect, "CUBE")) {
						oRenderSerializer.addAttribute("transitioneffect",
								"cube");
					} else {
						oRenderSerializer.addAttribute("transitioneffect",
								"none");
					}
				}
			}
		}
		oRenderSerializer.addBooleanAttribute("indexWasSetByScript",
				this.indexWasSetByScript);
		this.indexWasSetByScript = false;
		oRenderSerializer.addBooleanAttribute("scriptWillBeExecuted",
				oFF.XString.size(this.getOnSelect()) > 0);
		if (this.isPageIndicatorVisibilty() === true) {
			oRenderSerializer.addBooleanAttribute("showpageindicator", this
					.isPageIndicatorVisibilty());
		}
		if (this.isEnabled() === false) {
			oRenderSerializer.addBooleanAttribute("enabled", this.isEnabled());
		}
		oRenderSerializer.addBooleanAttribute("enableswiping", this
				.getBooleanPropertyWithDefault("ENABLE_SWIPING", true));
		lCommand = oFF.XStringUtils.concatenate2(this.getId(),
				".setSelectedPageIndexByUi(__arguments__);");
		lScriptAction = this.createScriptAction(lCommand, "__KEY__");
		oRenderSerializer.addAttribute("command", lScriptAction);
		return lSelectedPageIndex;
	};
