		loDataSource = this.getDataSource();
		if (oFF.notNull(loDataSource)) {
			loRenderSerializer.addAttribute("DATA_SOURCE_ALIAS_REF",
					loDataSource.getName());
		}
		ltProjectionInformation = oFF.XList.create();
		if (oFF.notNull(this.oFactory.properties)) {
			loPropertyNodeIterator = this.oFactory.properties.getIterator();
			while (loPropertyNodeIterator.hasNext()) {
				loPropertyNode = loPropertyNodeIterator.next();
				lPropertyID = loPropertyNode.getAttribute("id");
				lPropertyType = loPropertyNode.getAttribute("type");
				if (oFF.XString.isEqual("Array", lPropertyType)) {
					realArrayNode = this.getPropertyNode(lPropertyID);
					if (oFF.notNull(realArrayNode)) {
						arrayEntryPropertyNode = loPropertyNode
								.getFirstChildWoBiNameSpace("property");
						if (oFF.notNull(arrayEntryPropertyNode)) {
							arrayEntryType = arrayEntryPropertyNode
									.getAttribute("type");
							realArrayEntries = realArrayNode
									.getChildren("property");
							expectedProps = oFF.XHashMapOfStringByString
									.create();
							if (oFF.XString.isEqual("Object", arrayEntryType)) {
								loRenderSerializer.openArray(lPropertyID);
								objectProperties = arrayEntryPropertyNode
										.getChildrenWoBiNameSpace("property");
								objectPropertiesIterator = objectProperties
										.getIterator();
								while (objectPropertiesIterator.hasNext()) {
									objectProperty = objectPropertiesIterator
											.next();
									expectedProps.put(objectProperty
											.getAttribute("id"), objectProperty
											.getAttribute("type"));
								}
								realArrayEntriesIterator = realArrayEntries
										.getIterator();
								while (realArrayEntriesIterator.hasNext()) {
									realArrayEntry = realArrayEntriesIterator
											.next();
									loRenderSerializer.openJsonTag();
									realEntryProperties = realArrayEntry
											.getChildren("property");
									realEntryPropertiesIterator = realEntryProperties
											.getIterator();
									while (realEntryPropertiesIterator
											.hasNext()) {
										realEntryProperty = realEntryPropertiesIterator
												.next();
										entryName = realEntryProperty
												.getAttribute("name");
										entryValue = realEntryProperty
												.getAttribute("value");
										if (expectedProps
												.containsKey(entryName)) {
											expectedType = expectedProps
													.getByKey(entryName);
											if (oFF.XString.isEqual("boolean",
													expectedType)) {
												loRenderSerializer
														.addBooleanAttribute(
																entryName,
																this
																		.makeBooleanPropertyWithDefault(
																				entryValue,
																				false));
											} else {
												if (oFF.XString.isEqual("int",
														expectedType)) {
													loRenderSerializer
															.addIntegerAttribute(
																	entryName,
																	oFF.XInteger
																			.convertFromStringWithDefault(
																					entryValue,
																					0));
												} else {
													if (oFF.XString.isEqual(
															"float",
															expectedType)) {
														loRenderSerializer
																.addDoubleAttribute(
																		entryName,
																		oFF.XDouble
																				.convertFromStringWithDefault(
																						entryValue,
																						0));
													} else {
														if (oFF.XString
																.isEqual("Url",
																		expectedType)) {
															entryValue = this
																	.translateUrl(entryValue);
														}
														loRenderSerializer
																.addAttribute(
																		entryName,
																		entryValue);
													}
												}
											}
										}
									}
									loRenderSerializer.closeJsonTag();
								}
								loRenderSerializer.closeArray();
							}
						}
					}
				} else {
					jsPropertyName = lPropertyID;
					value = this.getStringPropertyWithDefault(lPropertyID, "");
					if (oFF.XString.isEqual("ScriptText", lPropertyType)) {
						dummy = 42;
					} else {
						if (oFF.XString.isEqual("ResultCellSet", lPropertyType)
								|| oFF.XString.isEqual("ResultCellList",
										lPropertyType)
								|| oFF.XString.isEqual("ResultCell",
										lPropertyType)
								|| oFF.XString.isEqual("ResultSet",
										lPropertyType)) {
							projectionInformation = this
									.getProjectionInformation(jsPropertyName,
											value, loPropertyNode);
							if (projectionInformation.isFillMetadataProperty()) {
								ltProjectionInformation
										.add(projectionInformation);
							} else {
								if (this.getDataSource() !== null) {
									projectionInformations = oFF.XList.create();
									projectionInformations
											.add(projectionInformation);
									this.getDataSource()
											.renderResultSetAsJSONs(
													renderManager,
													projectionInformations,
													false);
								}
							}
						} else {
							if (oFF.XString.isEqual("Url", lPropertyType)) {
								loRenderSerializer.addAttribute(jsPropertyName,
										this.translateUrl(value));
							} else {
								if (oFF.XString.isEqual("boolean",
										lPropertyType)) {
									bVal = this.getBooleanPropertyWithDefault(
											lPropertyID, false);
									loRenderSerializer.addBooleanAttribute(
											jsPropertyName, bVal);
								} else {
									if (oFF.XString.isEqual("int",
											lPropertyType)) {
										intValue = this
												.getIntPropertyWithDefault(
														lPropertyID, 0);
										loRenderSerializer.addIntegerAttribute(
												jsPropertyName, intValue);
									} else {
										if (oFF.XString.isEqual("float",
												lPropertyType)) {
											doubleValue = this
													.getDoublePropertyWithDefault(
															lPropertyID, 0);
											loRenderSerializer
													.addDoubleAttribute(
															jsPropertyName,
															doubleValue);
										} else {
											stringValue = value;
											loRenderSerializer
													.addAttribute(
															jsPropertyName,
															stringValue);
										}
									}
								}
							}
						}
					}
				}
			}
		}
