	sap.zen.SmartlayoutControl.prototype.addTop = function(oComponent,
			changeOrientation, oSmartLayoutControl) {
		var lUid;
		var loNewSmartLayout;
		var lIndex;
		var loNewSmartLayout1;
		var byIndex;
		var loNewSmartLayout2;
		if (this.tChildren.size() === 0) {
			this.tChildren.insert(0, oComponent);
			oComponent.setParent(this);
			this.setContentChanged(true);
		} else {
			lUid = oFF.XStringUtils.concatenate2("SML_", oFF.XIntegerValue
					.create(sap.zen.SmartlayoutControl.number).toString());
			if (!changeOrientation && this.tChildren.size() > 1) {
				loNewSmartLayout = this.getPage()
						.createComponentObjectWOInitParameter(
								"SMARTLAYOUT_COMPONENT", lUid, this);
				loNewSmartLayout.addChild(oComponent);
				oComponent.setParent(loNewSmartLayout);
				loNewSmartLayout.setContentChanged(true);
				sap.zen.SmartlayoutControl.number++;
				if (oFF.XString.isEqual(oSmartLayoutControl.getId(), this
						.getId())) {
					this.tChildren.insert(0, loNewSmartLayout);
				} else {
					lIndex = this.tChildren.getIndex(oSmartLayoutControl);
					if (lIndex === -1) {
						lIndex = 0;
					}
					this.tChildren.insert(lIndex, loNewSmartLayout);
				}
				loNewSmartLayout.setParent(this);
				this.setContentChangedRecursive();
			} else {
				loNewSmartLayout1 = this.getPage()
						.createComponentObjectWOInitParameter(
								"SMARTLAYOUT_COMPONENT", lUid, this);
				byIndex = this.tChildren.get(0);
				loNewSmartLayout1.addChild(byIndex);
				byIndex.setParent(loNewSmartLayout1);
				sap.zen.SmartlayoutControl.number++;
				lUid = oFF.XStringUtils.concatenate2("SML_", oFF.XIntegerValue
						.create(sap.zen.SmartlayoutControl.number).toString());
				loNewSmartLayout2 = this.getPage()
						.createComponentObjectWOInitParameter(
								"SMARTLAYOUT_COMPONENT", lUid, this);
				loNewSmartLayout2.addChild(oComponent);
				oComponent.setParent(loNewSmartLayout2);
				sap.zen.SmartlayoutControl.number++;
				this.tChildren.removeAt(0);
				this.addChild(loNewSmartLayout2);
				this.addChild(loNewSmartLayout1);
				loNewSmartLayout2.setParent(this);
				loNewSmartLayout1.setParent(this);
				this.setContentChangedRecursive();
			}
		}
	};
