	sap.zen.SmartlayoutControl.prototype.removeChild = function(oComponent) {
		var loSmartLayoutControl;
		var lIndex;
		var loOtherSmartLayoutControl;
		var loChildIteratorOfOtherSmartLayoutControl;
		var lChangeInOrientation;
		var loSmartLayoutControlParent;
		if (!(oComponent.isSmartLayout()) || this.tChildren.size() > 2) {
			sap.zen.ContainerComponent.prototype.removeChild.call(this,
					oComponent);
		} else {
			if (this.tChildren.size() === 2) {
				loSmartLayoutControl = oComponent;
				lIndex = this.tChildren.getIndex(loSmartLayoutControl);
				if (lIndex === 0) {
					loOtherSmartLayoutControl = this.tChildren.get(1);
				} else {
					loOtherSmartLayoutControl = this.tChildren.get(0);
				}
				this.tChildren.clear();
				loChildIteratorOfOtherSmartLayoutControl = loOtherSmartLayoutControl.tChildren
						.getIterator();
				lChangeInOrientation = !oFF.XString.isEqual(this
						.getOrientation(), loOtherSmartLayoutControl
						.getOrientation());
				this.setOrientation(loOtherSmartLayoutControl.getOrientation());
				loSmartLayoutControlParent = this;
				if (this.getParent().isSmartLayout()) {
					if (oFF.XString.isEqual(this.getOrientation(), this
							.getParent().getOrientation())) {
						this.getParent().tChildren.removeElement(this);
						this.getParent().setContentChangedRecursive();
						loSmartLayoutControlParent = this.getParent();
					}
				}
				while (loChildIteratorOfOtherSmartLayoutControl.hasNext()) {
					if (oFF.XString.isEqual(loOtherSmartLayoutControl
							.getOrientation(), "VERTICAL")) {
						loSmartLayoutControlParent
								.addTop(
										loChildIteratorOfOtherSmartLayoutControl
												.next(), lChangeInOrientation,
										loSmartLayoutControlParent);
					} else {
						loSmartLayoutControlParent
								.addRight(
										loChildIteratorOfOtherSmartLayoutControl
												.next(), lChangeInOrientation,
										loSmartLayoutControlParent);
					}
				}
				this.setContentChangedRecursive();
			}
		}
	};
