	sap.zen.ContentAreaControl.prototype.setSize = function(size) {
		var lOffset;
		var lLength;
		var lSubstring;
		var lSize;
		var lContentSize;
		var lUnitOfSize;
		if (oFF.XStringUtils.isNotNullAndNotEmpty(size)) {
			lOffset = 0;
			lLength = oFF.XString.size(size);
			for (lOffset = 0; lOffset < lLength; lOffset++) {
				lSubstring = oFF.XString.substring(size, 0, lOffset + 1);
				try {
					lSize = oFF.XInteger.convertFromString(lSubstring);
				} catch (loException) {
					break;
				}
			}
			lContentSize = oFF.XString.substring(size, 0, lOffset);
			lUnitOfSize = oFF.XString.substring(size, lOffset, -1);
			if (oFF.XString.containsString(lUnitOfSize, "px")) {
				lUnitOfSize = "px";
			} else {
				if (oFF.XString.containsString(lUnitOfSize, "%")) {
					lUnitOfSize = "%";
				} else {
					if (oFF.XString.containsString(lUnitOfSize, "auto")) {
						lContentSize = "auto";
						lUnitOfSize = this.getUnitOfSize();
					} else {
						lUnitOfSize = this.getUnitOfSize();
					}
				}
			}
			if (oFF.XStringUtils.isNullOrEmpty(lContentSize)) {
				lContentSize = "0";
			}
			this.setStringProperty(sap.zen.CSplitterControl.CONTENT_SIZE
					.getMetadataPropertyName(), lContentSize);
			this.setStringProperty(sap.zen.CSplitterControl.UNIT_OF_SIZE
					.getMetadataPropertyName(), lUnitOfSize);
		}
		this.setContentChangedRecursive();
	};
