	sap.zen.SplitterControl.prototype.onResize = function(value) {
		var ltSizes = this.parseJsonFromEventOnResize(value);
		var lIndex = 0;
		var lChildIndex;
		var loContentArea;
		var lSize;
		for (lChildIndex = 0; lChildIndex < ltSizes.size(); lChildIndex++) {
			loContentArea = this.getContentArea(lChildIndex);
			if (oFF.isNull(loContentArea)) {
				continue;
			}
			if (loContentArea.isVisible()) {
				lSize = ltSizes.get(lIndex);
				if (oFF.notNull(lSize)) {
					loContentArea.setSize(lSize);
				}
				lIndex = lIndex + 1;
			}
		}
	};
	sap.zen.SplitterControl.prototype.parseJsonFromEventOnResize = function(
			jsonString) {
		var ltSizes = oFF.XListOfString.create();
		var loJsonParser = this.getJsonParser();
		var loJsonObject = loJsonParser.parse(jsonString);
		var loJsonElement = loJsonObject.asStructure().getByKey("tNewSizes");
		var loJsonList;
		var lListIndex;
		var lSize;
		if (oFF.notNull(loJsonElement)) {
			loJsonList = loJsonElement.asList();
			for (lListIndex = 0; lListIndex < loJsonList.size(); lListIndex++) {
				loJsonElement = loJsonList.get(lListIndex);
				if (oFF.isNull(loJsonElement)) {
					continue;
				}
				lSize = null;
				if (loJsonElement.isString()) {
					lSize = loJsonElement.asString().getString();
				} else {
					if (loJsonElement.isDouble()) {
						lSize = oFF.XInteger.convertToString(loJsonElement
								.asDouble().getInteger());
					} else {
						if (loJsonElement.isInteger()) {
							lSize = oFF.XInteger.convertToString(loJsonElement
									.asInteger().getInteger());
						} else {
							if (loJsonElement.isLong()) {
								lSize = oFF.XInteger
										.convertToString(loJsonElement.asLong()
												.getInteger());
							} else {
								if (loJsonElement.isNumeric()) {
									lSize = oFF.XInteger
											.convertToString(loJsonElement
													.asNumber().getInteger());
								}
							}
						}
					}
				}
				if (oFF.XStringUtils.isNotNullAndNotEmpty(lSize)) {
					ltSizes.add(lSize);
				}
			}
		}
		return ltSizes;
	};
