	sap.zen.TabstripControl.prototype.setSelectedTab = function(value) {
		this.setSelectedTabByName(value);
	};
	sap.zen.TabstripControl.prototype.isSelectedIndexAlsoEnabled = function(
			tabIndex) {
		var loTabControl;
		if ((tabIndex < 0) || (tabIndex >= this.tChildren.size())) {
			return false;
		}
		if (this.getPage().isDesignMode()) {
			return true;
		}
		loTabControl = this.tChildren.get(tabIndex);
		return loTabControl.isEnabled();
	};
	sap.zen.TabstripControl.prototype.correctIndexIfNeeded = function(
			selectedTabIndex) {
		var lIsEnabled;
		var lMaxCounter;
		if (this.tChildren.size() === 0) {
			return selectedTabIndex;
		}
		lIsEnabled = this.isSelectedIndexAlsoEnabled(selectedTabIndex);
		lMaxCounter = 0;
		if (!lIsEnabled) {
			while (!lIsEnabled) {
				selectedTabIndex++;
				if (selectedTabIndex >= this.tChildren.size()) {
					selectedTabIndex = 0;
				}
				lIsEnabled = this.isSelectedIndexAlsoEnabled(selectedTabIndex);
				lMaxCounter++;
				if (lMaxCounter >= this.tChildren.size()) {
					lIsEnabled = true;
				}
			}
		}
		return selectedTabIndex;
	};
	sap.zen.TabstripControl.prototype.setContentChangedAccordingToCaching = function(
			oldPage) {
		var lChildIndex;
		var loComponent;
		for (lChildIndex = 0; lChildIndex < this.tChildren.size(); lChildIndex++) {
			loComponent = this.tChildren.get(lChildIndex);
			if (oFF.isNull(loComponent)) {
				continue;
			}
			if (lChildIndex === this.getSelectedTabIndex()) {
				if (oldPage !== lChildIndex) {
					loComponent.setContentChangedRecursive();
				} else {
					loComponent.setContentChanged(true);
				}
			} else {
				loComponent.setContentChanged(true);
			}
		}
		this.setContentChanged(true);
	};
	sap.zen.TabstripControl.prototype.getUsedDataSourcesByDummyRendering = function(
			list) {
		var lSelectedPageIndex;
		var lChildIndex;
		var loComponent;
		if (this.isVisible()) {
			this.createChildrenRegardingChildItemRefList();
			lSelectedPageIndex = this.correctIndexIfNeeded(this
					.getSelectedTabIndex());
			for (lChildIndex = 0; lChildIndex < this.tChildren.size(); lChildIndex++) {
				loComponent = this.tChildren.get(lChildIndex);
				if (oFF.isNull(loComponent)) {
					continue;
				}
				if (lChildIndex === lSelectedPageIndex) {
					if (loComponent.isVisible() === true) {
						if (this.isContentChanged()) {
							if (!(loComponent.hasChildrenContentChanged() || loComponent
									.isContentChanged())) {
								continue;
							}
						}
						loComponent.getUsedDataSourcesByDummyRendering(list);
					}
				}
			}
		}
	};
