	sap.zen.ZCrosstabControl.prototype.renderControlContent = function(
			renderManager) {
		var loRenderSerializer;
		var loDisplayArea;
		var lMessageCollection;
		var lMessage;
		var loServerPaging;
		var lError;
		if (!this.isDataSourceAvailable()) {
			return;
		}
		loRenderSerializer = renderManager.getRenderSerializer();
		this.oResultSet = this.getResultSet();
		if (this.verticalScrollPosition >= this.oResultSet.getAmountOfRows()) {
			this.setVerticalScrollPosition(0);
		}
		if (this.horizontalScrollPosition >= this.oResultSet
				.getAmountOfColumns()) {
			this.setHorizontalScrollPosition(0);
		}
		this.pixelScrolling = this.isPixelScrollModeActive();
		if (this.pixelScrolling) {
			this.rowsPerRequest = this.getPixelScrollRowLimit();
			this.colsPerRequest = this.getPixelScrollColLimit();
		}
		loDisplayArea = sap.zen.GridDisplayArea.create(
				this.verticalScrollPosition, this.rowsPerRequest,
				this.horizontalScrollPosition, this.colsPerRequest);
		this.oGrid = this.oResultSet.getGrid(true, this
				.getDisplayScalingFactorInHeader(), loDisplayArea);
		if (this.valueUpdated === true) {
			this.renderCheckPlanningValue(loRenderSerializer, this.oGrid
					.getRowHeaders(), this.oGrid.getColumnHeaders());
			this.valueUpdated = false;
			return;
		}
		if (this.selectionRemoved === true) {
			loRenderSerializer.addBooleanAttribute("removeselection", true);
			this.selectionRemoved = false;
			return;
		}
		lMessageCollection = this.getQueryManager().getResultSetMessages();
		if ((oFF.notNull(lMessageCollection)) && lMessageCollection.hasErrors()) {
			lMessage = lMessageCollection.getErrors().get(0);
			if (oFF.notNull(lMessage)) {
				sap.zen.CLocalizationCrosstabMessages.RESULTSET_PARAM_ERROR
						.addMessageToComponent(this, oFF.Severity.ERROR,
								lMessage.getText(), null, null);
			}
		}
		loServerPaging = this.oResultSet.getServerPaging();
		if (loServerPaging.isPagingActive()) {
			loServerPaging.getAxisPaging(oFF.AxisType.ROWS).setPage(
					this.verticalScrollPosition,
					sap.zen.ResultSetAxisPaging.SIZE_DEFAULT);
			loServerPaging.getAxisPaging(oFF.AxisType.COLUMNS).setPage(
					this.horizontalScrollPosition,
					sap.zen.ResultSetAxisPaging.SIZE_DEFAULT);
		}
		if (this.oResultSet.hasErrors()) {
			lError = this.oResultSet.getErrors();
			if (oFF.notNull(lError)) {
				sap.zen.CLocalizationCrosstabMessages.RESULTSET_PARAM_ERROR
						.addMessageToComponent(this, oFF.Severity.ERROR,
								lError, null, null);
			} else {
				sap.zen.CLocalizationCrosstabMessages.RESULTSET_ERROR
						.addMessageToComponent(this, oFF.Severity.ERROR, null,
								null, null);
			}
			this.renderCrosstabEmtpyAndError(loRenderSerializer, "");
			return;
		}
		if ((this.oResultSet.getAmountOfRows() === 0 && this.oResultSet
				.getAmountOfColumns() === 0)
				|| (this.oResultSet.getAmountOfRows() === 0 && this.oResultSet
						.getAmountOfDimensionsOnAxis(oFF.AxisType.ROWS) > 0)
				|| (this.oResultSet.getAmountOfColumns() === 0 && this.oResultSet
						.getAmountOfDimensionsOnAxis(oFF.AxisType.COLUMNS) > 0)) {
			this.renderCrosstabEmtpyAndError(loRenderSerializer, "");
			return;
		}
		loRenderSerializer.addBooleanAttribute("dataproviderchanged", false);
		loRenderSerializer.addBooleanAttribute("displayexceptions", false);
		loRenderSerializer.addBooleanAttribute("resultsetchanged",
				this.resultsetChangedFlag);
		loRenderSerializer
				.addBooleanAttribute(
						"alwaysfill",
						this
								.getBooleanPropertyWithDefault(
										sap.zen.ZCrosstabControlMetadataProvider.CROSSTAB_DISPLAY_ALWAYS_FILL,
										false));
		if (oFF.notNull(this.oRootCause)) {
			this.oRootCause.addToRenderSerializer(loRenderSerializer,
					"rootcause");
		}
		this.renderCrosstab(loRenderSerializer);
		this.renderTextInformation(loRenderSerializer);
		this.renderContextMenuInformation(loRenderSerializer);
		this.renderZebraInformation(loRenderSerializer);
		this.renderScrollInformation(loRenderSerializer);
		this.renderHeaderInformation(loRenderSerializer);
		this.renderHeaderScrollingInformation(loRenderSerializer);
		this.renderColWidthInformation(loRenderSerializer);
		this.renderSelectionInformation(loRenderSerializer);
		this.renderDragDropInformation(loRenderSerializer);
		this.renderPlanningInformation(loRenderSerializer);
		this.scrollPositionChanged = false;
		this.resultsetChangedFlag = false;
	};
