	sap.zen.ZCrosstabControl.prototype.setSelection = function(oSelectionJson) {
		var loJsonObject = sap.buddha.XJsonObject.create(oSelectionJson);
		var lJsonString = loJsonObject.getString();
		var loJsonParser = this.getJsonParser();
		var loJsonElement = loJsonParser.parse(lJsonString);
		var loJsonStructure = loJsonElement.asStructure();
		var ltJsonListSelectedElements;
		var loJsonListSelectedElement;
		var lJsonListSelectedElementIndex;
		var lRowIndex;
		var lColIndex;
		var lFixedRowHeaders;
		var lFixedColHeaders;
		this.oSelectionStore = sap.zen.ZCrosstabSelectionStore.create(
				this.oResultSet, this);
		ltJsonListSelectedElements = loJsonStructure.getListByKey("ROW");
		if (oFF.notNull(ltJsonListSelectedElements)) {
			for (lJsonListSelectedElementIndex = 0; lJsonListSelectedElementIndex < ltJsonListSelectedElements
					.size(); lJsonListSelectedElementIndex++) {
				loJsonListSelectedElement = ltJsonListSelectedElements
						.getStructureAt(lJsonListSelectedElementIndex);
				if (oFF.isNull(loJsonListSelectedElement)) {
					continue;
				}
				lRowIndex = loJsonListSelectedElement.getIntegerByKey("row");
				lColIndex = loJsonListSelectedElement.getIntegerByKey("col");
				lColIndex = this.correctIndexForHiddenDimensions(lColIndex,
						oFF.AxisType.ROWS);
				this.oSelectionStore.collectSelectedTupleElements(
						oFF.AxisType.ROWS, lRowIndex, lColIndex);
			}
		} else {
			ltJsonListSelectedElements = loJsonStructure.getListByKey("COL");
			if (oFF.notNull(ltJsonListSelectedElements)) {
				for (lJsonListSelectedElementIndex = 0; lJsonListSelectedElementIndex < ltJsonListSelectedElements
						.size(); lJsonListSelectedElementIndex++) {
					loJsonListSelectedElement = ltJsonListSelectedElements
							.getStructureAt(lJsonListSelectedElementIndex);
					if (oFF.isNull(loJsonListSelectedElement)) {
						continue;
					}
					lRowIndex = loJsonListSelectedElement
							.getIntegerByKey("row");
					lRowIndex = this.correctIndexForHiddenDimensions(lRowIndex,
							oFF.AxisType.COLUMNS);
					lColIndex = loJsonListSelectedElement
							.getIntegerByKey("col");
					this.oSelectionStore.collectSelectedTupleElements(
							oFF.AxisType.COLUMNS, lRowIndex, lColIndex);
				}
			} else {
				ltJsonListSelectedElements = loJsonStructure
						.getListByKey("DATA");
				if (oFF.notNull(ltJsonListSelectedElements)) {
					loJsonListSelectedElement = ltJsonListSelectedElements
							.getStructureAt(0);
					lRowIndex = loJsonListSelectedElement
							.getIntegerByKey("row");
					lRowIndex = this.correctIndexForHiddenDimensions(lRowIndex,
							oFF.AxisType.COLUMNS);
					lColIndex = loJsonListSelectedElement
							.getIntegerByKey("col");
					lColIndex = this.correctIndexForHiddenDimensions(lColIndex,
							oFF.AxisType.ROWS);
					lFixedRowHeaders = this.oResultSet.getTuple(
							oFF.AxisType.ROWS, 0, null, null)
							.getAmountOfTupleElements() - 1;
					lFixedColHeaders = this.oResultSet.getTuple(
							oFF.AxisType.COLUMNS, 0, null, null)
							.getAmountOfTupleElements() - 1;
					this.oSelectionStore.collectSelectedTupleElements(
							oFF.AxisType.ROWS, lRowIndex, lFixedRowHeaders);
					this.oSelectionStore.collectSelectedTupleElements(
							oFF.AxisType.COLUMNS, lFixedColHeaders, lColIndex);
				} else {
					this.oSelectionStore = null;
				}
			}
		}
		this.onSelect();
	};
	sap.zen.ZCrosstabControl.prototype.correctIndexForHiddenDimensions = function(
			index, axis) {
		var lCorrectIndex = index;
		var ltDimensions = sap.zen.Dimension.sGetAxisDimensions(this
				.getDataSource(), axis);
		var loDimensionIterator = ltDimensions.getIterator();
		var loDimension;
		var lVisible;
		var lMemberDisplay;
		while (loDimensionIterator.hasNext()) {
			loDimension = loDimensionIterator.next();
			if (oFF.isNull(loDimension)) {
				continue;
			}
			lVisible = false;
			lMemberDisplay = loDimension.getProperties().getMemberDisplayMode(
					null);
			if (lMemberDisplay === sap.zen.CMemberDisplayMode.KEY
					|| lMemberDisplay === sap.zen.CMemberDisplayMode.KEY_TEXT
					|| lMemberDisplay === sap.zen.CMemberDisplayMode.TEXT
					|| lMemberDisplay === sap.zen.CMemberDisplayMode.TEXT_KEY) {
				lVisible = true;
			}
			if (!lVisible) {
				lCorrectIndex++;
			}
		}
		return lCorrectIndex;
	};
	sap.zen.ZCrosstabControl.prototype.getSelectedMember = function(
			dimensionName) {
		var loDimensionMember = null;
		var loDimension;
		var ltSelectedTuples;
		var loTuple;
		var lAxisContainsDimension;
		var loTupleElement;
		var loScriptableMember;
		if (oFF.notNull(this.oSelectionStore)) {
			loDimension = sap.zen.Dimension.sGetDimension(this.oResultSet
					.getDataSource(), dimensionName);
			if (oFF.notNull(loDimension)) {
				ltSelectedTuples = this.oSelectionStore.getSelectedTuples();
				if (ltSelectedTuples.size() > 0) {
					loTuple = ltSelectedTuples.get(0);
					lAxisContainsDimension = this
							.selectionAxisContainsRequestedDimension(loTuple,
									dimensionName);
					if (lAxisContainsDimension) {
						loTupleElement = loTuple.getTupleElement(-1,
								loDimension);
						if (oFF.notNull(loTupleElement)) {
							loDimensionMember = loTupleElement
									.getDimensionMember();
						}
					}
				}
			}
		}
		loScriptableMember = null;
		if (oFF.notNull(loDimensionMember)) {
			loScriptableMember = sap.zen.ScriptableMember
					.createForDimensionMember(loDimensionMember);
		} else {
			loScriptableMember = sap.zen.ScriptableMember
					.createForDimensionMemberName("");
		}
		return loScriptableMember;
	};
	sap.zen.ZCrosstabControl.prototype.getSelectedMembers = function(
			dimensionName) {
		var ltScriptableMembers = oFF.XList.create();
		var loDimension = sap.zen.Dimension.sGetDimension(this.oResultSet
				.getDataSource(), dimensionName);
		var ltLookupSetDimensionMembers = oFF.XSetOfNameObject.create();
		var ltSelectedTuples;
		var lTupleIndex;
		var loTuple;
		var lAxisContainsDimension;
		var loTupleElement;
		var loDimensionMember;
		var loScriptableMember;
		if (oFF.notNull(this.oSelectionStore) && oFF.notNull(loDimension)) {
			ltSelectedTuples = this.oSelectionStore.getSelectedTuples();
			for (lTupleIndex = 0; lTupleIndex < ltSelectedTuples.size(); lTupleIndex++) {
				loTuple = ltSelectedTuples.get(lTupleIndex);
				if (oFF.isNull(loTuple)) {
					continue;
				}
				lAxisContainsDimension = this
						.selectionAxisContainsRequestedDimension(loTuple,
								dimensionName);
				if (lAxisContainsDimension) {
					loTupleElement = loTuple.getTupleElement(-1, loDimension);
					if (oFF.notNull(loTupleElement)) {
						loDimensionMember = loTupleElement.getDimensionMember();
						if (oFF.notNull(loDimensionMember)
								&& !ltLookupSetDimensionMembers
										.contains(loDimensionMember)) {
							loScriptableMember = sap.zen.ScriptableMember
									.createForDimensionMember(loDimensionMember);
							ltScriptableMembers.add(loScriptableMember);
							ltLookupSetDimensionMembers.add(loDimensionMember);
						}
					}
				}
			}
		}
		return this.getPage().getWindow().createJSArray(ltScriptableMembers);
	};
