	sap.zen.ZCrosstabControl.prototype.correctIndex = function(axis, index) {
		var lCorrectedIndex = index;
		if (axis === sap.zen.CCrosstabAxis.ROWS) {
			lCorrectedIndex = lCorrectedIndex - this.oGrid.getColumnHeaders();
		} else {
			if (axis === sap.zen.CCrosstabAxis.COLS) {
				lCorrectedIndex = lCorrectedIndex - this.oGrid.getRowHeaders();
			}
		}
		if (lCorrectedIndex < 0) {
			lCorrectedIndex = 0;
		}
		return lCorrectedIndex;
	};
