	sap.zen.MultiDataProviderReferenceComponent.prototype.raiseDataSourceChangedEvent = function() {
		var loDataSource = this.getDataSource();
		var lTargetQueryViewsString;
		var ltTargetDataSourceNames;
		var lDataSourceIndex;
		var lTargetDataSourceName;
		if (oFF.notNull(loDataSource)) {
			loDataSource.raiseDataSourceChangedEvent(null, false, true);
		}
		lTargetQueryViewsString = this.getStringPropertyWithDefault(
				"TARGET_DATA_SOURCES_ALIAS_REF", "");
		ltTargetDataSourceNames = null;
		if (!oFF.XString.isEqual("", lTargetQueryViewsString)) {
			ltTargetDataSourceNames = oFF.XStringTokenizer.splitString(
					lTargetQueryViewsString, ";");
		}
		if (oFF.notNull(ltTargetDataSourceNames)) {
			for (lDataSourceIndex = 0; lDataSourceIndex < ltTargetDataSourceNames
					.size(); lDataSourceIndex++) {
				lTargetDataSourceName = ltTargetDataSourceNames
						.get(lDataSourceIndex);
				if (oFF.isNull(lTargetDataSourceName)) {
					continue;
				}
				loDataSource = this.getPage().getDataSource(
						lTargetDataSourceName);
				loDataSource.raiseDataSourceChangedEvent(null, false, true);
			}
		}
	};
	sap.zen.MultiDataProviderReferenceComponent.prototype.getTargetQueryViews = function(
			tTargetDataSourceNames) {
		var loDataSource = this.getDataSource();
		var lDataSourceName = null;
		var ltTargetQueryModels;
		var lDataSourceIndex;
		var lTargetDataSourceName;
		var loQueryManager;
		if (oFF.notNull(loDataSource)) {
			lDataSourceName = this.getDataSource().getName();
		}
		ltTargetQueryModels = oFF.XList.create();
		for (lDataSourceIndex = 0; lDataSourceIndex < tTargetDataSourceNames
				.size(); lDataSourceIndex++) {
			lTargetDataSourceName = tTargetDataSourceNames
					.get(lDataSourceIndex);
			if (oFF.isNull(lTargetDataSourceName)) {
				continue;
			}
			if (!oFF.XString.isEqual(lTargetDataSourceName, lDataSourceName)) {
				loDataSource = this.getPage().getDataSource(
						lTargetDataSourceName);
				loQueryManager = loDataSource.getQueryManager();
				if (oFF.notNull(loQueryManager)) {
					ltTargetQueryModels.add(loQueryManager.getQueryModel());
				}
			}
		}
		return ltTargetQueryModels;
	};
