	sap.zen.AbstractFilterComponentBase.prototype.recalculate = function() {
	};
	sap.zen.AbstractFilterComponentBase.prototype.doSubmitFilterCommand = function(
			filter, submitString) {
		var lSubmit = false;
		var lDataSourceChange;
		var lValuesOk;
		var loConfigContainer;
		var ltFilterConfig;
		var axis;
		var lFilterConfigIndex;
		var loFilterConfig;
		if (oFF.XString.isEqual(submitString, "X")) {
			lSubmit = true;
			if (this.variableScreen && !this.errorFree) {
				return;
			}
		}
		if (lSubmit) {
			this.validatedFilterConfig = null;
		}
		lDataSourceChange = false;
		lValuesOk = null;
		if (oFF.notNull(filter)) {
			loConfigContainer = this.parseJson(filter);
			ltFilterConfig = loConfigContainer.theFilters;
			axis = loConfigContainer.axisConfig;
			if (oFF.notNull(ltFilterConfig) || oFF.notNull(axis)) {
				lDataSourceChange = true;
				this.recalculate();
			}
			if (oFF.notNull(ltFilterConfig)) {
				for (lFilterConfigIndex = 0; lFilterConfigIndex < ltFilterConfig
						.size(); lFilterConfigIndex++) {
					loFilterConfig = ltFilterConfig.get(lFilterConfigIndex);
					if (oFF.isNull(loFilterConfig)) {
						continue;
					}
					if (lSubmit || this.variableScreen) {
						lValuesOk = this.applyFilterConfig(loFilterConfig,
								lValuesOk);
					} else {
						if (oFF.isNull(this.validatedFilterConfig)) {
							this.validatedFilterConfig = oFF.XHashMapByString
									.create();
						}
						this.validatedFilterConfig.put(loFilterConfig.name,
								this.validateFilterConfig(loFilterConfig));
						this.setContentChanged(true);
					}
				}
				this.view = sap.zen.View.VIEW_DEFAULT;
				this.fireSwitchPageEvent(sap.zen.FilterPage.MAIN);
			}
			if (oFF.notNull(axis)) {
				this.oAxisWrapper
						.applyAxisConfig(axis.theRows, axis.theColumns);
			}
		}
		if (lSubmit && this.variableScreen) {
			lValuesOk = oFF.XBooleanValue.create(true);
		} else {
			lValuesOk = oFF.XBooleanValue.create(this.oCharacteristicContainer
					.checkValues());
		}
		if ((lSubmit === true) && lValuesOk.getBoolean()) {
			if (lSubmit
					&& this.variableScreen
					&& oFF.XStringUtils.isNotNullAndNotEmpty(this.getPage()
							.getApplicationPropertiesComponent()
							.getOnBeforePromptsSubmitScript())) {
				this.getPage().getApplicationPropertiesComponent()
						.execOnBeforePromptsSubmitScript();
			}
			lValuesOk = oFF.XBooleanValue.create(this.oCharacteristicContainer
					.submit());
			if (this.variableScreen && lValuesOk.getBoolean()) {
				if (this.getPage().hasErrors()) {
					lValuesOk = oFF.XBooleanValue.create(false);
					this.forceFullRerendering();
				}
			}
			this.theFilterOrAxisChanged = true;
		}
		this.errorFree = lValuesOk.getBoolean();
		lDataSourceChange = lSubmit && lDataSourceChange;
		this.fireChangeEvent(this.errorFree, lDataSourceChange);
		if (this.variableScreen && lSubmit && this.errorFree) {
			this.setContentChanged(false);
		} else {
			this.setContentChanged(true);
		}
	};
	sap.zen.AbstractFilterComponentBase.prototype.validateFilterConfig = function(
			oConfig) {
		var ltRanges = oFF.XList.create();
		var loCharacteristicWrapper = this.oCharacteristicContainer
				.getElement(oConfig.name);
		var ltFullRanges;
		var lFullRangeIndex;
		var loRange;
		var ltInputValues;
		var lInputValueAsStringIndex;
		if (oFF.notNull(loCharacteristicWrapper)) {
			ltFullRanges = oFF.XList.create();
			lFullRangeIndex = 0;
			loRange = null;
			if (oFF.notNull(oConfig.tFullRanges)
					&& !oConfig.tFullRanges.isEmpty()) {
				ltFullRanges = loCharacteristicWrapper
						.parseFullRangeQuery(oConfig.tFullRanges);
				for (lFullRangeIndex = 0; lFullRangeIndex < ltFullRanges.size(); lFullRangeIndex++) {
					loRange = ltFullRanges.get(lFullRangeIndex);
					if (oFF.isNull(loRange)) {
						continue;
					}
					ltRanges.add(loRange);
				}
			}
			ltInputValues = oFF.XListOfString.create();
			if (oFF.notNull(oConfig.inputValueAsString)) {
				ltInputValues.add(oConfig.inputValueAsString);
			}
			if (oFF.notNull(oConfig.tInputValuesAsString)) {
				for (lInputValueAsStringIndex = 0; lInputValueAsStringIndex < oConfig.tInputValuesAsString
						.size(); lInputValueAsStringIndex++) {
					ltInputValues.add(oConfig.tInputValuesAsString
							.get(lInputValueAsStringIndex));
				}
			}
			if (ltInputValues.hasElements()) {
				ltFullRanges = loCharacteristicWrapper
						.parseInputString(ltInputValues);
				for (lFullRangeIndex = 0; lFullRangeIndex < ltFullRanges.size(); lFullRangeIndex++) {
					loRange = ltFullRanges.get(lFullRangeIndex);
					if (oFF.isNull(loRange)) {
						continue;
					}
					ltRanges.add(loRange);
				}
			}
		}
		return ltRanges;
	};
	sap.zen.AbstractFilterComponentBase.prototype.applyFilterConfig = function(
			oConfig, valuesOk) {
		var loCharacteristicWrapper = this.oCharacteristicContainer
				.getElement(oConfig.name);
		var ltInputValues;
		var lInputValueAsStringIndex;
		var lInputOk;
		var lInputValueIndex;
		if (oFF.isNull(oConfig.inputValueAsString)) {
			loCharacteristicWrapper.resetQuery();
		}
		if (oFF.notNull(oConfig.tFullRanges) && !oConfig.tFullRanges.isEmpty()) {
			loCharacteristicWrapper.setFullRangeQuery(oConfig.tFullRanges);
		}
		ltInputValues = oFF.XListOfString.create();
		if (oFF.notNull(oConfig.inputValueAsString)) {
			ltInputValues.add(oConfig.inputValueAsString);
		}
		if (oFF.notNull(oConfig.tInputValuesAsString)) {
			for (lInputValueAsStringIndex = 0; lInputValueAsStringIndex < oConfig.tInputValuesAsString
					.size(); lInputValueAsStringIndex++) {
				ltInputValues.add(oConfig.tInputValuesAsString
						.get(lInputValueAsStringIndex));
			}
		}
		if (ltInputValues.hasElements()) {
			lInputOk = false;
			if (loCharacteristicWrapper.supportsMultiSelection()) {
				for (lInputValueIndex = 0; lInputValueIndex < ltInputValues
						.size(); lInputValueIndex++) {
					lInputOk = loCharacteristicWrapper
							.addInputString(ltInputValues.get(lInputValueIndex));
				}
			} else {
				lInputOk = loCharacteristicWrapper.setInputString(ltInputValues
						.get(0));
			}
			if (oFF.isNull(valuesOk) || valuesOk.getBoolean()) {
				valuesOk = oFF.XBooleanValue.create(lInputOk);
			}
		}
		if (!this.isContentChanged()) {
			this.filterOrAxisChanged();
			this.setContentChanged(true);
		}
		return valuesOk;
	};
	sap.zen.AbstractFilterComponentBase.prototype.doCancelFilterCommand = function() {
		this.view = sap.zen.View.VIEW_DEFAULT;
		this.fireSwitchPageEvent(sap.zen.FilterPage.MAIN);
		this.theFilterOrAxisChanged = true;
		this.filterCanceled = true;
		this.setContentChanged(true);
	};
	sap.zen.AbstractFilterComponentBase.prototype.doExpandNodeCommand = function(
			node, path) {
		var nodeMember;
		if ((oFF.notNull(node)) && (oFF.notNull(path))
				&& oFF.notNull(this.oFilterDialogFor)) {
			this.view = sap.zen.View.EXPAND_NODE;
			nodeMember = this.oFilterDialogFor.getNode(node);
			this.memberToExpand = new sap.zen.MemberToExpand();
			this.memberToExpand.setPath(path);
			this.memberToExpand.setMember(nodeMember);
			this.setContentChanged(true);
		}
	};
	sap.zen.AbstractFilterComponentBase.prototype.doCreateContextMenuCommand = function(
			contextMenuComponentId, dimensionName, memberName) {
		var loContextMenu = this.getPage().getComponent(contextMenuComponentId);
		var loContextMenuHandler;
		var loCharacteristicWrapper;
		var loMemberWrapper;
		if (oFF.isNull(loContextMenu)) {
			return;
		}
		loContextMenuHandler = null;
		if (oFF.notNull(dimensionName)) {
			loCharacteristicWrapper = this.oCharacteristicContainer
					.getElement(dimensionName);
			if (oFF.notNull(loCharacteristicWrapper)) {
				loContextMenuHandler = loCharacteristicWrapper;
				if (oFF.notNull(memberName)
						&& oFF.XString.compare(memberName, "undefined") !== 0) {
					loMemberWrapper = loCharacteristicWrapper
							.getMember(memberName);
					if (oFF.notNull(loMemberWrapper)) {
						loContextMenuHandler = loMemberWrapper;
					}
				}
			}
		}
		if (oFF.notNull(loContextMenuHandler)) {
			loContextMenuHandler.openContextMenu(loContextMenu, this.getName());
		}
	};
	sap.zen.AbstractFilterComponentBase.prototype.doSetVisiblePrompts = function(
			visiblePrompts) {
		this.getPage().setVisiblePrompts(visiblePrompts);
	};
	sap.zen.AbstractFilterComponentBase.prototype.registerVariableCheckListener = function(
			checkListener) {
		if (oFF.isNull(this.checkListeners)) {
			this.checkListeners = oFF.XList.create();
		}
		if (oFF.notNull(checkListener)) {
			this.checkListeners.add(checkListener);
		}
	};
	sap.zen.AbstractFilterComponentBase.prototype.unregisterVariableCheckListener = function(
			checkListener) {
		if (oFF.isNull(this.checkListeners)) {
			return;
		}
		if (oFF.notNull(checkListener)) {
			this.checkListeners.removeElement(checkListener);
		}
	};
	sap.zen.AbstractFilterComponentBase.prototype.fireChangeEvent = function(
			checkResult, wasSubmit) {
		var lCheckListenerIndex;
		var loCheckListener;
		if (wasSubmit) {
			this.raiseDataSourceChangedEvent();
		}
		if (oFF.isNull(this.checkListeners)) {
			return;
		}
		for (lCheckListenerIndex = 0; lCheckListenerIndex < this.checkListeners
				.size(); lCheckListenerIndex++) {
			loCheckListener = this.checkListeners.get(lCheckListenerIndex);
			if (oFF.isNull(loCheckListener)) {
				continue;
			}
			loCheckListener.check(checkResult);
		}
	};
	sap.zen.AbstractFilterComponentBase.prototype.fireSwitchPageEvent = function(
			oFilterPage) {
		var lCheckListenerIndex;
		var loCheckListener;
		if (oFF.isNull(this.checkListeners)) {
			return;
		}
		for (lCheckListenerIndex = 0; lCheckListenerIndex < this.checkListeners
				.size(); lCheckListenerIndex++) {
			loCheckListener = this.checkListeners.get(lCheckListenerIndex);
			if (oFF.isNull(loCheckListener)) {
				continue;
			}
			loCheckListener.switchPage(oFilterPage);
		}
	};
	sap.zen.AbstractFilterComponentBase.prototype.initialCheck = function() {
		var lCheckOK = true;
		if (oFF.notNull(this.oCharacteristicContainer)) {
			if (!this.oCharacteristicContainer.checkValues()) {
				lCheckOK = false;
			}
		}
		return lCheckOK;
	};
	sap.zen.AbstractFilterComponentBase.prototype.renderControlContent = function(
			renderManager) {
		var loRenderSerializer;
		if (oFF.isNull(this.oMessageManager)) {
			this.oMessageManager = sap.zen.ZenMessageManager.create(this
					.getPage());
		}
		this.oMessageManager.clearMessages();
		if (oFF.isNull(this.oCharacteristicWrappers) && !this.variableScreen) {
			this.oCharacteristicWrappers = this.getCharacteristicsContainer();
			if (oFF.isNull(this.oCharacteristicWrappers)) {
				return;
			}
			this.setCharacteristicContainer(this.oCharacteristicWrappers);
			this.forceFullRerendering();
		}
		loRenderSerializer = renderManager.getRenderSerializer();
		loRenderSerializer.addBooleanAttribute("visible", this.visibleFlag);
		if (this.changeVisibility) {
			loRenderSerializer.addBooleanAttribute("changeVisibility",
					this.changeVisibility);
			this.changeVisibility = false;
		} else {
			loRenderSerializer.addAttribute("view", this.view.toString());
			if (this.theForceFullRerendering) {
				loRenderSerializer.addBooleanAttribute("newds",
						this.theForceFullRerendering);
				this.theForceFullRerendering = false;
			}
			if (oFF.XString.isEqual(this.view.getValue(),
					sap.zen.View.VIEW_DEFAULT.getValue())) {
				this.oFilterDialogFor = null;
				this.renderFilterPanelJson(loRenderSerializer);
				this.renderAxisJson(loRenderSerializer);
			} else {
				if (oFF.XString.isEqual(this.view.getValue(),
						sap.zen.View.DIALOG.getValue())) {
					this.renderDialogJson(loRenderSerializer);
				} else {
					if (oFF.XString.isEqual(this.view.getValue(),
							sap.zen.View.DIALOG_SEARCH.getValue())) {
						this.renderSearchJson(loRenderSerializer);
					} else {
						if (oFF.XString.isEqual(this.view.getValue(),
								sap.zen.View.EXPAND_NODE.getValue())) {
							this.renderExpandedNode(loRenderSerializer);
						} else {
							this.oFilterDialogFor = null;
							this.renderFilterPanelJson(loRenderSerializer);
							this.renderAxisJson(loRenderSerializer);
						}
					}
				}
			}
			if (!this.getPage().isDeltaRendering() || this.theSetInitialJson) {
				this.renderInitialJson(loRenderSerializer);
				this.theSetInitialJson = false;
			}
			if (this.theFilterOrAxisChanged) {
				this.renderFilters(loRenderSerializer);
				this.renderAxisJson(loRenderSerializer);
				this.theFilterOrAxisChanged = false;
			}
			if (oFF.notNull(this.validatedFilterConfig)) {
				this.renderValidatedFilters(loRenderSerializer);
			}
			if (this.filterCanceled) {
				loRenderSerializer.addBooleanAttribute("filtercanceled",
						this.filterCanceled);
				this.filterCanceled = false;
			}
			if (this.isUseNavigationPanelHandler()) {
				loRenderSerializer.addBooleanAttribute("pauserefresh", this
						.isPauseRefresh());
			}
		}
		this.renderMessages(loRenderSerializer);
	};
