	sap.zen.InfoChartControl.prototype.getPropertyWithName = function(
			tPropertyNodes, propertyName) {
		var loNode = null;
		var loPropertyNodeIterator = tPropertyNodes.getIterator();
		var loPropertyNode;
		var lPropertyName;
		while (oFF.isNull(loNode) && loPropertyNodeIterator.hasNext()) {
			loPropertyNode = loPropertyNodeIterator.next();
			lPropertyName = loPropertyNode.getAttribute("id");
			if (oFF.XString.isEqual(propertyName, lPropertyName)) {
				loNode = loPropertyNode;
			}
		}
		return loNode;
	};
	sap.zen.InfoChartControl.prototype.renderAdditionProperties = function(
			oRenderSerializer) {
		var lReady;
		var loChartTypeNode;
		var lChartType;
		var loConfigNode;
		var lConfig;
		if (oFF.notNull(this.oResultSet)) {
			lReady = true;
			if (this.oResultSet.getState().isTypeOf(oFF.SyncState.PROCESSING)) {
				lReady = false;
			}
			oRenderSerializer.addBooleanAttribute("chartReady", lReady);
		}
		loChartTypeNode = this.getPropertyNode("charttype");
		if (oFF.notNull(loChartTypeNode)) {
			lChartType = loChartTypeNode.getAttribute("value");
			loConfigNode = loChartTypeNode.getFirstChildWithNameTag(lChartType);
			if (oFF.notNull(loConfigNode)) {
				lConfig = sap.zen.PageObject
						.convertXXmlNodeToJson(loConfigNode);
				oRenderSerializer.addAttribute("chartconfig", lConfig);
			}
		}
	};
	sap.zen.InfoChartControl.prototype.getSelections = function() {
		var ltSelectionsPerDimension = oFF.XHashMapByString.create();
		var loDataSource;
		var lDataSelectedJson;
		var loJsonParser;
		var loJsonRootElement;
		var ltJsonElementNames;
		var lElementNameIndex;
		var lDimensionName;
		var loDimension;
		var loInternalDimension;
		var loCharacteristicWrapper;
		var ltRange;
		var ltJsonList;
		var lListIndex;
		var lDimensionMemberKey;
		var loMemberWrapper;
		var loRange;
		var lDimensionNameForNav;
		if (!this.isVisibleRecursive()) {
			return ltSelectionsPerDimension;
		}
		loDataSource = this.getDataSource();
		lDataSelectedJson = this.getStringPropertyWithDefault("dataSelected",
				"{}");
		loJsonParser = this.getJsonParser();
		loJsonRootElement = loJsonParser.parse(lDataSelectedJson);
		ltJsonElementNames = loJsonRootElement.asStructure()
				.getKeysAsReadOnlyListOfString();
		for (lElementNameIndex = 0; lElementNameIndex < ltJsonElementNames
				.size(); lElementNameIndex++) {
			lDimensionName = ltJsonElementNames.get(lElementNameIndex);
			if (!oFF.XString.isEqual("[Measures]", lDimensionName)) {
				loDimension = sap.zen.Dimension.sGetDimension(loDataSource,
						lDimensionName);
				if (oFF.notNull(loDimension)) {
					loInternalDimension = loDimension.getInternalObject();
					loCharacteristicWrapper = sap.zen.CharacteristicWrapper
							.create(loDataSource, loInternalDimension, null,
									null, sap.zen.CMemberDisplayMode.KEY_TEXT,
									false);
					ltRange = oFF.XList.create();
					ltJsonList = loJsonRootElement.asStructure().getListByKey(
							loDimension.getName());
					for (lListIndex = 0; lListIndex < ltJsonList.size(); lListIndex++) {
						lDimensionMemberKey = ltJsonList
								.getStringAt(lListIndex);
						loMemberWrapper = new sap.zen.MemberKeyWrapper();
						loMemberWrapper.initMe(lDimensionMemberKey);
						loRange = new sap.zen.Range();
						loRange.initMe2(loMemberWrapper);
						ltRange.add(loRange);
					}
					ltRange = loCharacteristicWrapper
							.parseFullRangeQueryByField(loInternalDimension
									.getKeyField(), ltRange);
					lDimensionNameForNav = loDimension.getNavigationName();
					ltSelectionsPerDimension.put(lDimensionNameForNav, ltRange);
				}
			}
		}
		return ltSelectionsPerDimension;
	};
