	sap.zen.ZenTemplateService.prototype.createPage = function(oApplication,
			oWindow, appName, path, hanaMode, tParameters, designMode,
			dshControlId, oSdkLoader, pageId, oTemplateLoader, userAgent,
			oBookmarkService, oBookmarkRequestHandler, optimizeDSRequests,
			oLogging, oLocalization, rightToLeft) {
		var loPage = new sap.zen.Page();
		loPage.setFactory(sap.zen.ZenTemplateService.factory);
		loPage.setHanaMode(hanaMode);
		loPage.setDesignMode(designMode);
		loPage.setSDKLoader(oSdkLoader);
		loPage.setAppName(appName);
		loPage.setPageId(pageId);
		loPage.setTemplateLoader(oTemplateLoader);
		loPage.setUserAgent(userAgent);
		loPage.setMyWindow(oWindow);
		loPage.setBookmarkRequestHandler(oBookmarkRequestHandler);
		loPage.setBookmarkService(oBookmarkService);
		loPage.setOptimizeDSRequests(optimizeDSRequests);
		loPage.setXLogging(oLogging);
		loPage.setLocalization(oLocalization);
		loPage.setRightToLeft(rightToLeft);
		oSdkLoader.setPage(loPage);
		loPage.initBase(oApplication, oWindow, path, tParameters, dshControlId);
		return loPage;
	};
