		this.setTitle(this
				.getStringPropertyWithDefault("FILTERPANEL_TITLE", ""));
		this.setShowEmbedded(true);
		this.setLabel(true);
		this.setAppearance(sap.zen.CAppearance.valueOf2(this
				.getStringPropertyWithDefault("DISPLAY_MODE", "FILTERLIST")));
		this.setMemberDisplay(sap.zen.CMemberDisplayMode.valueOf2(this
				.getStringPropertyWithDefault("MEMBER_DISPLAY", "TEXT_KEY")));
		this.setOnSubmit(this.getStringPropertyWithDefault("ON_SUBMIT", ""));
