	sap.zen.NavigationPanelComponent.prototype.putKeyFiguresInList = function(
			tCharacteristicWrappers, oKeyfigureWrapper) {
		var ltCharacteristicWrappers = oFF.XListOfNameObject.create();
		var lCharacteristicIndex;
		var loCharacteristicWrapper;
		ltCharacteristicWrappers.add(oKeyfigureWrapper);
		for (lCharacteristicIndex = 0; lCharacteristicIndex < tCharacteristicWrappers
				.size(); lCharacteristicIndex++) {
			loCharacteristicWrapper = tCharacteristicWrappers
					.get(lCharacteristicIndex);
			if (oFF.isNull(loCharacteristicWrapper)) {
				continue;
			}
			ltCharacteristicWrappers.add(loCharacteristicWrapper);
		}
		return ltCharacteristicWrappers;
	};
